a'=>'يازما تەپسىلاتى','block bindings sourcePattern Overrides'=>'ئەندىزە قاپلاش','block descriptionDisplay the publish date for an entry such as a post or page.'=>'يازما ياكى بەتكە ئوخشاش يازمىلارنىڭ ئېلان قىلىنغان چېسلاسىنى كۆرسىتىدۇ.','block titleDate'=>'چېسلا','block titleContent'=>'مەزمۇن','block titleAuthor'=>'يازغۇچى','block keywordtoggle'=>'ئالماشتۇر','block keywordaccordion'=>'ئاككوردىيون','Export as JSON'=>'JSON چىقار','taxonomy singular namePattern Category'=>'ئەندىزە سەھىپە','taxonomy general namePattern Categories'=>'ئەندىزە سەھىپە','Expected string to start with script tag (without attributes) and end with script tag, with optional whitespace.'=>'مۆلچەرلىگەن ھەرپ تىزىقى قوليازما بەلگىسى سۈپىتىدە (خاسلىقسىز) باشلىنىپ قوليازما بەلگىسى بىلەن ئاخىرلىشىدۇ. (بوشلۇق تاللاشچان)','%d years'=>'%d يىل','a year'=>'بىر يىل','%d months'=>'%d ئاي','a month'=>'بىر ئاي','%d days'=>'%d كۈن','a day'=>'بىر كۈن','%d hours'=>'%d سائەت','an hour'=>'بىر سائەت','%d minutes'=>'%d مىنۇت','a minute'=>'بىر مىنۇت','%d seconds'=>'%d سېكۇنت','a second'=>'بىر سېكۇنت','Invalid template parent ID.'=>'قېلىپنىڭ ئانا كىملىكى ئىناۋەتسىز.','There is no autosave revision for this template.'=>'بۇ قېلىپنىڭ ئاپتوماتىك ساقلانغان تۈزىتىلگەن نۇسخىسى يوق.','This block is automatically inserted near any occurrence of the block types used as keys of this map, into a relative position given by the corresponding value.'=>'بۇ بۆلەك مەزكۇر خەرىتىلەنگەن كۇنۇپكىغا تەسىر كۆرسىتىدىغان تىپنىڭ خالىغان ماس كېلىدىغان تۈرنىڭ يېقىن ئەتراپىغا ئاپتوماتىك قىستۇرۇلىدۇ، ھەمدە مۇناسىپ قىممەت كۆرسەتكەن نىسپىي ئورۇنغا قىستۇرۇلىدۇ.','View Media File'=>'ۋاسىتە ھۆججەت كۆرسەت','Add New Media File'=>'يېڭى ۋاسىتە ھۆججەت قوش','Meta keys cannot enable revisions support unless the object subtype supports revisions.'=>'ئوبيېكت تارماق تىپى تۈزىتىلگەن نۇسخىنى قوللىمىغىچە، مېتا ئاچقۇچى تۈزىتىلگەن نۇسخا قوللاشنى قوزغىتالمايدۇ.','Meta keys cannot enable revisions support unless the object type supports revisions.'=>'ئوبيېكت تىپى 