كنىڭ بىردىنبىر پەرقلەندۈرگۈچىسى.','No fallback menu found.'=>'ھېچقانداق زاپاس تىزىملىك تېپىلمىدى.','Sorry, you are not allowed to edit Navigation Menus as this user.'=>'كەچۈرۈڭ، بۇ ئىشلەتكۈچى سالاھىيىتىڭىزدە يولباشچى تىزىملىكنى تەھرىرلىيەلمەيسىز.','Sorry, you are not allowed to create Navigation Menus as this user.'=>'كەچۈرۈڭ، بۇ ئىشلەتكۈچى سالاھىيىتىڭىزدە يولباشچى تىزىملىكنى قۇرالمايسىز.','Sorry, you are not allowed to view revisions for this global style.'=>'كەچۈرۈڭ، بۇ ئۇمۇمىيەت ئۇسلۇبىنىڭ تۈزىشلىرىنى كۆرەلمەيسىز.','Cannot find user global styles revisions.'=>'ئىشلەتكۈچى ئومۇمىيەت ئۇسلۇب تۈزىتىشلىرىنى تاپالمىدى.','Custom CSS selectors.'=>'ئىختىيارىچە CSS تاللىغۇچلار.','Where the pattern comes from e.g. core'=>'ئەندىزە نەدىن كەلگەن مەسىلەن، يادرو','Pattern updated.'=>'ئەندىزە يېڭىلاندى.','Pattern scheduled.'=>'ئەندىزە كۈنتەرتىپلەندى.','Pattern reverted to draft.'=>'ئەندىزە  دەسلەپكى نۇسخاغا قايتۇرۇلدى.','Pattern published privately.'=>'ئەندىزە ئايرىم تارقىتىلدى.','Pattern published.'=>'ئەندىزە تارقىتىلدى.','Patterns list navigation'=>'ئەندىزە تىزىمى يولباشچى','Filter patterns list'=>'ئەندىزە تىزىمى سۈزگۈچ','No patterns found.'=>'ئەندىزە تېپىلمىدى.','Search Patterns'=>'ئەندىزە ئىزدە','All Patterns'=>'ھەممە ئەندىزە','View Patterns'=>'ئەندىزە كۆرسەت','View Pattern'=>'ئەندىزە كۆرسەت','Edit Block Pattern'=>'بۆلەك ئەندىزە تەھرىر','New Pattern'=>'يېڭى ئەندىزە','Add New Pattern'=>'يېڭى ئەندىزە قوش','post type singular namePattern'=>'ئەندىزە','post type general namePatterns'=>'ئەندىزە','An image should not be lazy-loaded and marked as high priority at the same time.'=>'سۈرەت ئاستا يۈكلەنمەسلىكى ئۈچۈن، ئوخشاش ۋاقىتتا ئالدىنلىقى يۇقىرى قىلىپ بەلگە سېلىندى.','The Edit Media screen is deprecated as of WordPress 6.3. Please use the Media Library instead.'=>'ۋاسىتە تەھرىرلەش ئېكرانى WordPress 6.3 كە ئوخشاش. ئۇنىڭ ئورنىغا ۋاسىتە ئامبىرىنى ئىشلىتىڭ.','Object ID must be an integer, %s given.'=>'ئوبيېكت كىملىكى پۈتۈن سان بولۇشى كېرەك، %s بېرىلگەن.','Cannot supply a strategy `%1$s` for script `%2$s` because it is an alias (it lacks a `src` value).'=>'«%2$s» قوليازما ئۈچۈن «%1$s» ئىستراتېگىيەسىنى تەمىنلىيەلمەيدۇ چۈنكى لەقەم (ئۇنىڭ «src» قىممىتى كەم).','Invalid strategy `%1$s` defined for `%2$s` during script registration.'=>'قوليازما خەتلەش جەريانىدا «%2$s» غا ئېنىقلىما بېرىلگەن «%1$s» ئىستراتېگىيە ئىناۋەتسىز.','Page trashed.'=>'بەت ئەخلەتكە تاشلاندى.','Post trashed.'=>'يازما ئەخلەتكە تاشلاندى.','Title of a Navigation menuNavigation'=>'يولباشچى','Unable to convert Classic Menu to blocks.'=>'ئەنئەنىۋى تىزىملىكنى بۆلەككە ئايلاندۇرالمايدۇ.','No Classic Menus found.'=>'ھېچقانداق ئەنئەنىۋى تىزىملىك تېپىلمىدى.','The duotone id "%1$s" is not registered in %2$s settings'=>'بۇ duotone id نىڭ «%1$s» نى %2$s دىكى تەڭشەككە خەتلەتمىگەن','The menu provided is not a valid menu.'=>'تىزىملىك تەمىنلىگىنى ئىناۋەتلىك تىزىملىك ئەمەس.','Expand search field'=>'ئىزدە بۆلىكىنى ياي','Template namePage: 404'=>'بەت: 404','Template nameSearch Results'=>'ئىزدەش نەتىجىسى','Attachment Pages'=>'قوشۇمچە ھۆججەت بېتى','Template nameTag Archives'=>'بەلگە ئارخىپى','Template nameDate Archives'=>'چېسلا ئارخىپى','Template nameCategory Archives'=>'سەھىپە ئارخىپى','Template nameAuthor Archives'=>'يازغۇچى ئارخىپى','Template nameAll Archives'=>'بارلىق ئارخىپلار','Template nameSingle Entries'=>'يەككە يازما','Template nameBlog Home'=>'بىلوگ باش بەت','template part areaFooter'=>'بەت ئاستى','template part areaHeader'=>'بەت قاش','template part areaGeneral'=>'ئادەتتىكى','block categoryPatterns'=>'ئەندىزە','custom image headerHeader'=>'بەت قاش','custom backgroundBackground'=>'تەگلىك','Get Involved'=>'قاتنىشىش','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'زىيارەتچىلەرگە ئۆلۈك ئۇلانما ياكى خاتا تور ئادرېسىنى كىرگۈزگەندە كۆرۈنىدىغان بەت.','Displays your site\'s Privacy Policy page.'=>'بېكىتىڭىزنىڭ شەخسىيەت تۈزۈم بېتىنى كۆرسىتىدۇ.','Displays when a visitor performs a search on your website.'=>'زىيارەتچى تور بېكىتىڭىزدە ئىزدىگەندە كۆرۈنىدۇ.','Displays when a visitor views the dedicated page that exists for any media attachment.'=>'زىيارەتچى ۋاسىتە يۈكلەنمىسى بار مەخسۇس بەتنى كۆرگەندە كۆرسىتىدۇ.','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'يازما بەلگە ئاخىپىنى كۆرسىتىدۇ. بۇ قېلىپ بەلگىلەنگەن قېلىپ (مەسىلەن، بەلگە: پىتسا) نى تاپالمىغاندا قايتۇرۇش سۈپىتىدە ئىشلىتىدۇ.','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'بەلگىلەنگەن چېسلادا زىيارەت قىلىنغان يازما ئارخىپىنى  كۆرسىتىدۇ(مەسىلەن، example.com/2023/).','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'ئىختىيارى تۈرلىنىش ئارخىپىنى كۆرسىتىدۇ. سەھىپە ۋە بەلگىگە ئوخشاش تۈرلىنىشنىڭمۇ نەرسىلەرنى تۈرلەرگە بۆلىدىغان ئاتالغۇلىرى بولىدۇ. مەسىلەن: «سەنئەت» دەپ ئاتالغان تۈرلىنىش «زامانىۋى» ۋە «18-ئەسىر سەنئىتى» دېگەنگە ئوخشاش كۆپلىگەن ئاتالغۇلارنى ئۆز ئىچىگە ئالالايدۇ. بۇ قېلىپ مۇئەييەن قېلىپ (مەسىلەن، تۈرلىنىش: سەنئەت) نى تاپالمىغاندا قايتىش سۈپىتىدە ئىشلىتىلىدۇ.','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'يازما سەھىپە ئاخىپىنى كۆرسىتىدۇ. بۇ قېلىپ بەلگىلەنگەن قېلىپ (مەسىلەن، سەھىپە: رېسالە) نى تاپالمىغاندا قايتۇرۇش سۈپىتىدە ئىشلىتىدۇ.','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'ئايرىم يازغۇچىنىڭ يازما ئاخىپىنى كۆرسىتىدۇ. بۇ قېلىپ بەلگىلەنگەن قېلىپ (مەسىلەن، يازغۇچى: باشقۇرغۇچى) نى تاپالمىغاندا قايتۇرۇش سۈپىتىدە ئىشلىتىدۇ.','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'ئايرىم يازغۇچىنىڭ يازمىسى، سەھىپىسى، بەلگىسى، تۈرلىنىشى، ئىختىيارى يازما تىپى ۋە چېسلاسىنى ئۆز ئىچىگە ئالغان خالىغان ئارخىپنى كۆرسىتىدۇ، بۇ قېلىپ بەلگىلەنگەن قېلىپ (مەسىلەن، سەھىپە ياكى بەلگە) نى تاپالمىغاندا قايتۇرۇش سۈپىتىدە ئىشلىتىدۇ.','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'ئىختىيارى قېلىپ قوللانغان بەت ياكى مەخسۇس قېلىپ مەۋجۇت بولمىسىلا بارلىق مۇقىم بەتنى كۆرسىتىدۇ.','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'مەزكۇر يازمىغا ئىختىيارى قېلىپ قوللانغان ياكى مەخسۇس قېلىپ مەۋجۇت بولمىسىلا تور بېكىتىڭىزدىكى يەككە يازمىنى كۆرسىتىدۇ.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'يازما ياكى بەتكە ئوخشاش خالىغان بىر تۈرنى كۆرسىتىدۇ. بۇ قېلىپ بەلگىلەنگەن قېلىپ (مەسىلەن، بىر يازما، بەت ياكى يۈكلەنمە) نى تاپالمىغاندا قايتۇرۇش سۈپىتىدە ئىشلىتىدۇ.','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'ئۇ ئاخىرقى يازما ياكى مۇقىم بەتنى كۆرسىتىشكە تەڭشەلگەن بولۇشىدىن قەتئىينەزەر، تور بېكىتىڭىزنىڭ باش بېتىنى كۆرسىتىدۇ. باش بەت قېلىپىنىڭ ئالدىنلىقى باشقا بارلىق قېلىپلارنىڭ ئالدىدا تۇرىدۇ.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'ئوقۇش تەڭشىكىنىڭ ئاستىدا بەلگىلەنگەن بېكەتنىڭ باش بېتى ياكى «يازما بەت» سۈپىتىدە ئاخىرقى يازمىنى كۆرسىتىدۇ. ئەگەر ئۇ مەۋجۇت بولسا، يازما تور بېكەتتە كۆرسىتىلگەندە باش بەت قېلىپى بۇ قېلىپنى قاپلايدۇ.','Used as a fallback template for all pages when a more specific template is not defined.'=>'كۆپلىگەن قېلىپ بەلگىلەنمىگەندە بارلىق بەتلەرنىڭ قايتىش قېلىپى سۈپىتىدە ئىشلىتىلىدۇ.','Block pattern categoryAbout'=>'ھەققىدە','Block pattern categoryTeam'=>'قوشۇن','Block pattern categoryPosts'=>'يازما','Block pattern categoryBanners'=>'لەۋھەلەر','block descriptionThe author name.'=>'يازغۇچىنىڭ ئاتى.','block titleAuthor Name'=>'يازغۇچى ئاتى','block keywordpage'=>'بەت','block descriptionDisplays a page inside a list of all pages.'=>'بارلىق بەتلەرنىڭ تىزىمى ئىچىدىكى بىر بەتنى كۆرسىتىدۇ.','block titlePage List Item'=>'بەت تىزىمى تۈرى','Style Variations'=>'ئۇسلۇب خىللىرى','Position'=>'ئورنى','Sticky'=>'چوققا','https://wordpress.org/documentation/article/cookies/'=>'https://wordpress.org/documentation/article/cookies/','https://wordpress.org/documentation/article/reset-your-password/'=>'https://wordpress.org/documentation/article/reset-your-password/','https://wordpress.org/documentation/article/site-editor/'=>'https://wordpress.org/documentation/article/site-editor/','Array of column names to be searched.'=>'ئىزدەيدىغان رەت ئاتىنىڭ قاتارى.','The block types which can use this pattern.'=>'بۇ ئەندىزەنى ئىشلىتەلەيدىغان بۆلەك خىللىرى.','An array of template types where the pattern fits.'=>'ئەندىزە ماس كېلىدىغان قېلىپ خىللىرىنىڭ قاتارى.','The category description, in human readable format.'=>'سەھىپەلەرنىڭ كىشىلەر ئوقۇيالايدىغان پىچىمدىكى چۈشەندۈرۈشى.','Download file'=>'ھۆججەت چۈشۈر','Please check that the %s PHP extension is installed and enabled.'=>'بۇ %s PHP كېڭەيتىلمىسىنىڭ ئورنىتىلىپ قوزغىتىلغانلىقىنى تەكشۈرۈڭ.','When using the %1$s constant, make sure to set these globals to an array: %2$s.'=>'بۇ %1$s تۇراقلىق مىقدارىنى ئىشلەتكەندە، ئومۇمىيەت ئۆزگەرگۈچىنى سانلار قاتارىغا تەڭشەش جەزملىنىشى كېرەك: %2$s.','The query argument must be an array or a tag name.'=>'سۈرۈشتۈرۈش ئۆزگەرگۈچىسى سانلار قاتارى ياكى بەلگە ئىسمى بولۇشى كېرەك.','Invalid attribute name.'=>'ئىناۋەتسىز خاسلىق ئاتى.','Too many calls to seek() - this can lead to performance issues.'=>'بۇ seek() بەك كۆپ چاقىرىلدى-بۇ ئىقتىدار مەسىلىلىرىنى كەلتۈرۈپ چىقىرىدۇ.','Unknown bookmark name.'=>'يوچۇن خەتكۈچ ئىسمى.','Too many bookmarks: cannot create any more.'=>'خەتكۈچ بەك كۆپ: يەنە قۇرغىلى بولمايدۇ.','Warning: %1$s expects parameter %2$s (%3$s) to be a %4$s, %5$s given.'=>'ئاگاھلاندۇرۇش: %1$s نىڭ %2$s (%3$s) ئۆزگەرگۈچىسىگە %4$s، %5$s بېرىلىشى ئۈمىد قىلىندى.','https://wordpress.org/documentation/article/manage-wordpress-widgets/'=>'https://wordpress.org/documentation/article/manage-wordpress-widgets/','Sorry, replies to unapproved comments are not allowed.'=>'كەچۈرۈڭ، تەستىقلانمىغان ئىنكاسقا جاۋاب بەرگىلى بولمايدۇ.','Arguments cannot be prepared as both an Identifier and Value. Found the following conflicts: %s'=>'ئۆزگەرگۈچىنىڭ پەرقلەندۈرگۈچىسى ۋە قىممىتىنى ئالدىن تەييارلىغىلى بولمايدۇ. تۆۋەندىكى توقۇنۇش بايقالدى: %s','Values for the input array must be either objects or arrays.'=>'كىرگۈزۈلگەن سانلار قاتارىغا بېرىلگەن قىممەت چوقۇم ئوبيېكت ياكى سانلار قاتارى بولۇشى زۆرۈر.','The image already has the requested size.'=>'سۈرەتنىڭ تەلەپ قىلىنغان چوڭلۇقى بار.','https://wordpress.org/documentation/article/css/'=>'https://wordpress.org/documentation/article/css/','There&#8217;s no content to show here yet.'=>'تېخى بۇ جايدا كۆرسىتىدىغان مەزمۇن يوق.',': %s'=>': %s','untitled post %s'=>'ماۋزۇسىز يازما %s','Untitled post %d'=>'ماۋزۇسىز يازما %d','A variety of header designs displaying your site title and navigation.'=>'تور بېكەت ماۋزۇسى ۋە يولباشچىدا كۆرسىتىش ئۈچۈن لايىھەلەنگەن بەت قاش خىللىرى.','A variety of footer designs displaying information and site navigation.'=>'بېكەت يولباشچىسى ۋە ئۇچۇركۆرسىتىش ئۈچۈن لايىھەلەنگەن بەت ئاستى خىللىرى.','Different layouts containing video or audio.'=>'سىن ۋە ئۈن بار پەرقلىق جايلاشتۇرۇش.','Different layouts for displaying images.'=>'سۈرەت كۆرسىتىدىغان پەرقلىق جايلاشتۇرۇش.','Showcase your latest work.'=>'ئەڭ يېڭى يازمىلىرىڭىزنى كۆرسىتىڭ.','Block pattern categoryPortfolio'=>'تۈر توپلىمى','Introduce yourself.'=>'ئۆزىڭىزنى تونۇشتۇرۇڭ.','Display your contact information.'=>'ئالاقە ئۇچۇرىڭىزنى كۆرسىتىدۇ.','Block pattern categoryContact'=>'ئالاقىلىشىش','Briefly describe what your business does and how you can help.'=>'تىجارىتىڭىز ۋە مۇلازىمىتىڭىز ھەققىدە قىسقىچە چۈشەندۈرۈش بېرىڭ.','Block pattern categoryServices'=>'مۇلازىمەتلەر','Share reviews and feedback about your brand/business.'=>'ماركا/تىجارىتىڭىز ھەققىدىكى باھا ۋە پىكىرلەرنى ھەمبەھىرلەڭ.','Block pattern categoryTestimonials'=>'گۇۋاھنامەلەر','A variety of designs to display your team members.'=>'قوشۇن ئەزالىرىڭىزنى كۆرسىتىدىغان لايىھە خىللىرى.','Sections whose purpose is to trigger a specific action.'=>'كىمنىڭ نېمە ئىش قىلىدىغانلىقى ھەققىدىكى سەھىپە.','Block pattern categoryCall to Action'=>'مەشغۇلات چاقىرىقى','A set of high quality curated patterns.'=>'يۇقىرى سۈپەتلىك لايىھەلەنگەن ئەندىزە توپلىمى.','Display your latest posts in lists, grids or other layouts.'=>'تىزىم، سېتكا ياكى باشقا جايلاشتۇرۇشلاردا ئەڭ يېڭى يازمىلىرىڭىزنى كۆرسىتىدۇ.','Patterns containing mostly text.'=>'كۆپىنچەسى تېكىست بولغان ئەندىزە.','Multi-column patterns with more complex layouts.'=>'مۇرەككەپ جايلاشتۇرۇلغان كۆپ رەتلىك ئەندىزە.','Patterns that contain buttons and call to actions.'=>'توپچە ۋە مەشغۇلات چاقىرىقى بار ئەندىزە.','https://wordpress.org/documentation/'=>'https://wordpress.org/documentation/','User queries should not be run before the %s hook.'=>'ئىشلەتكۈچى سۈرۈشتۈرۈشى %s قارمىقىدىن ئىلگىرى ئىجرا قىلىنمايدۇ.','The %s argument must be a string or a string array.'=>'بۇ %s ئۆزگەرگۈچى چوقۇم ھەرپ تىزىقى ياكى ھەرپ تىزىقى سانلار قاتارى بولۇشى كېرەك.','Sorry, you are not allowed to view terms for this post.'=>'كەچۈرۈڭ، بۇ يازمىنىڭ تەپسىلاتىنى كۆرۈشىڭىزگە ئىجازەت بېرىلمىگەن.','Raw size value must be a string, integer, or float.'=>'دەسلەپكى چوڭلۇق قىممىتى چوقۇم ھەرپ تىزىقى، پۈتۈن سان ياكى كەسىر سان بولۇشى كېرەك.','block descriptionCreate a list item.'=>'بىر تىزىم تۈرى قۇرىدۇ.','block titleList item'=>'تىزىم تۈرى','block titleComments'=>'ئىزاھات','block titleComments Previous Page'=>'ئىزاھات ئالدىنقى بەت','block titleComments Page Numbers'=>'ئىزاھات بەت نومۇرى','block titleComments Next Page'=>'ئىزاھات كېيىنكى بەت','block titleCategories List'=>'سەھىپە تىزىمى','Default template'=>'كۆڭۈلدىكى قېلىپ','%s comment'=>'%s ئىنكاس' . "\0" . '%s ئىنكاس','Create a site or only a username:'=>'بېكەت قۇرىدۇ ياكى ئىشلەتكۈچى ئىسمىلا:','Site Domain (subdomain only):'=>'بېكەت تور ئادرېسى (پەقەت تارماق تور بېكەت):','Site Name (subdirectory only):'=>'بېكەت ئىسمى (تارماق مۇندەرىجىلا):','There doesn\'t seem to be a %s file. It is needed before the installation can continue.'=>'ھۆججەت %s يوقتەك قىلىدۇ. ئورنىتىشتىن ئىلگىرى ئۇ ھۆججەت لازىم.','The date and time the preferences were updated.'=>'مايىللىق چېسلا ۋە ۋاقىت يېڭىلاندى.','Whether the theme disables generated layout styles.'=>'ئۆرنەك ھاسىل قىلىنغان ئورۇنلاشتۇرۇش ئۇسلۇبىنى چەكلەمدۇ يوق.','Whether a theme uses block-based template parts.'=>'ئۆرنەك بۆلەك ئاساسىدىكى قېلىپ بۆلىكىنى ئىشلىتەمدۇ يوق.','$store must be an instance of WP_Style_Engine_CSS_Rules_Store'=>'$store چوقۇم WP_Style_Engine_CSS_Rules_Store نىڭ بىر مىسالى بولۇشى كېرەك','Revisions not enabled.'=>'تۈزىتىلگەن نۇسخا قوزغىتىلمىدى.','The template prefix for the created template. This is used to extract the main template type, e.g. in `taxonomy-books` extracts the `taxonomy`'=>'قۇرۇلغان قېلىپنىڭ قېلىپ ئالدى قوشۇلغۇچىسى. بۇ ئاساسلىق قېلىپ تىپىنى يېشىش ئۈچۈن ئىشلىتىلىدۇ. مەسىلەن، «taxonomy-books» دا «taxonomy» نى يېشىدۇ','Indicates if a template is custom or part of the template hierarchy'=>'قېلىپنىڭ ئىختىيارى ياكى قېلىپ دەرىجىسىنىڭ بىر قىسمى ئىكەنلىكىنى كۆرسىتىدۇ','The slug of the template to get the fallback for'=>'چېكىنىشكە ئېرىشىشكە ئىشلىتىدىغان قېلىپنىڭ قىسقارتما ئىسمى','The icon for the post type.'=>'يازما تىپىنىڭ سىنبەلگەسى.','If the value is a string, the value will be used as the archive slug. If the value is false the post type has no archive.'=>'ئەگەر قىممىتى ھەرپ تىزىقى بولسا، قىممىتى ئارخىپلاشتۇرىدىغان قىسقارتىلما قىلىپ ئىشلىتىلىدۇ. ئەگەر قىممىتى يالغان (false) بولسا، ئۇنداقتا يازما تىپى ئارخىپلانمايدۇ.','Public facing and editor style handle. DEPRECATED: Use `style_handles` instead.'=>'ئاممىۋى كۆرۈنۈش ۋە تەھرىرلىگۈچ ئۇسلۇبىنىڭ تۇتقۇچى. قوللىمايدۇ: ئورنىغا «style_handles» ئىشلىتىلىدۇ.','Editor style handle. DEPRECATED: Use `editor_style_handles` instead.'=>'تەھرىرلىگۈچ ئۇسلۇب تۇتقۇچى. قوللىمايدۇ: ئورنىغا «editor_style_handles» ئىشلىتىلىدۇ.','Public facing script handle. DEPRECATED: Use `view_script_handles` instead.'=>'ئاممىۋى كۆرۈنۈش قوليازما تۇتقۇچى. قوللىمايدۇ: ئورنىغا «view_script_handles» ئىشلىتىلىدۇ.','Public facing and editor script handle. DEPRECATED: Use `script_handles` instead.'=>'ئاممىۋى كۆرۈنۈش ۋە تەھرىرلىگۈچ قوليازما تۇتقۇچى. قوللىمايدۇ: ئورنىغا «script_handles» ئىشلىتىلىدۇ.','Editor script handle. DEPRECATED: Use `editor_script_handles` instead.'=>'تەھرىرلىگۈچ قوليازما تۇتقۇچى. قوللىمايدۇ: ئورنىغا «editor_script_handles» ئىشلىتىلىدۇ.','An array of post types that the pattern is restricted to be used with.'=>'بۇ يازما تىپى قاتارى بۆلەك ئەندىزە بىلەن بىرلىكتە سەپلەپ ئىشلىتىشكە چەكلەيدۇ.','REST API %1$s should be an array of arrays. Non-array value detected for %2$s.'=>'REST API %1$s سانلىق قاتارىدىن تەركىپ تاپقان سانلار قاتارى بولۇشى كېرەك. %2$s سانلار قاتارى ئەمەسلىكى بايقالدى.','If you are the owner of this network please check that your host&#8217;s database server is running properly and all tables are error free.'=>'بۇ تورنىڭ ئىگىسى بولسىڭىز ساھىبخان ساندان مۇلازىمېتىرىنىڭ راۋان ئىجرا بولۇۋاتقانلىقى ۋە بارلىق ساندان جەدۋەللىرىدە خاتالىق يوقلىقىنى تەكشۈرۈڭ.','<strong>Conflicting values for the constants %1$s and %2$s.</strong> The value of %2$s will be assumed to be your subdomain configuration setting.'=>'<strong>تۇراقلىق مىقدار %1$s ۋە %2$s نىڭ قىممەتلىرى توقۇنۇشۇپ قالدى.</strong> %2$s نىڭ قىممىتى قىسمىي تورىڭىزنىڭ سەپلىمە تەڭشىكى قىلىنىدۇ.','*'=>'*','Logged in as %1$s. <a href="%2$s">Edit your profile</a>. <a href="%3$s">Log out?</a>'=>'%1$s تىزىمغا كىردى. <a href="%2$s">تەرجىمىھال تەھرىر</a>. <a href="%3$s">تىزىمدىن چىقامدۇ؟</a>','%sX-Large'=>'%sX-چوڭ','%sX-Small'=>'%sX-كىچىك','Your %1$s file uses a dynamic value (%2$s) for the path at %3$s. However, the value at %3$s is also a dynamic value (pointing to %4$s) and pointing to another dynamic value is not supported. Please update %3$s to point directly to %4$s.'=>'سىز %3$s. يولنىڭ (%2$s) ئۆزگىرىشچان قىممەتنى %1$s ھۆججەتتە ئىشلەتكەن، %3$s دىكى قىممەتمۇ ئۆزگىرىشچان قىممەت (%4$s نى كۆرسەتكەن) ھەمدە باشقا بىر ئۆزگىرىشچان قىممەتنى كۆرسىتىشنى قوللىمايدۇ. %3$s نى بىۋاسىتە %4$s نى كۆرسىتىدىغان قىلىپ يېڭىلاڭ.','put your unique phrase here'=>'ئۆزگىچە ئىبارىڭىزنى كىرگۈزۈڭ','Cache key must be an integer or a non-empty string, %s given.'=>'غەملەك ئاچقۇچى چوقۇم پۈتۈن سان ياكى بوش بولمىغان ھەرپ تىزىقى بولۇشى كېرەك، %s بېرىلگەن.','Cache key must not be an empty string.'=>'غەملەك ئاچقۇچى بوش ھەرپ تىزىقى بولماسلىقى كېرەك.','There has been a critical error on this website. Please reach out to your site administrator, and inform them of this error for further assistance.'=>'تور بېكەتتە ئېغىر خاتالىق كۆرۈلدى. تور بېكەت باشقۇرغۇچى بىلەن ئالاقىلىشىپ، تور بېكەتتە خاتالىق كۆرۈلگەنلىكىنى ئۇلارنىڭ ياردەملىشىشىنى دېيىشىڭ.','When checking for the %s capability, you must always check it against a specific user.'=>'%s نىڭ ئىجازىتىنى تەكشۈرگەندە، ئىزچىل بەلگىلەنگەن ئىشلەتكۈچىگە ئاساسەن تەكشۈرۈڭ.','When checking for the %s capability, you must always check it against a specific term.'=>'%s نىڭ ئىجازىتىنى تەكشۈرگەندە، ئىزچىل بەلگىلەنگەن تۈرگە ئاساسەن تەكشۈرۈڭ.','When checking for the %s capability, you must always check it against a specific comment.'=>'%s نىڭ ئىجازىتىنى تەكشۈرگەندە، ئىزچىل بەلگىلەنگەن ئىنكاسقا ئاساسەن تەكشۈرۈڭ.','When checking for the %s capability, you must always check it against a specific page.'=>'%s نىڭ ئىجازىتىنى تەكشۈرگەندە، ئىزچىل بەلگىلەنگەن بەتكە ئاساسەن تەكشۈرۈڭ.','When checking for the %s capability, you must always check it against a specific post.'=>'%s نىڭ ئىجازىتىنى تەكشۈرگەندە، ئىزچىل بەلگىلەنگەن يازمىغا ئاساسەن تەكشۈرۈڭ.','Your object cache implementation does not support flushing individual groups.'=>'سىزنىڭ ئوبيېكت غەملەك ئەمەلىيلىشىشىڭىز يەككە گۇرۇپپىنى يېڭىلاشنى قوللىمايدۇ.','Your object cache implementation does not support flushing the in-memory runtime cache.'=>'سىزنىڭ ئوبيېكت غەملەك ئەمەلىيلىشىشىڭىز ئەسلەكتە ئىجرا قىلىنىدىغان غەملەك يېڭىلاشنى قوللىمايدۇ.','Deleted author: %s'=>'ئۆچۈرۈلگەن يازغۇچى: %s','Template for %s'=>'%s نىڭ قېلىپى','Not found: %1$s (%2$s)'=>'تېپىلمىدى: %1$s (%2$s)','Block pattern categoryFooters'=>'بەت ئاستى','Cron unschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'ئىلمەكنىڭ Cron كۈنتەرتىپىنى قالدۇرۇۋېتىشتە خاتالىق كۆرۈلدى: %1$s، خاتالىق كودى: %2$s، خاتالىق ئۇچۇرى: %3$s، سانلىق مەلۇمات: %4$s','Cron reschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'ئىلمەكنىڭ Cron كۈنتەرتىپىنى قايتا ئورۇنلاشتۇرۇشتا خاتالىق كۆرۈلدى: %1$s، خاتالىق كودى: %2$s، خاتالىق ئۇچۇرى: %3$s، سانلىق مەلۇمات: %4$s','Whether a theme uses block-based templates.'=>'ئۆرنەك بۆلەك ئاساسىدىكى قېلىپنى ئىشلىتەمدۇ يوق.','The ID of the page that should display the latest posts'=>'كۆرسىتىدىغان ئاخىرقى يازمىنىڭ بەت كىملىكى','The ID of the page that should be displayed on the front page'=>'باش بەتتە كۆرسىتىدىغان بەتنىڭ كىملىكى','What to show on the front page'=>'بىرىنچى بەتتە نېمە كۆرسىتىلىدۇ','File %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'%2$s نەشرىدىن باشلاپ %1$s نى ئىشلىتىش <strong>تەۋسىيە قىلىنمايدۇ</strong>، باشقا تاللاش يوق.','File %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'%2$s نەشرىدىن باشلاپ %1$s نى ئىشلىتىش <strong>تەۋسىيە قىلىنمايدۇ</strong>، ئورنىغا %3$s نى ئىشلىتىڭ.','Function %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'%2$s نەشرىدىن باشلاپ %1$s فونكسىيەنى ئىشلىتىش <strong>تەۋسىيە قىلىنمايدۇ</strong>، باشقا تاللاش يوق.','Function %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'%2$s نەشرىدىن باشلاپ %1$s فونكسىيەنى ئىشلىتىش <strong>تەۋسىيە قىلىنمايدۇ</strong>، ئورنىغا %3$s نى ئىشلىتىڭ.','block descriptionDisplays the link of a post, page, or any other content-type.'=>'يازما، بەت ياكى خالىغان باشقا مەزمۇن تىپىنىڭ ئۇلانمىسىنى كۆرسىتىدۇ.','block titleRead More'=>'تېخىمۇ كۆپ بىلدۈرگۈ','block descriptionContains the block elements used to render content when no query results are found.'=>'ھېچقانداق سۈرۈشتۈرۈش نەتىجىسى تېپىلمىغاندا مەزمۇننى ھاسىللاشتا ئىشلىتىدىغان بۆلەك ئېلېمېنتى.','block titleNo results'=>'نەتىجە يوق','block descriptionDisplay post author details such as name, avatar, and bio.'=>'يازما يازغۇچىنىڭ ئىسىم، سىما ۋە تەرجىمھالغا ئوخشاش تەپسىلاتلىرىنى كۆرسىتىدۇ.','block descriptionThe author biography.'=>'يازغۇچىنىڭ تەرجىمىھالى.','block titleAuthor Biography'=>'يازغۇچىنىڭ تەرجىمىھالى','block descriptionCreate a link that always points to the homepage of the site. Usually not necessary if there is already a site title link present in the header.'=>'تور بېكەتنىڭ ھەمىشە باش بېتىنى كۆرسىتىدىغان ئۇلانمىدىن بىرنى قۇرىدۇ. ئەگەر بېكەت ماۋزۇ ئۇلانمىسى بەت قاشتا كۆرۈلگەن بولسا ئۇنداق قىلىشنىڭ ھاجىتى يوق.','block titleHome Link'=>'باش بەت ئۇلانمىسى','block descriptionGather blocks in a layout container.'=>'بۆلەكلەرنى جايلاشتۇرۇش قاچىسىغا يىغىدۇ.','block descriptionDisplays a title with the number of comments.'=>'ئىنكاس سانى بىلەن قوشۇپ ماۋزۇنى كۆرسىتىدۇ.','block titleComments Title'=>'ئىنكاس ماۋزۇسى','block descriptionAn advanced block that allows displaying post comments using different visual configurations.'=>'پەرقلىق كۆرۈنۈش ئۈنۈمى سەپلىمىسىدە يازما ئىنكاسىنى كۆرسىتىشكە يول قويىدىغان ئالىي دەرىجىلىك بۆلەك.','block descriptionDisplays a paginated navigation to next/previous set of comments, when applicable.'=>'ئەگەر قوللانغىلى بولغاندا كېيىنكى/ئالدىنقى ئىنكاس توپلامىنى بەتكە ئايرىغان ھالدا يولباشچىدا كۆرسىتىدۇ.','block titleComments Pagination'=>'ئىنكاسنى بەتكە ئايرىش','block descriptionDisplays the previous comment\'s page link.'=>'ئالدىنقى ئىنكاسنىڭ بەت ئۇلانمىسىنى كۆرسىتىدۇ.','block descriptionDisplays a list of page numbers for comments pagination.'=>'ئىنكاسلارنى بەتكە ئايرىشنىڭ بەت نومۇرى تىزىمىنى كۆرسىتىدۇ.','block descriptionDisplays the next comment\'s page link.'=>'كېيىنكى ئىنكاسنىڭ بەت ئۇلانمىسىنى كۆرسىتىدۇ.','block descriptionContains the block elements used to display a comment, like the title, date, author, avatar and more.'=>'ماۋزۇ، چېسلا، ئاپتور، سىما ۋە باشقىلارغا ئوخشاش ئىنكاسنى كۆرسىتىشكە ئىشلىتىدىغان بۆلەك ئېلېمېنتىنى ئۆز ئىچىگە ئالىدۇ.','block titleComment Template'=>'ئىنكاس قېلىپى','block descriptionDisplays a link to reply to a comment.'=>'ئىنكاسقا جاۋاب قايتۇرۇش ئۇلانمىسىنى كۆرسىتىدۇ.','block titleComment Reply Link'=>'ئىنكاسقا جاۋاب قايتۇرۇش ئۇلانمىسى','block descriptionDisplays a link to edit the comment in the WordPress Dashboard. This link is only visible to users with the edit comment capability.'=>'WordPress باشقۇرۇش تاختىسىدىكى ئىنكاس تەھرىرلەش ئۇلانمىسىنى كۆرسىتىدۇ. بۇ ئۇلانما ئىنكاس تەھرىرلىيەلەيدىغان ئىشلەتكۈچىلەرگىلا كۆرۈنىدۇ.','block titleComment Edit Link'=>'ئىنكاس تەھرىرلەش ئۇلانمىسى','block descriptionDisplays the date on which the comment was posted.'=>'ئىنكاسنىڭ قايسى چېسلادا يوللانغانلىقىنى كۆرسىتىدۇ.','block descriptionDisplays the contents of a comment.'=>'ئىنكاسنىڭ مەزمۇنىنى كۆرسىتىدۇ.','block descriptionDisplays the name of the author of the comment.'=>'ئىنكاس يازغۇچىنىڭ ئىسمىنى كۆرسىتىدۇ.','block titleComment Author Name'=>'ئىنكاس يازغۇچىنىڭ ئىسمى','block descriptionAdd a user’s avatar.'=>'ئىشلەتكۈچىگە سىما قوشىدۇ.','block titleAvatar'=>'سىما','A WordPress Commenter'=>'WordPress ئىنكاسچى','Responses to %s'=>'%s غا ئىنكاس','Response to %s'=>'%s غا ئىنكاس','block titleComment Date'=>'ئىنكاس چېسلاسى','block titleComment Content'=>'ئىنكاس مەزمۇنى','Default Avatar'=>'كۆڭۈلدىكى سىما','There is already a ping from that URL for this post.'=>'بۇ يازمىنىڭ تور ئادرېسى ping ئارقىلىق ئېلىندى.','The password cannot be a space or all spaces.'=>'ئىم بىر بوشلۇق ياكى ھەممىسى بوشلۇق بولسا بولمايدۇ.','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'تېخىمۇ كۆپ ياردەمگە ئېھتىياجلىقمۇ؟ <a href="%1$s">%2$s دىكى قوللاش ماقالىسىنى ئوقۇڭ.</a>.','The database server could be connected to (which means your username and password is okay) but the %s database could not be selected.'=>'ساندان مۇلازىمېتىرىغا باغلىنالمىدى (بۇ سىز ئىشلەتكەن ئىشلەتكۈچى ئىسىم ۋە ئىم توغرا ئىكەنلىكىنى بىلدۈرىدۇ) ئەمما %s سانداننى تاللىيالمىدى.','Cannot select database'=>'سانداننى تاللىيالمايدۇ','That file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ئۇ ھۆججەتنى تاپالمىدى. <a href="%s">ۋاسىتە ئامبىرى</a> نى تەكشۈرۈپ ئۆچۈرۈلمىگەنلىكىگە كاپالەتلىك قىلىڭ.','Sorry, the video at the supplied URL cannot be loaded. Please check that the URL is for a supported video file (%s) or stream (e.g. YouTube and Vimeo).'=>'كەچۈرۈڭ، تەمىنلىگەن تور ئادرېسدىكى سىننى يۈكلىيەلمىدى. تەمىنلىگەن تور ئادرېسىدىكى سىننىڭ قوللايدىغان سىن ھۆججىتى (%s) ياكى ئېقىم ئىكەنلىكىنى تەكشۈرۈڭ (مەسىلەن، YouTube ۋە Vimeo).','That video cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'سىن ھۆججەتنى تاپالمىدى. <a href="%s">ۋاسىتە ئامبىرى</a> نى تەكشۈرۈپ ئۆچۈرۈلمىگەنلىكىگە كاپالەتلىك قىلىڭ.','That image cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ئۇ سۈرەتنى تاپالمىدى. <a href="%s">ۋاسىتە ئامبىرى</a> نى تەكشۈرۈپ ئۆچۈرۈلمىگەنلىكىگە كاپالەتلىك قىلىڭ.','That audio file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ئۈن ھۆججەتنى تاپالمىدى. <a href="%s">ۋاسىتە ئامبىرى</a> نى تەكشۈرۈپ ئۆچۈرۈلمىگەنلىكىگە كاپالەتلىك قىلىڭ.','User URL may not be longer than 100 characters.'=>'ئىشلەتكۈچى تور ئادرېسى 100 ھەرپتىن ئاشماسلىقى كېرەك.','Unable to pass %s if not using multisite.'=>'ئەگەر كۆپ تور بېكەت ئىشلىتىۋاتقان بولمىسىڭىز %s دىن ئۆتەلمەيدۇ.','Webfont font weight must be a properly formatted string or integer.'=>'Webfont خەت نۇسخىلىرى چوقۇم مۇئەييەن پىچىمدىكى ھەرپ تىزىقى ياكى پۈتۈن سان بولۇشى كېرەك.','Each webfont src must be a non-empty string.'=>'ھەر بىر webfont src چوقۇم بوش بولمىغان ھەرپ تىزىقى بولۇشى كېرەك.','Webfont src must be a non-empty string or an array of strings.'=>'بۇ webfont src چوقۇم بوش بولمىغان ھەرپ تىزىقى ياكى ھەرپ تىزىقى سانلار قاتارى بولۇشى كېرەك.','Webfont font family must be a non-empty string.'=>'Webfont خەت نۇسخا ئائىلىسى چوقۇم بوش بولمىغان ھەرپ تىزىقى بولۇشى كېرەك.','Limit results to those matching a pattern (slug).'=>'نەتىجىسىنى ئەندىزە (زەنجىر-سۆز) گە ماس كېلىدىغان نەتىجىلەر بىلەن چەكلەيدۇ.','Ancestor blocks.'=>'ئەجداد بۆلەكلەر.','Determines whether the pattern is visible in inserter.'=>'ئەندىزەنى قىستۇرغۇچتا كۆرگىلى بولىدىغان بولمايدىغانلىقىنى جەزملەيدۇ.','The pattern keywords.'=>'ئەندىزە ئاچقۇچلۇق سۆزلىرى.','The pattern category slugs.'=>'ئەندىزە سەھىپە زەنجىر-سۆزلىرى.','Block types that the pattern is intended to be used with.'=>'ئەندىزە ئىشلەتمەكچى بولغان بۆلەك تىپلىرى.','The pattern viewport width for inserter preview.'=>'قىستۇرغۇچ ئالدىن كۆزىتىشنىڭ ئەندىزە كۆرۈش نۇقتا كەڭلىكى.','The pattern detailed description.'=>'ئەندىزە تەپسىلىي چۈشەندۈرۈشى.','The pattern name.'=>'ئەندىزە ئىسمى.','Sorry, you are not allowed to view the registered block patterns.'=>'كەچۈرۈڭ، تىزىملاتقان بۆلەك ئەندىزەسىنى كۆرۈشىڭىزگە ئىجازەت بېرىلمىگەن.','The category label, in human readable format.'=>'كىشىلەر ئوقۇيالايدىغان پىچىمدىكى سەھىپە بەلگىسى.','The category name.'=>'سەھىپە ئىسمى.','Sorry, you are not allowed to view the registered block pattern categories.'=>'كەچۈرۈڭ، تىزىملاتقان بۆلەك ئەندىزە سەھىپەسىنى كۆرۈشىڭىزگە ئىجازەت بېرىلمىگەن.','Error in deleting the attachment.'=>'قوشۇمچىنى ئۆچۈرۈۋاتقاندا خاتالىق كۆرۈلدى.','<strong>Error:</strong> This is not a valid feed template.'=>'<strong>خاتالىق:</strong>بۇ ئىناۋەتلىك ئۇچۇر مەنبە قېلىپى ئەمەس.','unit symbolPB'=>'PB','unit symbolEB'=>'EB','unit symbolZB'=>'ZB','unit symbolYB'=>'YB','The description will be displayed in the menu if the active theme supports it.'=>'ئەگەر ئاكتىپ ئۆرنەك قوللىسا بۇ چۈشەندۈرۈش تىزىملىكتە كۆرسىتىلىدۇ.','A title on that page cannot be found.'=>'بۇ بەتتىكى ماۋزۇنى تاپالمىدى.','color schemeLight'=>'ئاق','color schemeDark'=>'قاراڭغۇ','<strong>Error:</strong> The themes directory is either empty or does not exist. Please check your installation.'=>'<strong>خاتالىق:</strong>ئۆرنەك مۇندەرىجىسى بوش ياكى مەۋجۇت ئەمەس. ئورناتمىڭىزنى تەكشۈرۈڭ.','File does not exist?'=>'ھۆججەت مەۋجۇت ئەمەس؟','Adding an RSS feed to this site’s homepage is not supported, as it could lead to a loop that slows down your site. Try using another block, like the <strong>Latest Posts</strong> block, to list posts from the site.'=>'بۇ تور بېكەتنىڭ باش بېتىگە RSS مەنبەسى قوشۇشنى قوللىمايدۇ، چۈنكى ئۇ تور بېتىڭىزنى ئاستىلىتىدىغان دەۋرىيلىكنى كەلتۈرۈپ چىقىرىدۇ. تور بېكەتتىكى يازمىلار تىزىمىنى كۆرسىتىدىغان <strong>ئەڭ يېڭى يازمىلار</strong> غا ئوخشاش باشقا بىر بۆلەكنى ئىشلىتىڭ.','Responses'=>'ئىنكاس','Response'=>'ئىنكاس','Older Comments'=>'كونىراق ئىنكاسلار','Newer Comments'=>'يېڭى ئىنكاسلار','(%s website link, opens in a new tab)'=>'(%s  تور بېكەت ئۇلانمىسى، يېڭى بىر بەتكۈچتە ئاچىدۇ)','(%s author archive, opens in a new tab)'=>'(%s  يازغۇچى ئارخىپى، يېڭى بىر بەتكۈچتە ئاچىدۇ)','%s Avatar'=>'%s  سىما','Could not register file "%s" as a block pattern ("Title" field missing)'=>'ھۆججەت «%s» نى بۆلەك ئەندىزە («ماۋزۇ» بۆلىكى كەم) سۈپىتىدە تىزىملىتالمىدى.','Could not register file "%1$s" as a block pattern (invalid slug "%2$s")'=>'ھۆججەت «%1$s» نى بۆلەك ئەندىزە (ئىناۋەتسىز قىسقارتما «%2$s») سۈپىتىدە تىزىملىتالمىدى.','Could not register file "%s" as a block pattern ("Slug" field missing)'=>'ھۆججەت «%s» نى بۆلەك ئەندىزە («قىسقارتما» بۆلىكى كەم) سۈپىتىدە تىزىملىتالمىدى.','Block pattern categoryFeatured'=>'تەۋسىيەلىك','Use Site Editor'=>'بېكەت تەھرىرلىگۈچ ئىشلەت','Hurray! Your theme supports site editing with blocks. <a href="%1$s">Tell me more</a>. %2$s'=>'قالتىس! ئۆرنەكىڭىز بۆلەك بويىچە تور بېكەت تەھرىرلەشنى قوللايدۇ. <a href="%1$s">«تېخىمۇ كۆپ بىلدۈرگۈ»</a>. %2$s','Site icon.'=>'بېكەت سىنبەلگىسى.','block descriptionDisplay the description of categories, tags and custom taxonomies when viewing an archive.'=>'ئارخىپنى كۆرسەتكەندە سەھىپە، بەلگە ۋە تۈرلىنىشىنىڭ چۈشەندۈرۈشىنى كۆرسىتىدۇ.','block titleTerm Description'=>'ئاتالغۇ چۈشەندۈرۈشى','block descriptionEdit the different global regions of your site, like the header, footer, sidebar, or create your own.'=>'بېكىتىڭىزنىڭ ماۋزۇ، بەت ئاستى، يان بالداققا ئوخشاش پەرقلىق ئومۇمىيەت دائىرىسىنى تەھرىرلەڭ ياكى ئۆزىڭىزنىڭكىنى قۇرۇڭ.','block titleTemplate Part'=>'قېلىپ پارچىسى','block descriptionCreate structured content in rows and columns to display information.'=>'قۇر ۋە رەتتە ئۇچۇر كۆرسىتىش ئۈچۈن قۇرۇلمىلىق مەزمۇن قۇرىدۇ.','block descriptionDisplays the name of this site. Update the block, and the changes apply everywhere it’s used. This will also appear in the browser title bar and in search results.'=>'بۇ تور بېكەتنىڭ ئىسمىنى كۆرسىتىدۇ. بۆلەك يېڭىلانسا ئۆزگىرىشلەر ئۇنى ئىشلەتكەن جايلارنىڭ ھەممىسىدە قوللىنىلىدۇ. توركۆرگۈنىڭ ماۋزۇ بالدىقى ۋە ئىزدەش نەتىجىسىدىمۇ ئىپادىلىنىدۇ.','block style labelPlain'=>'تەكشىلىك','block titlePagination'=>'بەتكە ئايرىش','block titlePrevious Page'=>'ئالدىنقى بەت','block titlePage Numbers'=>'بەت نومۇرى','block titleNext Page'=>'كېيىنكى بەت','block descriptionDisplays the next or previous post link that is adjacent to the current post.'=>'نۆۋەتتىكى يازمىغا قوشنا كېيىنكى ياكى ئالدىنقى يازما ئۇلانمىسىنى كۆرسىتىدۇ.','block titlePost Navigation Link'=>'يازما يولباشچى ئۇلانما','block descriptionDisplay a post\'s comments form.'=>'بىر يازمىنىڭ ئىنكاس جەدۋىلىنى كۆرسىتىدۇ.','block titleComments Form'=>'ئىنكاس جەدۋىلى','block descriptionShow a block pattern.'=>'بۆلەك ئەندىزە كۆرسىتىدۇ.','block titlePattern'=>'ئەندىزە','block descriptionA collection of blocks that allow visitors to get around your site.'=>'زىيارەتچىلەرنىڭ تور بېكىتىڭىزنى كۆرۈشىگە يول قويىدىغان بۆلەكلەر توپلىمى.','block titleNavigation'=>'يولباشچى','block descriptionAdd a submenu to your navigation.'=>'يولباشچىڭىزغا تارماق تىزىملىك قوشىدۇ.','block titleSubmenu'=>'تارماق تىزىملىك','block descriptionAdd a page, link, or another item to your navigation.'=>'يولباشچىڭىزغا بىر بەت، ئۇلىنىش ياكى باشقا تۈر قوشىدۇ.','block titleCustom Link'=>'ئىختىيارى ئۇلانما','block descriptionDisplay content in multiple columns, with blocks added to each column.'=>'كۆپ رەتتىكى ھەر بىر رەتكە قوشۇلغان بۆلەكتە مەزمۇن كۆرسىتىدۇ.','No comments'=>'ئىنكاس يوق','Confirm'=>'جەزملە','Could not strip invalid text.'=>'ئىناۋەتسىز تېكىستنى چىقىرىۋېتەلمەيدۇ.','Could not retrieve table charset.'=>'جەدۋەل ھەرپ توپلىمىنى ئىزدىيەلمەيدۇ.','WordPress database error: Processing the values for the following fields failed: %s. The supplied values may be too long or contain invalid data.'=>'WordPress ساندان خاتالىقى: تۆۋەندىكى سۆز بۆلىكىنىڭ قىممىتىنى بىر تەرەپ قىلالمىدى: %s. تەمىنلىگەن قىممەت بەك ئۇزۇن ياكى تەركىبىدە ئىناۋەتسىز سانلىق مەلۇمات بار.','WordPress database error: Processing the value for the following field failed: %s. The supplied value may be too long or contains invalid data.'=>'WordPress ساندان خاتالىقى: تۆۋەندىكى سۆز بۆلىكىنىڭ قىممىتىنى بىر تەرەپ قىلالمىدى: %s. تەمىنلىگەن قىممەت بەك ئۇزۇن ياكى تەركىبىدە ئىناۋەتسىز سانلىق مەلۇمات بار.','WordPress database error: Could not perform query because it contains invalid data.'=>'WordPress ساندان خاتالىقى: سۈرۈشتۈرۈشنى ئىجرا قىلالمىدى چۈنكى ئۇنىڭ تەركىبىدە ئىناۋەتسىز سانلىق مەلۇمات بار.','"%1$s" style should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'«%1$s» ئۇسلۇبىنى يېڭى ئەپچە تەھرىرلىگۈچ بىلەن بىرلەشتۈرۈشكە بولمايدۇ(%2$s ياكى %3$s).','"%1$s" script should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'«%1$s» قوليازمىنى يېڭى ئەپچە تەھرىرلىگۈچ بىلەن بىرلەشتۈرۈشكە بولمايدۇ(%2$s ياكى %3$s).','The description is not prominent by default; however, some themes may show it.'=>'بۇ چۈشەندۈرۈش ئادەتتىكى ئەھۋالدا كۆرۈنمىسىمۇ، لېكىن بۇنى كۆرسىتىدىغان ئۆرنەكلەرمۇ بار.','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band.'=>'قاتلام قۇرۇش ئۈچۈن بىر ئانا ئاتالغۇ بەلگىلەڭ، مەسىلەن، تارىلىق ساز دۇتار ۋە تەمبۇرنىڭ ئانا ئاتالغۇسى بولالايدۇ.','The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'«قىسقارتىلما» ئۇلىنىش ئىچىدە ئىشلەتكىلى بولىدىغان ئىسىم بولۇپ، ئادەتتە كىچىك ھالەتتە يېزىلغان ھەرپ-بەلگىلەردىن تۈزۈلىدۇ. پەقەت ھەرپ، سان ۋە ئۇلاش بەلگىلىرىنىلا ئىشلىتىشكە بولىدۇ.','The name is how it appears on your site.'=>'ئىسىم تور بېكىتىڭىزدە قانداق كۆرۈنىدۇ.','Template Part Area'=>'قېلىپ بۆلەك دائىرىسى','Template Part Areas'=>'قېلىپ بۆلەك دائىرىسى','The server cannot process the image. This can happen if the server is busy or does not have enough resources to complete the task. Uploading a smaller image may help. Suggested maximum size is 2560 pixels.'=>'مۇلازىمېتىر سۈرەتنى بىر تەرەپ قىلالمىدى. ئەگەر مۇلازىمېتىر بەك ئالدىراش ياكى ۋەزىپىنى تاماملاشقا يېتەرلىك مەنبەسى بولمىسا، بۇ خى ئەھۋال كۆرۈلىدۇ. كىچىكرەك سۈرەت يۈكلىسە ياردىمى بولۇشى مۇمكىن. سۈرەتنىڭ تەۋسىيە قىلىنىدىغان ئەڭ يۇقىرى چوڭلۇقى 2560 پىكسېل.','Limit result set to users who have published posts.'=>'ئىشلەتكۈچىلەر ئىچىدىكى يازما يازغۇچىلار ئۈچۈن نەتىجە توپلىمىنى چەكلەيدۇ.','Limit result set to users matching at least one specific capability provided. Accepts csv list or single capability.'=>'نەتىجە توپىنى ئاز دېگەندە بىر بەلگىلەنگەن رولغا ماس كېلىدىغان ئىشلەتكۈچى بىلەن چەكلەش. Csv تىزىمى ياكى يالغۇز رولنى قوللايدۇ.','Sorry, you are not allowed to filter users by capability.'=>'كەچۈرۈڭ، ئىشلەتكۈچىلەرنى بۇ رول بىلەن سۈزۈشىڭىزگە ئىجازەت بېرىلمىگەن.','Unable to retrieve body from response at this URL.'=>'بۇ تور ئادرېسى قايتۇرغان ئىنكاستىن گەۋدىسىنى ئىزدىيەلمەيدۇ.','URL not found. Response returned a non-200 status code for this URL.'=>'تور ئادرېسى تېپىلمىدى. بۇ تور ئادرېسىدىن 200 بولمىغان ھالەت كودى ئىنكاسىنى قايتۇردى.','Sorry, you are not allowed to process remote URLs.'=>'كەچۈرۈڭ، يىراقتىكى تور ئادرېسىنى بىر تەرەپ قىلىش ئىجازىتىڭىز يوق.','Invalid URL'=>'ئىناۋەتسىز URL','The Open Graph image link of the %1$s or %2$s element from the URL.'=>'تور ئادرېسىدىكى %1$s ياكى %2$s ئېلېمېنتىنىڭ ئوچۇق گىرافىك سۈرەت ئۇلانمىسى.','The content of the %s element from the URL.'=>'بۇ تور ئادرېسىدىكى %s ئېلېمېنتنىڭ مەزمۇنى.','The favicon image link of the %s element from the URL.'=>'بۇ تور ئادرېسىدىكى %s ئېلېمېنتنىڭ ياقتۇرىدىغان سىنبەلگە سۈرەت ئۇلانمىسى.','The contents of the %s element from the URL.'=>'بۇ تور ئادرېسىدىكى %s ئېلېمېنتنىڭ مەزمۇنى.','The URL to process.'=>'بىر تەرەپ قىلىدىغان تور ئادرېسى.','Where the template part is intended for use (header, footer, etc.)'=>'قېلىپ بۆلىكىنىڭ نەدە ئىشلىتىلىشى (بەت قاش، بەت ئاستى قاتارلىق.)','Whether a template is a custom template.'=>'قېلىپ ئىختىيارىچە قېلىپمۇ يوق.','The ID for the author of the template.'=>'قېلىپ يازغۇچىنىڭ كىملىكى.','HTML title for the template, transformed for display.'=>'كۆرسىتىشكە لايىقلاشتۇرۇلغان قېلىپنىڭ HTML ماۋزۇسى.','Title for the template, as it exists in the database.'=>'سانداندا مەۋجۇت قېلىپنىڭ ماۋزۇسى.','Version of the content block format used by the template.'=>'قېلىپتا ئىشلىتىلگەن بۆلەك قېلىپى پىچىمىنىڭ نەشرى.','Content for the template, as it exists in the database.'=>'سانداندا مەۋجۇت قېلىپنىڭ مەزمۇنى.','Source of a customized template'=>'ئىختىيارىچە قېلىپ مەنبەسى','Type of template.'=>'قېلىپ تىپى.','Post type to get the templates for.'=>'قېلىپنىڭ يازما تىپى.','Limit to the specified template part area.'=>'بەلگىلەنگەن قېلىپ بۆلىكى دائىرىسىنىڭ چېكى.','REST namespace route for the taxonomy.'=>'تۈرلىنىشنىڭ REST ئات بوشلۇق يولى.','Whether to make the post type available for selection in navigation menus.'=>'يولباشچى تىزىملىكىدە يازما تىپىنى تاللاشقا بولامدۇ يوق.','Whether to generate a default UI for managing this post type.'=>'مەزكۇر ھۆججەت تىپىنى باشقۇرۇشقا ئىشلىتىدىغان كۆڭۈلدىكى ئىشلەتكۈچى ئارايۈزى (UI) ھاسىل قىلامدۇ يوق.','The visibility settings for the post type.'=>'يازما تىپىنىڭ كۆرۈنۈشچان تەڭشىكى.','REST route\'s namespace for the post type.'=>'يازما تىپىنىڭ REST يولىنىڭ ئات بوشلۇقى.','Whether to automatically add top level pages to this menu.'=>'بۇ تىزىملىككە چوققا بەتنى ئۆزلۈكىدىن قوشامدۇ يوق.','The locations assigned to the menu.'=>'تىزىملىككە تەقسىملەنگەن ئورۇنلار.','The menu cannot be deleted.'=>'تىزىملىكنى ئۆچۈرگىلى بولمايدۇ.','Menus do not support trashing. Set \'%s\' to delete.'=>'تىزىملىكنى ئەخلەتخانىغا تاشلاشنى قوللىمايدۇ. ئۆچۈرۈش ئۈچۈن «%s» غا تەڭشىلىدۇ.','Sorry, you are not allowed to view menus.'=>'كەچۈرۈڭ، تىزىملىكلەرنى كۆرۈش ئىجازىتىڭىز يوق.','The ID of the assigned menu.'=>'بېكىتىلگەن تىزىملىكنىڭ كىملىكى.','The description of the menu location.'=>'تىزىملىك ئورنىنىڭ چۈشەندۈرۈشى.','The name of the menu location.'=>'تىزىملىك ​​ئورنىنىڭ ئىسمى.','Invalid menu location.'=>'ئىناۋەتسىز تىزىملىك ئورنى.','Sorry, you are not allowed to view menu locations.'=>'كەچۈرۈڭ، تىزىملىك ئورنىنى كۆرۈش ئىجازىتىڭىز يوق.','An alphanumeric identifier for the menu location.'=>'تىزىملىك ​​ئورنىنىڭ ھەرپ-سان پەرقلەندۈرگۈچىسى.','The terms assigned to the object in the %s taxonomy.'=>'%s تۈرلىنىشىدىكى ئوبيېكتنىڭ بەلگىلەنگەن ئاتالغۇسى.','Whether the menu item represents an object that no longer exists.'=>'تىزىملىك تۈرى مەۋجۇت بولمىغان ئوبيېكتنى بىلدۈرەمدۇ يوق.','The XFN relationship expressed in the link of this menu item.'=>'بۇ تىزىملىك تۈرىنىڭ ئۇلانمىسىدا ئىپادىلەيدىغان XFN مۇناسىۋىتى.','The URL to which this menu item points.'=>'بۇ تىزىملىك تۈرى كۆرسىتىدىغان تور ئادرېسى(URL).','The singular label used to describe this type of menu item.'=>'بۇ خىل تىزىملىك تۈرىنى چۈشەندۈرۈشكە ئىشلىتىدىغان بىرلىك بەلگە.','The target attribute of the link element for this menu item.'=>'بۇ تىزىملىك ​​تۈرىنىڭ ئۇلىنىش ئېلېمېنتىنىڭ نىشان خاسلىقى.','The database ID of the original object this menu item represents, for example the ID for posts or the term_id for categories.'=>'بۇ تىزىملىك تۈرى ۋەكىللىك قىلىدىغان ئەسلى ئوبيېكتنىڭ سانداندىكى (ID) كىملىكى، مەسىلەن، ماقالە كىملىك (ID) ى ياكى تارماق سەھىپىنىڭ term_id سى.','The type of object originally represented, such as "category", "post", or "attachment".'=>'ئوبيېكتنىڭ ئەسلى ئىپادىلەيدىغان تىپى، مەسىلەن، «سەھىپە»، «يازما» ياكى «يۈكلەنمە».','The DB ID of the nav_menu_item that is this item\'s menu parent, if any, otherwise 0.'=>'يولباشچى تىزىملىك تۈرى nav_menu_item نىڭ DB ID سى(ئەگەر بولسا)، بولمىسا 0.','The description of this menu item.'=>'بۇ تىزىملىك تۈرىنىڭ چۈشەندۈرۈشى.','Class names for the link element of this menu item.'=>'بۇ تىزىملىك تۈرىنىڭ ئۇلانما ئېلېمېنتىنىڭ خىل ئىسمى.','Text for the title attribute of the link element for this menu item.'=>'بۇ تىزىملىك ​​تۈرىنىڭ ئۇلىنىش ئېلېمېنتىنىڭ ماۋزۇ خاسلىقىنىڭ تېكىستى.','The ID for the parent of the object.'=>'ئوبيېكتنىڭ ئاتا كىملىكى.','A named status for the object.'=>'ئوبيېكتنىڭ ئاتالغان ھالىتى.','The family of objects originally represented, such as "post_type" or "taxonomy".'=>'ئوبيېكت ئەسلىدە ۋەكىللىك قىلىدىغان ئائىلىسى، مەسىلەن، «post_type» ياكى «taxonomy».','HTML title for the object, transformed for display.'=>'ئوبيېكتىڭ كۆرسەتكەندە ئۆزگىرىدىغان HTML ماۋزۇسى.','Title for the object, as it exists in the database.'=>'سانداندا مەۋجۇت ئوبيېكتنىڭ ماۋزۇسى.','Get linked object.'=>'ئۇلانغان ئوبيېكتقا ئېرىشىدۇ.','The url is required when using a custom menu item type.'=>'ئىختىيارى تىزىملىك تۈرىنىڭ تىپىنى ئىشلەتكەندە تور ئادرېسى زۆرۈر بولىدۇ.','The title is required when using a custom menu item type.'=>'ئىختىيارى تىزىملىك تۈرىنىڭ تىپىنى ئىشلەتكەندە ماۋزۇ زۆرۈر بولىدۇ.','Menu items do not support trashing. Set \'%s\' to delete.'=>'تىزىملىك تۈرىنى ئەخلەتخانىغا تاشلاشنى قوللىمايدۇ. ئۆچۈرۈش ئۈچۈن «%s» غا تەڭشىلىدۇ.','Sorry, you are not allowed to access the global styles on this site.'=>'كەچۈرۈڭ، بۇ بېكەتتىكى ئومۇمىيەت ئۇسلۇبلارنى زىيارەت قىلىش ئىجازىتىڭىز يوق