باشچى تىزىملىك ئىزدە','View Navigation Menu'=>'يولباشچى تىزىملىك كۆرسەت','Edit Navigation Menu'=>'يولباشچى تىزىملىك تەھرىر','New Navigation Menu'=>'يېڭى يولباشچى تىزىملىك','Add New Navigation Menu'=>'يېڭى يولباشچى تىزىملىك قوش','post type singular nameNavigation Menu'=>'يولباشچى تىزىملىك','post type general nameNavigation Menus'=>'يولباشچى تىزىملىك','Global styles to include in themes.'=>'ئۆرنەكلەردىكى ئومۇمىيەت ئۇسلۇبلار.','post type general nameGlobal Styles'=>'ئومۇمىيەت ئۇسلۇبلار','Template parts to include in your templates.'=>'قېلىپلىرىڭىزدىكى قېلىپ پارچىلىرى.','Template parts list'=>'قېلىپ پارچىلىرى تىزىمى','Template parts list navigation'=>'قېلىپ پارچىلىرى تىزىمى يولباشچىسى','Filter template parts list'=>'سۈزۈلگەن قېلىپ پارچىلىرى تىزىمى','Uploaded to this template part'=>'بۇ قېلىپقا يۈكلەنگەن پارچە','Insert into template part'=>'قېلىپ پارچىسىغا قىستۇر','Template part archives'=>'قېلىپ پارچە ئارخىپى','No template parts found in Trash.'=>'ئەخلەتخانىدا ھېچقانداق قېلىپ پارچىسى بايقالمىدى.','No template parts found.'=>'ھېچقانداق قېلىپ پارچىسى بايقالمىدى.','Parent Template Part:'=>'ئاتا قېلىپ پارچىسى:','Search Template Parts'=>'قېلىپ پارچىسى ئىزدە','Template Parts'=>'قېلىپ پارچىسى','View Template Part'=>'قېلىپ پارچىلىرىنى كۆرسەت','Edit Template Part'=>'قېلىپ پارچىسى تەھرىر','New Template Part'=>'يېڭى قېلىپ پارچە','Add New Template Part'=>'يېڭى قېلىپ پارچە قوش','post type singular nameTemplate Part'=>'قېلىپ پارچىسى','post type general nameTemplate Parts'=>'قېلىپ پارچىسى','post type singular nameTemplate'=>'قېلىپ','post type general nameTemplates'=>'قېلىپ','<strong>Error:</strong> This email address is already registered. <a href="%s">Log in</a> with this address or choose another one.'=>'<strong> خاتالىق:</strong> بۇ ئېلخەت ئادرېسى ئاللىقاچان تىزىملاتتى. بۇ ئادرېس بىلەن <a href="%s">تىزىمغا كىرىڭ</a> ياكى باشقا بىرىنى تاللاڭ.','media itemsUnattached'=>'يۈكلەنمىگەن','%1$s only accepts a non-empty path string, received %2$s.'=>'%1$s پەقەت بوش بولمىغان يول تىزىقىنىلا قوبۇل قىلىدۇ، تاپشۇرۇلغىنى  %2$s.','Error when decoding a JSON file at path %1$s: %2$s'=>'%1$s دىكى JSON ھۆججەتنىڭ كودىنى يېشىۋاتقاندا خاتالىق كۆرۈلدى:  %2$s','File %s doesn\'t exist!'=>'ھۆججەت %s مەۋجۇت ئەمەس!','Sorry, you are not allowed to upload this file type.'=>'كەچۈرۈڭ، بۇ خىل ھۆججەتنى يۈكلەش ئىجازىتىڭىز يوق.','Could not sanitize the %1$s option. Error code: %2$s'=>'بۇ %1$s تاللانمىنى بىخەتەر قىلالمايدۇ. خاتالىق كودى: %2$s','However, you can still <a href="%s">activate this theme</a>, and use the Site Editor to customize it.'=>'شۇنداقتىمۇ،  <a href="%s">بۇ ئۆرنەكنى ئاكتىپلاپ</a>، بېكەت تەھرىرلىگۈچتە ئۇنى ئىختىيارىي تەڭشىيەلەيسىز.','This theme doesn\'t support Customizer.'=>'بۇ ئۆرنەك ئىختىيارىيلاشتۇرۇشنى قوللىمايدۇ.','<strong>Error:</strong> Please fill the required fields.'=>'<strong>خاتالىق</strong>: زۆرۈر بۆلەكلەرنى تولدۇرۇڭ.','Block style name must not contain any spaces.'=>'بۆلەك ئۇسلۇبىنىڭ ئىسمىدا ھېچقانداق بوشلۇق بولماسلىقى كېرەك.','Template part has been deleted or is unavailable: %s'=>'قېلىپ پارچىسى ئۆچۈرۈلگەن ياكى ئىشلەتكىلى بولمايدۇ: %s','label before the title of the previous postPrevious:'=>'ئالدىنقى:','label before the title of the next postNext:'=>'كېيىنكى:','label for previous post linkPrevious'=>'ئالدىنقى','label for next post linkNext'=>'كېيىنكى','Close menu'=>'تىزىملىك ياپ','Open menu'=>'تىزىملىك ئاچ','%s submenu'=>'%s تارماق تىزىملىك','A link to a post format'=>'يازما پىچىمنىڭ بىر ئۇلانمىسى','Post Format Link'=>'يازما پىچىم ئۇلانمىسى','The calendar block is hidden because there are no published posts.'=>'يىلنامە بۆلىكى يوشۇرۇن چۈنكى ھېچقانداق يازما ئېلان قىلىنمىغان.','Unable to open export file (archive) for writing.'=>'يازماقچى بولغان چىقىرىلغان ھۆججەت (ئارخىپ) نى ئاچالمىدى.','Zip Export not supported.'=>'Zip چىقىرىشنى قوللىمايدۇ.','"%1$s" is not a supported wp_template_part area value and has been added as "%2$s".'=>'«%1$s» قوللايدىغان wp_template_part دائىرە قىممىتى ئەمەس ھەمدە «%2$s» سۈپىتىدە قوشۇلغان.','Template nameTaxono