ئاتى: %3$s','[%s] New Site Created'=>'[%s] يېڭى بېكەت قۇرۇلدى','%s failed while writing image to stream.'=>'سۈرەتنى ئېقىمغا يېزىۋاتقاندا %s مەغلۇپ بولدى.','The provided password is an invalid application password.'=>'تەمىنلەنگەن ئىم ئىناۋەتسىز ئەپ ئىمى.','Could not delete application passwords.'=>'ئەپ ئىمىنى ئۆچۈرەلمەيدۇ.','Could not delete application password.'=>'ئەپ ئىمىنى ئۆچۈرەلمەيدۇ.','Could not find an application password with that id.'=>'بۇ كىملىكتە ئەپ ئىمنى تاپالمايدۇ.','Could not save application password.'=>'ئەپ ئىمىنى ساقلىيالمايدۇ.','An application name is required to create an application password.'=>'ئەپ ئىمى قۇرۇش ئۈچۈن ئەپ ئىسمى زۆرۈر.','Copy URL to clipboard'=>'تور ئادرېسىنى چاپلاش تاختىسىغا كۆچۈر','Used as:'=>'ئىشلىتىگىنى:','%1$s must be a multiple of %2$s.'=>'%1$s چوقۇم %2$s نىڭ ھەسسىلىك سانى بولۇشى كېرەك.','%1$s must contain at most %2$s property.'=>'%1$s ئەڭ كۆپ بولغاندا %2$s خاسلىقنى ئۆز ئىچىگە ئېلىشى كېرەك.' . "\0" . '','%1$s must contain at least %2$s property.'=>'%1$s ئەڭ ئاز بولغاندا %2$s خاسلىقنى ئۆز ئىچىگە ئېلىشى كېرەك.' . "\0" . '','%s matches more than one of the expected formats.'=>'%s بىر قانچە مۆلچەردىكى پىچىمغا ماس كېلىدۇ.','%1$s matches %2$l, but should match only one.'=>'%1$s بىلەن %2$l ماس كېلىدۇ، ئەمما بىرىگىلا ماس كېلىشى كېرەك.','%s does not match any of the expected formats.'=>'%s مۆلچەردىكى پىچىمنىڭ ھېچقايسىسىغا ماس كەلمەيدۇ.','%1$s is not a valid %2$l.'=>'%1$s ئىناۋەتلىك %2$l ئەمەس.','%1$s does not match the expected format. Reason: %2$s'=>'%1$s ئۈمىد قىلغان پىچىمغا ماس كەلمىدى. سەۋەبى: %2$s','%1$s is not a valid %2$s. Reason: %3$s'=>'%1$s ئىناۋەتلىك %2$s ئەمەس. سەۋەبى: %3$s','The IP address the application password was last used by.'=>'ئالدىنقى قېتىم بۇ ئەپنىڭ ئىمىنى ئىشلەتكەن IP ئادرېس.','The GMT date the application password was last used.'=>'ئالدىنقى قېتىم بۇ ئەپنىڭ ئىمىنى ئىشلەتكەن GMT چېسلا.','The GMT date the application password was created.'=>'بۇ ئەپنىڭ ئىمىنى قۇرغان ۋاقىتتىكى GMT چېسلا.','The generated password. Only available after adding an application.'=>'ھاسىللىغان ئىم. پەقەت پىروگرامما قوشۇلغاندىن كېيىن ئاندىن ئىشلەتكىلى بولىدۇ.','The name of the application password.'=>'پىروگرامما ئىم ئىسمى.','A UUID provided by the application to uniquely identify it. It is recommended to use an UUID v5 with the URL or DNS namespace.'=>'پىروگرامما تەمىنلىگەن بىردىنبىر پەرقلەندۈرۈشكە ئىشلىتىلىدىغان UUID. تور ئادرېسى ياكى DNS (دائىرە ئىسمى مۇلازىمىتى) ئات بوشلۇقىنىڭ UUID v5 سى.','The unique identifier for the application password.'=>'ئەپ ئىمنىڭ بىردىنبىر پەرقلەندۈرگۈچىسى.','Application password not found.'=>'ئەپ ئىم تېپىلمىدى.','Application passwords are not available for your account. Please contact the site administrator for assistance.'=>'ھېساباتىڭىز پىروگرامما ئىمنى ئىشلىتەلمەيدۇ. بېكەت باشقۇرغۇچى بىلەن ئالاقىلىشىپ ياردەمگە ئېرىشىڭ.','Application passwords are not available.'=>'ئەپ ئىمنى ئىشلەتكىلى بولمايدۇ.','Sorry, you are not allowed to manage application passwords for this user.'=>'كەچۈرۈڭ. بۇ ئىشلەتكۈچىنىڭ ئەپ ئىمىنى باشقۇرۇش ئىجازىتىڭىز يوق.','HTML containing an action to direct the user to where they can resolve the issue.'=>'HTML ئىشلەتكۈچىنى بىۋاسىتە مەسىلىنى ھەل قىلىدىغان جايغا باشلاپ بارىدىغان مەشغۇلاتنى ئۆز ئىچىگە ئالىدۇ.','A more descriptive explanation of what the test looks for, and why it is important for the user.'=>'سىناش مەقسىتىنى بايان قىلىدىغان تەپسىلىي چۈشەندۈرۈش ۋە ئۇنىڭ ئىشلەتكۈچى ئۈچۈن نېمىشقا مۇھىملىقى.','The category this test is grouped in.'=>'بۇ سىناق سەھىپە گۇرۇپپىلانغان.','The status of the test.'=>'سىناقنىڭ ھالىتى.','A label describing the test.'=>'سىناقنى تەسۋىرلەيدىغان بەلگە.','The name of the test being run.'=>'ئىجرا قىلىنىۋاتقان سىناقنىڭ ئىسمى.','Directory sizes could not be returned.'=>'مۇندەرىجە چوڭلۇقىنى قايتۇرالمىدى.','Version of block API.'=>'بۆلەك API نەشرى.','Invalid parameters.'=>'ئىناۋەتسىز ئۆزگەرگۈچىلەر.','The requested route does not support batch requests.'=>'ئىلتىماس قىلىنغان يول تۈركۈم تەلەپلىرىنى قوللىمايدۇ.','Could not parse the path.'=>'يولنى تەھلىل قىلالمىدى.','The handler for the route is invalid.'=>'بۇ يولنى بىر تەرەپ قىلغۇچ ئىناۋەتسىز.','You need to pass an array of post formats.'=>'سىز يەتكۈزمەكچى بولغان يازما پىچىمىنىڭ سانلار گۇرۇپپىسى.','This password reset request originated from the IP address %s.'=>'ئىمنى ئەسلىگە قايتۇرۇش ئىلتىماسىنىڭ IP ئادرېس %s.','Sorry, you are not allowed to comment on this post.'=>'كەچۈرۈڭ، بۇ يازمىغا ئىنكاس يېزىش ئىجازىتىڭىز يوق.','The %s constant is no longer supported.'=>'بۇ %s تۇراقلىق مىقدارنى ئەمدى قوللىمايدۇ.','There is a new version of %s available, but it does not work with your version of PHP.'=>'%s نىڭ يېڭى نەشرى بار، ئەمما ئۇ سىزنىڭ PHP نەشرىڭىزدە ئىشلىمەيدۇ.','There is a new version of %s available, but it does not work with your version of WordPress.'=>'%s نىڭ يېڭى نەشرى بار، ئەمما ئۇ سىزنىڭ WordPress نەشرىڭىزدە ئىشلىمەيدۇ.','There is a new version of %s available, but it does not work with your versions of WordPress and PHP.'=>'%s نىڭ يېڭى نەشرى بار، ئەمما ئۇ سىزنىڭ WordPress ۋە PHP نەشرىڭىزدە ئىشلىمەيدۇ.','This theme does not work with your version of PHP.'=>'بۇ ئۆرنەك سىزنىڭ PHP نەشرىڭىزدە ئىشلىمەيدۇ.','This theme does not work with your version of WordPress.'=>'بۇ ئۆرنەك سىزنىڭ WordPress نەشرىڭىزدە ئىشلىمەيدۇ.','<a href="%s">Learn more about updating PHP</a>.'=>'<a href="%s"> PHP نى يېڭىلاش ھەققىدىكى تەپسىلاتلار</a>.','<a href="%s">Please update WordPress</a>.'=>'<a href="%s">WordPress نى يېڭىلاڭ</a>.','<a href="%1$s">Please update WordPress</a>, and then <a href="%2$s">learn more about updating PHP</a>.'=>'<a href="%1$s">WordPress نى يېڭىلاڭ</a>، ئاندىن <a href="%2$s"> PHP نى يېڭىلاش ھەققىدىكى تەپسىلاتلارنى كۆرۈڭ</a>.','This theme does not work with your versions of WordPress and PHP.'=>'بۇ ئۆرنەك سىزنىڭ WordPress ۋە PHP نەشرىڭىزدە ئىشلىمەيدۇ.','Please use %s to add new schema properties.'=>'يېڭى لايىھە خاسلىقىنى قوشۇش ئۈچۈن %s نى ئىشلىتىڭ.','The "%s" must be a callable function.'=>'بۇ «%s» چاقىرغىلى بولىدىغان فونكسىيە بولۇشى كېرەك.','Unauthorized. You may remove the %s param to preview as frontend.'=>'ئىجازەت بېرىلمىگەن. سىز %s سۈرۈشتۈرۈش پارامېتىرىنى چىقىرىۋېتىپ ئالدى ئۇچتا كۆرسىتىشكە قۇلايلىق يارىتالايسىز.','The "%1$s" option key has been renamed to "%2$s".'=>'بۇ «%1$s» تاللانما كۇنۇپكىنىڭ ئىسمى «%2$s» غا ئۆزگەرتىلدى.','Sorry, you are not allowed to manage network plugins.'=>'كەچۈرۈڭ، تور قىستۇرمىسىنى باشقۇرۇش ئىجازىتىڭىز يوق.','The REST API route definition for %1$s is missing the required %2$s argument. For REST API routes that are intended to be public, use %3$s as the permission callback.'=>'%1$s نىڭ REST API يول تاللاش ئېنىقلىمىسىدا زۆرۈر بولغان %2$s ئۆزگەرگۈچىسى كەم. ئاشكارىلىماقچى بولغان REST API يول تاللاشقا نىسبەتەن، %3$s نى قايتا چاقىرىش ھوقۇقى سۈپىتىدە ئىشلىتىڭ.','Could not update attachment in the database.'=>'سانداندىكى قوشۇمچىنى يېڭىلىيالمايدۇ.','Sorry, you are not allowed to activate this plugin.'=>'كەچۈرۈڭ، بۇ قىستۇرمىنى ئاكتىپلاش ئىجازىتىڭىز يوق.','by %s'=>'يازغۇچى %s','Menu Item'=>'تىزىملىك تۈرى','Comment'=>'ئىزاھات','Crop'=>'قايچىلا','The file URL has been copied to your clipboard'=>'ھۆججەت تور ئادرېسى چاپلاش تاختىڭىزغا كۆچۈرۈلدى','Embed Handler'=>'سىڭدۈرمە بىر تەرەپ قىلغۇچ','Read the <a href="%s" target="_blank">Debugging a WordPress Network</a> article. Some of the suggestions there may help you figure out what went wrong.'=>'<a href="%s" target="_blank">WordPress تورىنى سازلاش</a> ماقالىسىنى ئوقۇڭ . ئۇ يەردىكى بەزى كۆرسەتمىلەر نېمە خاتالىق بارلىقىنى تېىپىشىڭىزغا ياردىمى بولۇشى مۇمكىن.','Block pattern category "%s" not found.'=>'بۆلەك ئەندىزە سەھىپەسى «%s» تېپىلمىدى.','Block pattern category name must be a string.'=>'بۆلەك ئەندىزە سەھىپە ئىسمى چوقۇم ھەرپ تىزىقى بولۇشى كېرەك.','Block pattern categoryText'=>'تېكىست','Block pattern categoryHeaders'=>'بەت قاش','Block pattern categoryGallery'=>'سۈرەتدان','Block pattern categoryColumns'=>'رەت','Block pattern categoryButtons'=>'توپچە','Return a %1$s or %2$s object from your callback when using the REST API.'=>'REST API ئىشلەتكەندە، قايتا چاقىرىش نەتىجىسىدىن %1$s ياكى %2$s ئوبيېكتىنى قايتۇرىدۇ.','unit symbolB'=>'B','unit symbolKB'=>'كىلوبايت','unit symbolMB'=>'مېگابايت','unit symbolGB'=>'گىگابايت','unit symbolTB'=>'تېرابايت','admin color schemeModern'=>'زامانىۋى','archive title%1$s %2$s'=>'%1$s: %2$s','taxonomy term archive title prefix%s:'=>'%s:','post type archive title prefixArchives:'=>'ئارخىپلار:','date archive title prefixDay:'=>'كۈن:','date archive title prefixMonth:'=>'ئاي:','date archive title prefixYear:'=>'يىل:','author archive title prefixAuthor:'=>'يازغۇچى:','tag archive title prefixTag:'=>'بەلگە:','category archive title prefixCategory:'=>'سەھىپە:','<strong>Error:</strong> There was a problem creating site entry.'=>'<strong>خاتالىق:</strong> تور بېكەت تۈرى قوشۇشتا مەسىلە كۆرۈلدى.','<strong>Error:</strong> Site URL you&#8217;ve entered is already taken.'=>'<strong>خاتالىق:</strong> سىز كىرگۈزگەن تور بېكەت تور ئادرېسى ئاللىبۇرۇن ئىشلىتىلىپ بولغان.','Pattern "%s" not found.'=>'ئەندىزە «%s» تېپىلمىدى.','Pattern content must be a string.'=>'ئەندىزە مەزمۇنى چوقۇم ھەرپ تىزىقى بولۇشى كېرەك.','Pattern title must be a string.'=>'ئەندىزە ماۋزۇسى چوقۇم ھەرپ تىزىقى بولۇشى كېرەك.','Pattern name must be a string.'=>'ئەندىزە ئىسمى چوقۇم ھەرپ تىزىقى بولۇشى كېرەك.','Attachment details'=>'قوشۇمچە ھۆججەت تەپسىلاتى','Add media'=>'ۋاسىتە قوش','Could not insert attachment into the database.'=>'يۈكلەنمىنى ساندانغا قىستۇرالمىدى.','Could not update comment in the database.'=>'سانداندىكى ئىنكاسنى يېڭىلىيالمايدۇ.','File URL:'=>'ھۆججەت ئادرېسى:','%s is not a valid UUID.'=>'%s ئىناۋەتلىك UUID ئەمەس.','Invalid hex color.'=>'ئىناۋەتسىز hex رەڭ.','%1$s does not match pattern %2$s.'=>'%1$s قېلىپ %2$s غا ماس كەلمىدى.','%1$s must be at most %2$s character long.'=>'%1$s ئەڭ كۆپ بولغاندا %2$s ھەرپ بولۇشى كېرەك.' . "\0" . '','%1$s must be at least %2$s character long.'=>'%1$s ئەڭ ئاز بولغاندا %2$s ھەرپ بولۇشى كېرەك.' . "\0" . '','%1$s is a required property of %2$s.'=>'%2$s نىڭ زۆرۈر خاسلىقى %1$s.','%s has duplicate items.'=>'%s تەكرار تۈر.','%1$s must contain at most %2$s item.'=>'%1$s ئەڭ كۆپ بولغاندا %2$s تۈرنى ئۆز ئىچىگە ئېلىشى كېرەك.' . "\0" . '','%1$s must contain at least %2$s item.'=>'%1$s ئەڭ ئاز بولغاندا %2$s تۈرنى ئۆز ئىچىگە ئېلىشى كېرەك.' . "\0" . '','The "type" schema keyword for %1$s can only be one of the built-in types: %2$l.'=>'%1$s نىڭ «type» سىخىما چۈشەندۈرۈشىنىڭ ھالقىلىق سۆزى تۆۋەندىكى ئىچىدىكى تىپلارنىڭ بىرىلا بولىدۇ: %2$l.','The "type" schema keyword for %s is required.'=>'%s نىڭ «type» سىخېما ھالقىلىق سۆزى بولۇشى زۆرۈر.','Cannot stabilize objects. Convert the object to an array first.'=>'ئوبيېكتنى مۇقىملاشتۇرالمايدۇ. ئالدى بىلەن ئوبيېكتنى سانلار قاتارىغا ئايلاندۇرۇش كېرەك.','The "type" schema keyword for %1$s can only contain the built-in types: %2$l.'=>'%1$s نىڭ «type» سىخىما ھالقىلىق سۆزى تۆۋەندىكى ئىچىدىكى تىپلارنىڭ بىرىنىلا ئۆز ئىچىگە ئالىدۇ: %2$l.','%1$s (%2$s)'=>'%1$s (%2$s)','This notice was triggered by the %s handle.'=>'بۇ ئۇقتۇرۇشنى %s تۇتقۇچ قوزغاتقان.','Please consider writing more inclusive code.'=>'تېخىمۇ كۆپ كود يېزىشنى ئويلىشىپ كۆرۈڭ.','URL to the edited image file.'=>'تەھرىرلەنگەن سۈرەت ھۆججىتىنىڭ تور ئادرېسى.','Unable to crop this image.'=>'بۇ سۈرەتنى قايچىلىيالمايدۇ.','Unable to rotate this image.'=>'بۇ سۈرەتنى ئايلاندۇرالمايدۇ.','Unable to edit this image.'=>'بۇ سۈرەتنى تەھرىرلىيەلمەيدۇ.','The image was not edited. Edit the image before applying the changes.'=>'سۈرەت تەھرىرلەنمىگەن. ئۆزگەرتىشلەرنى قوللىنىشتىن ئىلگىرى سۈرەت تەھرىرلىنىدۇ.','This type of file cannot be edited.'=>'بۇ خىل ھۆججەتنى تەھرىرلەشكە بولمايدۇ.','Unable to get meta information for file.'=>'ھۆججەتنىڭ مېتا ئۇچۇرىغا ئېرىشەلمىدى.','Limit result set to blocks matching the search term.'=>'نەتىجە توپلىمىنى ئىزدىگەن ئاتالغۇغا ماس كەلگەن بۆلەكتە چەكلەيدۇ.','The date when the block was last updated, in fuzzy human readable format.'=>'مۈجمەل ئوقۇغىلى بولىدىغان پىچىمدىكى بۆلەك يېڭىلانغاندىكى سانلىق مەلۇمات چېسلاسى.','The block icon.'=>'بۆلەك سىنبەلگىسى.','The WordPress.org username of the block author.'=>'بۆلەك يازغۇچىسىنىڭ WordPress.org ئىشلەتكۈچى ئاتى.','The number of blocks published by the same author.'=>'مەزكۇر يازغۇچى تارقاتقان بۆلەكلەرنىڭ سانى.','The average rating of blocks published by the same author.'=>'مەزكۇر يازغۇچى تارقاتقان بۆلەكلەرنىڭ ئوتتۇرىچە باھالىنىشى.','The number sites that have activated this block.'=>'بۇ بۆلەكنى ئاكتىپلىغان بېكەتلەرنىڭ سانى.','The number of ratings.'=>'باھالىنىش سانى.','The star rating of the block.'=>'بۆلەكنىڭ يۇلتۇزلۇق باھالىنىشى.','The block slug.'=>'بۆلەك slug.','A short description of the block, in human readable format.'=>'بۆلەكنىڭ كىشىلەر ئوقۇيالايدىغان پىچىمدىكى قىسقا چۈشەندۈرۈشى.','The block title, in human readable format.'=>'كىشىلەر ئوقۇيالايدىغان پىچىمدىكى بۆلەك ماۋزۇسى.','The block name, in namespace/block-name format.'=>'بۆلەك ئىسمى، ئات بوشلۇقى/بۆلەك ئىسىم پىچىمى.','Sorry, you are not allowed to browse the block directory.'=>'كەچۈرۈڭ، بۆلەك مۇندەرىجىسىگە كۆز يۈگۈرتۈش ئىجازىتىڭىز يوق.','This username is invalid because it uses illegal characters. Please enter a valid username.'=>'بۇ ئىشلەتكۈچى ئاتى ئىناۋەتسىز چۈنكى ئۇ قوللىمايدىغان ھەرپلەرنى ئىشلەتكەن. ئىناۋەتلىك ئىشلەتكۈچى ئاتىنى كىرگۈزۈڭ.','Limits results to plugins with the given status.'=>'نەتىجەنى بېرىلگەن ھالەتكە ماس كەلگەن قىستۇرمىدا چەكلەيدۇ.','The plugin\'s text domain.'=>'قىستۇرمىنىڭ تېكست دائىرە نامى.','Minimum required version of PHP.'=>'PHP نىڭ ئەڭ تۆۋەن نەشر تەلىپى.','Minimum required version of WordPress.'=>'WordPress نىڭ ئەڭ تۆۋەن نەشر تەلىپى.','Whether the plugin can only be activated network-wide.'=>'قىستۇرما پەقەت توردىلا ئاكتىپلىنامدۇ يوق.','The plugin version number.'=>'قىستۇرمىنىڭ نەشر نومۇرى.','The plugin description formatted for display.'=>'قىستۇرمىنىڭ كۆرسىتىشكە لايىقلاشقان پىچىمدىكى چۈشەندۈرۈشى.','The raw plugin description.'=>'ئەسلى قىستۇرما چۈشەندۈرۈشى.','The plugin description.'=>'قىستۇرما چۈشەندۈرۈشى.','Plugin author\'s website address.'=>'قىستۇرما يازغۇچىنىڭ تور بېكەت ئادرېسى.','The plugin author.'=>'قىستۇرما يازغۇچى.','The plugin\'s website address.'=>'قىستۇرمىنىڭ تور بېكەت ئادرېسى.','The plugin name.'=>'قىستۇرما ئىسمى.','The plugin file.'=>'قىستۇرما ھۆججەت.','The filesystem is currently unavailable for managing plugins.'=>'قىستۇرما باشقۇرۇشقا ئىشلىتىدىغان ھۆججەت سىستېمىسىنى ھازىر ئىشلەتكىلى بولمايدۇ.','Network only plugin must be network activated.'=>'توردىلا ئىشلەيدىغان قىستۇرما توردا ئاكتىپلىنىشى كېرەك.','Sorry, you are not allowed to deactivate this plugin.'=>'كەچۈرۈڭ، بۇ قىستۇرمىنى ئاكتىپسىزلاش ئىجازىتىڭىز يوق.','Cannot delete an active plugin. Please deactivate it first.'=>'ئاكتىپ قىستۇرمىنى ئۆچۈرگىلى بولمايدۇ. ئاۋال ئۇنى ئاكتىپسىزلاڭ.','Sorry, you are not allowed to delete plugins for this site.'=>'كەچۈرۈڭ، بۇ بېكەتنىڭ قىستۇرمىسىنى ئۆچۈرۈش ئىجازىتىڭىز يوق.','Unable to determine what plugin was installed.'=>'قانداق قىستۇرما ئورنىتىلغانلىقىنى جەزملىيەلمىدى.','Unable to connect to the filesystem. Please confirm your credentials.'=>'ھۆججەت سىستېمىسىغا باغلىنالمىدى. سالاھىيىتىڭىزنى جەزملەڭ.','Sorry, you are not allowed to activate plugins.'=>'كەچۈرۈڭ، قىستۇرمىنى ئاكتىپلاش ئىجازىڭىز يوق.','Sorry, you are not allowed to install plugins on this site.'=>'كەچۈرۈڭ، بۇ بېكەتتە قىستۇرما ئورنىتىش ئىجازىتىڭىز يوق.','Plugin not found.'=>'قىستۇرما تېپىلمىدى.','Sorry, you are not allowed to manage plugins for this site.'=>'كەچۈرۈڭ، بۇ بېكەتنىڭ قىستۇرمىسىنى باشقۇرۇش ئىجازىتىڭىز يوق.','The plugin activation status.'=>'قىستۇرما ئاكتىپلاش ھالىتى.','WordPress.org plugin directory slug.'=>'WordPress.org قىستۇرما مۇندەرىجىسى slug.','The theme\'s current version.'=>'ئۆرنەكنىڭ نۆۋەتتىكى نەشرى.','The URI of the theme\'s webpage, transformed for display.'=>'كۆرسىتىشكە لايىقلاشتۇرۇپ ئۆزگەرتىلگەن، ئۆرنەك تور بېتىنىڭ بىرلىككە كەلگەن مەنبە پەرقلەندۈرگۈچ (URI) سى.','The URI of the theme\'s webpage, as found in the theme header.'=>'ئۆرنەك ماۋزۇسىدىن تېپىلىدىغان، ئۆرنەك تور بېتىنىڭ بىرلىككە كەلگەن مەنبە پەرقلەندۈرگۈچ (URI) سى.','The URI of the theme\'s webpage.'=>'ئۆرنەك تور بېتىنىڭ بىرلىككە كەلگەن مەنبە پەرقلەندۈرگۈچ (URI) سى.','The theme\'s text domain.'=>'ئۆرنەكنىڭ تېكست دائىرە نامى.','The theme tags, transformed for display.'=>'كۆرسىتىشكە لايىقلاشتۇرۇپ ئۆزگەرتىلگەن، ئۆرنەك بەلگىسى.','The theme tags, as found in the theme header.'=>'ئۆرنەك ماۋزۇسىدىن تېپىلىدىغان، ئۆرنەك بەلگىسى.','Tags indicating styles and features of the theme.'=>'ئۆرنەكنىڭ  ئالاھىدىلىكى ۋە ئۇسلۇبنى كۆرسىتىدىغان بەلگىلەر.','The theme\'s screenshot URL.'=>'ئۆرنەكنىڭ ئېكران كەسمىسىنىڭ تور بەت ئادرېسى.','The minimum WordPress version required for the theme to work.'=>'ئۆرنەكنىڭ ئىشلىشىگە زۆرۈر بولغان WordPress نىڭ ئەڭ تۆۋەن نەشر تەلىپى.','The minimum PHP version required for the theme to work.'=>'ئۆرنەكنىڭ ئىشلىشىگە زۆرۈر بولغان PHP نىڭ ئەڭ تۆۋەن نەشر تەلىپى.','The theme name, transformed for display.'=>'كۆرسىتىشكە لايىقلاشتۇرۇپ ئۆزگەرتىلگەن، ئۆرنەك ئاتى.','The theme name, as found in the theme header.'=>'ئۆرنەك ماۋزۇسىدىن تېپىلىدىغان، ئۆرنەك ئاتى.','The name of the theme.'=>'ئۆرنەكنىڭ ئاتى.','The theme description, transformed for display.'=>'كۆرسىتىشكە لايىقلاشتۇرۇپ ئۆزگەرتىلگەن، ئۆرنەك چۈشەندۈرۈشى.','The theme description, as found in the theme header.'=>'ئۆرنەك ماۋزۇسىدىن تېپىلىدىغان، ئۆرنەك چۈشەندۈرۈشى.','A description of the theme.'=>'ئۆرنەكنىڭ چۈشەندۈرۈشى.','The website of the theme author, transformed for display.'=>'كۆرسىتىشكە لايىقلاشتۇرۇپ ئۆزگەرتىلگەن، ئۆرنەك يازغۇچىسىنىڭ تور بېكىتى.','The website of the theme author, as found in the theme header.'=>'ئۆرنەك ماۋزۇسىدىن تېپىلىدىغان، ئۆرنەك يازغۇچىسىنىڭ تور بېكىتى.','The website of the theme author.'=>'ئۆرنەك ئاپتورىنىڭ تور بېكىتى.','HTML for the theme author, transformed for display.'=>'كۆرسىتىشكە لايىقلاشتۇرۇپ ئۆزگەرتىلگەن، ئۆرنەك يازغۇچىسىنىڭ HTML ى.','The theme author\'s name, as found in the theme header.'=>'ئۆرنەك ماۋزۇسىدىن تېپىلىدىغان، ئۆرنەك يازغۇچىسىنىڭ ئاتى.','The theme author.'=>'ئۆرنەك يازغۇچى.','The theme\'s template. If this is a child theme, this refers to the parent theme, otherwise this is the same as the theme\'s stylesheet.'=>'ئۆرنەكنىڭ قېلىپى. ئەگەر بۇ بالا ئۆرنەك بولسا، ئانا ئۆرنەكنى كۆرسىتىدۇ، ئۇنداق بولمىسا ئۆرنەكنىڭ ئۇسلۇب جەدۋىلىگە ئوخشاش بولىدۇ.','The theme\'s stylesheet. This uniquely identifies the theme.'=>'ئۆرنەكنىڭ ئۇسلۇب جەدۋىلى. بۇ ئۆرنەكنىڭ بىردىنبىر كىملىكى.','Block namespace.'=>'بۆلەك ئات بوشلۇقى.','A list of the inner block\'s own inner blocks. This is a recursive definition following the parent innerBlocks schema.'=>'ئىچكى بۆلەكنىڭ ئۆزىنىڭ ئىچىدىكى بۆلەك تىزىمى. بۇ بىر كېمەيگۈچى ئېنىقلىما بولۇپ، ئاتا innerBlocks سىخېما بايانىغا ئەگىشىدۇ.','The attributes of the inner block.'=>'ئىچكى بۆلەكنىڭ خاسلىقى.','The name of the inner block.'=>'ئىچكى بۆلەكنىڭ ئاتى.','The list of inner blocks used in the example.'=>'مىسالدا ئىشلىتىلگەن ئىچكى بۆلەكلەرنىڭ تىزىمى.','The attributes used in the example.'=>'مىسالدا ئىشلىتىلگەن خاسلىقلار.','Block example.'=>'بۆلەك مىسالى.','Block keywords.'=>'بۆلەك ئاچقۇچلۇق سۆزى.','Parent blocks.'=>'ئانا بۆلەك.','Public text domain.'=>'ئاممىۋى دائىرە نامى.','Contains the handle that defines the block style.'=>'بۆلەك ئۇسلۇبىنى بەلگىلەيدىغان بىر تەرەپ قىلغۇچ.','Inline CSS code that registers the CSS class required for the style.'=>'ئۇسلۇبقا كېرەكلىك بولغان خەتلىتىلگەن CSS خىلىنىڭ بىر قۇر CSS كودى.','The human-readable label for the style.'=>'ئۇسلۇبنىڭ كىشىلەر ئوقۇيالايدىغان بەلگىسى.','Unique name identifying the style.'=>'ئۇسلۇبنى پەرقلەندۈرىدىغان بىردىنبىر ئاتى.','Block style variations.'=>'بۆلەك ئۇسلۇبىنىڭ خىللىرى.','Public facing style handles.'=>'ئاممىۋى كۆرۈنۈش ئۇسلۇبى بىر تەرەپ قىلغۇچ.','Editor style handles.'=>'تەھرىرلىگۈچ ئۇسلۇبىنى بىر تەرەپ قىلغۇچ.','Public facing script handles.'=>'ئاممىۋى كۆرۈنۈش قوليازما بىر تەرەپ قىلغۇچ.','Editor script handles.'=>'تەھرىرلىگۈچ قوليازما بىر تەرەپ قىلغۇچ.','Is the block dynamically rendered.'=>'بۆلەك ھەرىكەتچان رەڭلەندى.','Block category.'=>'بۆلەك سەھىپەسى.','Block supports.'=>'بۆلەك قوللاش.','Context values inherited by blocks of this type.'=>'بۇ تىپتىكى بۆلەكلەر ۋارىسلىق قىلغان مەزمۇن قىممىتى.','Context provided by blocks of this type.'=>'بۇ تىپتىكى بۆلەكلەر تەمىنلىگەن مەزمۇن.','Block attributes.'=>'بۆلەك خاسلىقى.','Icon of block type.'=>'بۆلەك تىپىنىڭ سىنبەلگىسى.','Description of block type.'=>'بۆلەك تىپىنىڭ چۈشەندۈرۈشى.','Unique name identifying the block type.'=>'بۆلەك تىپىنى پەرقلەندۈرىدىغان بىردىنبىر ئىسىم.','Title of block type.'=>'بۆلەك تىپىنىڭ ماۋزۇسى.','Invalid block type.'=>'ئىناۋەتسىز بۆلەك تىپى.','Sorry, you are not allowed to manage block types.'=>'كەچۈرۈڭ، بۆلەك تىپىنى باشقۇرۇش ئىجازىتىڭىز يوق.','Block name.'=>'بۆلەك ئىسمى.','When registering a default meta value the data must match the type provided.'=>'كۆڭۈلدىكى مېتا قىممەتنى خەتلەتكەندە، سانلىق مەلۇمات چوقۇم تەمىنلىگەن تىپى بىلەن ماس كېلىشى كېرەك.','RSS Feed'=>'RSS مەنبەسى','The post types that support thumbnails or true if all post types are supported.'=>'كىچىك كۆرۈنۈشنى قوللايدىغان يازما تىپى، ياكى ئەگەر بارلىق يازما تىپىنى قوللىسا ئۇنداقتا قىممىتى راست (true) بولىدۇ.','When registering an "object" feature, the feature\'s schema must include the "properties" keyword.'=>'«object» ئىقتىدارى خەتلىتىلگەندە، بۇ ئىقتىدارنىڭ سىخېمىسىنىڭ بايانىدا چوقۇم «properties» (خاسلىق) ھالقىلىق سۆز بولىدۇ.','When registering an "array" feature, the feature\'s schema must include the "items" keyword.'=>'ئەگەر «array» (سانلار قاتارى) ئىقتىدارى خەتلىتىلسە، بۇ ئىقتىدارنىڭ سىخېما بايانىدا چوقۇم «items» ھالقىلىق سۆز بولىدۇ.','When registering an "array" or "object" feature to show in the REST API, the feature\'s schema must also be defined.'=>'ئەگەر «array» ياكى «object» ئىقتىدارىنى خەتلىتىپ REST API دا كۆرسىتىش ئۈچۈن، يەنە بۇ ئىقتىدارنىڭ سىخېما بايانىنى بەلگىلەش زۆرۈر.','When registering a "variadic" theme feature, the "type" must be an "array".'=>'ئەگەر «variadic» ئۆرنەك ئىقتىدارىنى خەتلەتكەندە، «type» چوقۇم «array» بولۇشى كېرەك.','The feature "type" is not valid JSON Schema type.'=>'ئاساسىي «type» ئىناۋەتلىك JSON Schema تىپى ئەمەس.','theme<strong>Error:</strong> Current WordPress version does not meet minimum requirements for %s.'=>'<strong>خاتالىق:</strong>نۆۋەتتىكى WordPress نەشرى %s نىڭ ئەڭ تۆۋەن نەشر تەلىپىگە ماس كەلمەيدۇ.','theme<strong>Error:</strong> Current PHP version does not meet minimum requirements for %s.'=>'<strong>خاتالىق:</strong>نۆۋەتتىكى PHP نەشرى %s نىڭ ئەڭ تۆۋەن نەشر تەلىپىگە ماس كەلمەيدۇ.','theme<strong>Error:</strong> Current WordPress and PHP versions do not meet minimum requirements for %s.'=>'<strong>خاتالىق:</strong>نۆۋەتتىكى WordPress ۋە PHP نەشرى %s نىڭ ئەڭ تۆۋەن نەشر تەلىپىگە ماس كەلمەيدۇ.','This image cannot be displayed in a web browser. For best results convert it to JPEG before uploading.'=>'بۇ سۈرەتنى توركۆرگۈدە كۆرسىتەلمەيدۇ. ئەڭ ياخشى نەتىجىگە ئېرىشىش ئۈچۈن ئۇنى يۈكلەشتىن ئىلگىرى JPEG گە ئايلاندۇرۇڭ.','Edit Profile'=>'تەرجىمىھال تەھرىر','Priority'=>'مەرتىۋە','Change Frequency'=>'چاستوتا ئۆزگەرت','Last Modified'=>'ئاخىرقى ئۆزگەرتىش','Number of URLs in this XML Sitemap: %s.'=>'بۇ XML ۋاقىت تامغىسىدىكى تور ئادرېسىنىڭ سانى: %s.','Learn more about XML sitemaps.'=>'XML تور بېكەت خەرىتە ھەققىدە تېخىمۇ كۆپ بىلدۈرگۈ.','https://www.sitemaps.org/'=>'https://www.sitemaps.org/','This XML Sitemap is generated by WordPress to make your content more visible for search engines.'=>'مەزمۇنلىرىڭىزنىڭ ئىزدەش موتورىدا تېخىمۇ ئاسان كۆرۈنۈشى ئۈچۈن، بۇ XML تور بېكەت خەرىتەنى WordPress ھاسىللىغان.','XML Sitemap'=>'XML تور بېكەت خەرىتە','Could not generate XML sitemap due to missing %s extension'=>'%s كېڭەيتىلمىسى كەم بولغانلىقتىن XML تور بېكەت خەرىتىسىنى قۇرالمايدۇ','Fields other than %s are not currently supported for sitemaps.'=>'تور بېكەت خەرىتىسىنى %s دىن باشقا سۆز بۆلىكى قوللىمايدۇ.','Fields other than %s are not currently supported for the sitemap index.'=>'تور بېكەت خەرىتە ئىندېكىسىنى %s دىن باشقا سۆز بۆلىكى قوللىمايدۇ.','Check your email'=>'ئېلخەتىڭىزنى تەكشۈرۈڭ','Registration complete. Please check your email, then visit the <a href="%s">login page</a>.'=>'خەتلىتىش تامام. ئېلخەتىڭىزنى تەكشۈرۈپ، ئاندىن <a href="%s">تىزىمغا ك