WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'سالام!

WordPress تور بېكىتىڭىزدىكى قىستۇرما ياكى ئۆرنەك كەلتۈرۈپ چىقارغان ئەجەللىك خاتالىقنى بايقىيالايدۇ، ھەمدە سىزگە ئاپتوماتىك ھالدا ئۇقتۇرۇش ئېلخەت يوللايدۇ.

###CAUSE###

ئالدى بىلەن، تور بېكىتىڭىز (###SITEURL###) نى زىيارەت قىلىپ، مەسىلە بار يوقلۇقىنى تەكشۈرىدۇ. ئاندىن، مەسىلە كۆرۈلگەن بەت (###PAGEURL###) نى زىيارەت قىلىپ، مەسىلە بار يوقلۇقىنى تەكشۈرىدۇ.

###SUPPORT###

ئەگەر تور بېكىتىڭىز قارىماققا نورمال بولمىسا، ئۇنىڭ ئۈستىگە باشقۇرۇش تاختىسىنى زىيارەت قىلالمىسىڭىز، ھازىر WordPress نىڭ «ئەسلىگە كەلتۈرۈش ھالىتى» بار، ئۇ سىزنىڭ باشقۇرۇش تاختىسىنى بىخەتەر زىيارەت قىلىپ، مەسىلىنى تەكشۈرۈشىڭىزگە قۇلايلىق يارىتىدۇ.

###LINK###

تور بېكىتىڭىزنىڭ بىخەتەرلىكىگە كاپالەتلىك قىلىش ئۈچۈن بۇ ئۇلانما ###EXPIRES### دىن كېيىن ۋاقتى ئۆتىدۇ. ئەنسىرىمەڭ، ئەگەر خاتالىق يەنە يۈز بەرسە، بىز سىزگە يەنە يېڭى ئۇلانما ئەۋەتىمىز. 

بۇ مەسىلە ھەققىدە ياردەمگە ئېرىشمەكچى بولسىڭىز، تۆۋەندىكى ئۇچۇرلارنى تەمىنلىشىڭىز كېرەك:

###DEBUG###

###DETAILS###','Please contact your host for assistance with investigating this issue further.'=>'بۇ مەسىلىنى ئىلگىرلەپ ئىنىقلاش ئۈچۈن مۇلازىمېتىر ساھىبى بىلەن ئ‍الاقىلىشىڭ.','Error occurred on a non-protected endpoint.'=>'ھىمايە قىلىنمىغان ئاخىرقى نۇقتادا خاتالىق كۆرۈلدى.','Recovery Mode &#8212; %s'=>'قۇتقۇرۇش ھالىتى &#8212; %s','[%s] Login Details'=>'[%s] كىرىش تەپسىلاتى','Move to Trash'=>'ئەخلەتخانىغا يۆتكە','Restore from Trash'=>'ئەخلەتخانىدىن ئەسلىگە كەلتۈر','https://wordpress.org/support/forums/'=>'https://wordpress.org/support/forums/','Support'=>'قوللاش','[%s] Network Admin Email Changed'=>'[%s] تور باشقۇرغۇچىنىڭ ئېلخەتى ئۆزگەردى','[%s] Network Admin Email Change Request'=>'[%s] تور باشقۇرغۇچىنىڭ ئېلخەت ئۆزگەرتىش ئىلتىماسى','[%s] Admin Email Changed'=>'[%s] باشقۇرغۇچىنىڭ ئېلخەتى ئۆزگەردى','[%s] Email Change Request'=>'[%s] باشقۇرغۇچىنىڭ ئېلخەت ئۆزگەرتىش ئىلتىماسى','[%s] Email Changed'=>'[%s] ئېلخەت ئۆزگەردى','A calendar of your site’s posts.'=>'بېكىتىڭىزدىكى يازمىلارنىڭ يىلنامىسى.','Edit gallery'=>'سۈرەتدان تەھرىر','Failed to exit recovery mode. Please try again later.'=>'ئەسلىگە كەلتۈرۈش ھالىتىدىن چىكىنەلمىدى. سەل تۇرۇپ قايتا سىناڭ.','Exit recovery mode link expired.'=>'ئەسلىگە كەلتۈرۈش ھالىتىدىن چىكىنىش ئۇلىنىشىنىڭ ۋاقتى ئ‍ۆتتى.','Failed to store the error.'=>'خاتالىقنى ساقلىيالمىدى.','Error not caused by a plugin or theme.'=>'خاتالىقنىڭ سەۋەبى قىستۇرما ياكى ئۆرنەك ئەمەس.','[%s] Your Site is Experiencing a Technical Issue'=>'[%s]  بېكىتىڭىزدە تېخنىكىلىق مەسىلە بار','Error Details'=>'خاتالىق تەپسىلاتلىرى','A recovery link was already sent %1$s ago. Please wait another %2$s before requesting a new email.'=>'قۇتقۇزۇش ئۇلىنىشى %1$s ئەۋۋال ئەۋەتىلدى. يېڭى ئېلخەت ئىلتىماس قىلىشتىن بۇرۇن يەنە %2$s ساقلاڭ.','The email could not be sent. Possible reason: your host may have disabled the %s function.'=>'بۇ ئېلخەتنى ئەۋەتكىلى بولمىدى. مۇمكىن سەۋەبى: سىزنىڭ باشقۇرغۇچىڭىز %s ئىقتىدارىنى چەكلىگەن.','Could not update the email last sent time.'=>'ئۆتكەن قېتىم ئەۋەتكەن ئېلخەتنى يىڭىلىيالمايدۇ.','Recovery key expired.'=>'ئەسلىگە كەلتۈرۈش ئاچقۇچىنىڭ ۋاقتى ئۆتكەن.','Invalid recovery key.'=>'ئىناۋەتسىز ئەسلىگە كەلتۈرۈش ئاچقۇچى.','Invalid recovery key format.'=>'ئىناۋەتسىز ئەسلىگە كەلتۈرۈش ئاچقۇچ پىچىمى.','Recovery Mode not initialized.'=>'ئەسلىگە كەلتۈرۈش ھالىتى دەسلەپلەشتۈرۈلمىدى.','User roleSubscriber'=>'مۇشتەرى','User roleContributor'=>'تۆھپىكار','User roleAuthor'=>'يازغۇچى','User roleEditor'=>'تەھرىرلىگۈچ','User roleAdministrator'=>'باشقۇرغۇچى','Select Site Icon'=>'تور بېكەت سىنبەلگىسى تاللىنىدۇ','An incomplete personal data request for this email address already exists.'=>'بۇ ئېلخەت ئۈچۈن تاماملانمىغان ئىلتىماس مەۋجۇت.','Keep widget settings and move it to the inactive widgets'=>'ئەپچە تەڭشىكىنى ساقلاپ قېلىپ ۋە ئۇنى ئاكتىپلانمىغان ئەپچىگە يۆتكەيدۇ','Invalid cookie.'=>'ئىناۋەتسىز cookie.','Cookie expired.'=>'Cookie نىڭ ۋاقتى ئۆتتى.','Invalid cookie format.'=>'ئىناۋەتسىز Cookie پىچىمى.','No cookie present.'=>'Cookie يوق.','An error of type %1$s was caused in line %2$s of the file %3$s. Error message: %4$s'=>'%1$s تىپتىكى خاتالىقنىڭ سەۋەبى %3$s ھۆججەتنىڭ %2$s قۇردا. خاتالىق ئۇچۇرى: %4$s','https://developer.wordpress.org/themes/advanced-topics/child-themes/'=>'https://developer.wordpress.org/themes/advanced-topics/child-themes/','Additional images added to this gallery: %s'=>'بۇ سۈرەتدانغا قوشۇلغان قوشۇمچە سۈرەتلەر: %s','The current image has no alternative text. The file name is: %s'=>'ھازىرقى رەسىمنىڭ باشقا تېكىستى يوق. ھۆججەت ئىسمى: %s','Exit Recovery Mode'=>'ئەسلىگە كەلتۈرۈش ھالىتىدىن چىكىن','%s Comment in moderation'=>'%s ئىنكاس تەستىق كۈتۈۋاتىدۇ' . "\0" . '%s ئىنكاس تەستىق كۈتۈۋاتىدۇ','Quote from Hello Dolly song, by Jerry Herman:'=>'Jerry Herman نىڭ Hello Dolly ناخشىسىدىن ئارىيە:','Recovery Mode Initialized. Please log in to continue.'=>'ئەسلىگە كەلتۈرۈش ھالىتى دەسلەپلەشتۈرۈلدى. تىزىمغا كىرىپ داۋاملاشتۇرۇڭ.','https://wordpress.org/documentation/article/cookies/#enable-cookies-in-your-browser'=>'https://wordpress.org/documentation/article/cookies/#enable-cookies-in-your-browser','Missing confirm key.'=>'جەزملەش ئاچقۇچى يوقالغان.','Missing request ID.'=>'ئىلتىماس نومۇرى يوقالغان.','Usage of the title attribute on the login logo is not recommended for accessibility reasons. Use the link text instead.'=>'كىرىش ئۈچۈن سەرلەۋھە ئىنىقلىغۇچىسى ئىشلىتىپ قولايلىق يارىتىش تەۋسىيە قىلىنمايدۇ. ئۇلىنىشن تىكىستىنى ئىشلىتىڭ.','Update PHP'=>'PHP نى يىڭىلاڭ','Could not retrieve site data.'=>'بېكەت سانلىق مەلۇماتىنى ئالالمىدى.','REST API routes must be registered on the %s action.'=>'REST API routes must be registered on the %s action.','%1$s, and %2$s'=>'%1$s ۋە %2$s','Failed <span class="count">(%s)</span>'=>'مەغلۇپ بولدى <span class="count">(%s)</span>' . "\0" . 'مەغلۇپ بولدى <span class="count">(%s)</span>','Your comment is awaiting moderation. This is a preview; your comment will be visible after it has been approved.'=>'ئىنكاسىڭىز تەستىقلىنىشنى كۈتۈۋاتىدۇ. بۇ ئالدىن كۆزىتىش، ئىنكاسىڭىز تەستىقلانغاندىن كېيىن ئاندىن كۆرۈنىدۇ.','The %s table is not installed. Please run the network database upgrade.'=>'%s جەدۋەل تېخى ئورنىتىلمىدى. تور ساندانىنى يۈكسەلتىشنى ئىجرا قىلىڭ.','The site appears to be already uninitialized.'=>'بېكەت تېخى دەسلەپلەشتۈرۈلمىگەندەك تۇرىدۇ.','Site %d'=>'بېكەت %d','The site appears to be already initialized.'=>'بېكەت ئاللىبۇرۇن دەسلەپلەشتۈرۈلگەندەك تۇرىدۇ.','Site with the ID does not exist.'=>'بۇنداق تور بېكەت يوق.','Both registration and last updated dates must be valid dates.'=>'تىزىملىتىلغان ۋە ئەڭ ئاخىرقى قىتىم يىڭىلانغان كۈن ئىناۋەتلىك بولۇشى كىرەك.','Both registration and last updated dates must be provided.'=>'تىزىملىتىلغان ۋە ئەڭ ئاخىرقى قىتىم يىڭىلانغان كۈن تەمىنلەنگەن بولۇشى كىرەك.','Site network ID must be provided.'=>'بېكەت تور كىملىكى تەمىنلەنگەن بولۇشى كېرەك.','Site path must not be empty.'=>'بېكەت يولى بوش بولماسلىقى كېرەك.','Site domain must not be empty.'=>'بېكەت ئىسمى بوش بولماسلىقى كېرەك.','Could not delete site from the database.'=>'بېكەتنى سانداندىن ئۆچۈرگىلى بولمىدى.','Could not update site in the database.'=>'سانداندا بېكەتنى يىڭىلاشقا بولمىدى.','Site does not exist.'=>'بېكەت مەۋجۇت ئەمەس.','Site ID must not be empty.'=>'بېكەت كىملىكى بوش بولماسلىقى كىرەك.','Could not insert site into the database.'=>'بېكەتنى ساندانغا قىستۇرغىلى بولمىدى.','Unable to submit this form, please try again.'=>'جەدۋەلنى تاپشۇرالمىدى، قايتا سىناڭ.','post formatFormats'=>'پىچىملار','%1$s, %2$s'=>'%2$s، %1$s','This resource is provided by your web host, and is specific to your site. For more information, <a href="%s" target="_blank">see the official WordPress documentation</a>.'=>'بۇ مەنبەنى تور ساھىبى سىزگە تەمىنلىگەن، ئۇ بېكىتىڭىزگە خاس. تېخىمۇ كۆپ ئۇچۇر ئۈچۈن، <a href="%s" target="_blank">WordPress نىڭ رەسمىي قوللانمىسىنى كۆرۈڭ</a>.','localized PHP upgrade information pagehttps://wordpress.org/support/update-php/'=>'https://wordpress.org/support/update-php/','%s second'=>'%s سېكۇنت' . "\0" . '%s سېكۇنت','%s minute'=>'%s مىنۇت' . "\0" . '%s مىنۇت','%1$s by %2$s pixels'=>'%1$s × %2$s پىكسېل','This theme failed to load properly and was paused within the admin backend.'=>'بۇ ئۆرنەك توغرا يۈكلەنمىدى ۋە باشقۇرۇش كەينى يۈزىدىن توختىتىلدى.','Whether to show the taxonomy in the quick/bulk edit panel.'=>'تۈرلىنىشىنى تېز/توپ تەھرىرلەش تاختىسىدا كۆرسىتەمدۇ يوق.','Whether to make the taxonomy available for selection in navigation menus.'=>'تۈرلىنىشىنى يولباشچى تىزىملىكتىن تاللاشقا بولامدۇ يوق.','Whether to allow automatic creation of taxonomy columns on associated post-types table.'=>'مۇناسىۋەتلىك post-types جەدۋەلگە تۈرلىنىش رەتلىرىنى ئاپتوماتىك قۇرالامدۇ يوق.','Whether to generate a default UI for managing this taxonomy.'=>'بۇ تۈرلىنىشنى باشقۇرۇش ئۈچۈن كۆڭۈلدىكى ئىشلەتكۈچى ئارا يۈزى قۇرامدۇ يوق.','Whether the taxonomy is publicly queryable.'=>'بۇ تۈرلىنىشنى ئاشكارا ئىزدىيەلەمدۇ يوق.','Whether a taxonomy is intended for use publicly either via the admin interface or by front-end users.'=>'بۇ تۈرلىنىش باشقۇرۇش يۈزى ياكى ئىشلەتكۈچى ئالدى-كەينى يۈزى ئارقىلىق ئاشكارا ئىشلىتىشكە تەمىنلىنەمدۇ يوق.','<strong>Error:</strong> There is no account with that username or email address.'=>'<strong>خاتالىق:</strong> بۇ ئىشلەتكۈچى ئاتى ياكى ئېلخەت ئادرېسىدا تىزىملاتقان ھېسابات يوق.','A variable mismatch has been detected.'=>'ئۆزگىرىشچان مىقدار ماسلاشماسلىق بايقالدى.','A key value mismatch has been detected. Please follow the link provided in your activation email.'=>'ماسلاشمىغان ئاچقۇچلۇق قىممەت بايقالدى. ئاكتىپلاش ئېلخېتىڭىزگە ئەۋەتىلگەن ئۇلىنىشقا ئەگىشىڭ.','Classic Block Keyboard Shortcuts'=>'كىلاسسىك بۆلەك كۇنۇپكا تاختىسى قىسقا يولى','Sorry, you are not allowed to view autosaves of this post.'=>'كەچۈرۈڭ، سىز بۇ يازمىنىڭ ئاپتوماتىك ساقلانغان نۇسخىسىنى كۆرەلمەيسىز.','Scheduled'=>'كۈنتەرتىپكە قويۇلغان','Create'=>'قۇر','block descriptionGive quoted text visual emphasis. "In quoting others, we cite ourselves." — Julio Cortázar'=>'نەقىل ئېلىنغان تېكىستكە كۆرۈنمە ئۇرغۇ بىرىڭ. «باشقىلارنى نەقىل كەلتۈرگەندە، بىر ئۆزىمىزنى تىلغا ئالىمىز.» - جۇلىيو كورتازار','Pagination'=>'بەتكە ئايرىش','Edit image'=>'سۈرەت تەھرىر','block descriptionIntroduce new sections and organize content to help visitors (and search engines) understand the structure of your content.'=>'زىيارەت قىلغۇچىلارنىڭ (ھەم ئ‍ىزدەش موتورلىرىنىڭ) مەزمۇنىڭىزنىڭ قۇرۇلمىسىنى چۈشىنىشىگە ياردەم قىلىش ئۈچۈن يىڭى قىسىم تونۇشتۇرۇڭ ۋە مەمۇننى رەتلەڭ.','Copy URL'=>'URL نى كۆچۈر','block descriptionAdd a block that displays content pulled from other sites, like Twitter or YouTube.'=>'Twitter ياكى YouTube ۋە باشقا بېكەتلەردىن تارتىلغان مەزمۇننى كۆرسىتىدىغان بۆلەك قوشىدۇ.','block titleEmbed'=>'سىڭدۈرمە','block titleClassic'=>'كىلاسسىك','Embeds'=>'سىڭدۈرمىلەر','Discussion'=>'مۇھاكىمە','Add title'=>'ماۋزۇ قوش','Visibility:'=>'كۆرۈنۈشى:','Copied!'=>'كۆچۈرۈلدى!','Submit for Review'=>'كۆرۈپ چىقىشقا سۇنۇش','Replace image'=>'سۈرەت ئالماشتۇر','Allow comments'=>'ئىنكاسقا رۇخسەت','Order'=>'زاكاز','Item added.'=>'تۈر قوشۇلدى.','(opens in a new tab)'=>'(يىڭى بەتتە ئىچىلىدۇ)','M j, Y g:i a'=>'Y-يىلى n-ئاينىڭ j-كۈنى، سائەت: H:i:s','The rendered block.'=>'رەڭلەنگەن بۆلەك.','Invalid block.'=>'ئىناۋەتسىز بۆلەك.','Sorry, you are not allowed to read blocks as this user.'=>'كەچۈرۈڭ، بۇ ئىشلەتكۈچى ھالىتىدە بۆلەكلەرنى ئوقۇيالمايسىز.','Sorry, you are not allowed to read blocks of this post.'=>'كەچۈرۈڭ، بۇ يازمىنىڭ بۆلەكلىرىنى ئوقۇيالمايسىز.','ID of the post context.'=>'يازما مەزمۇنىنىڭ كىملىك نومۇرى.','Attributes for the block.'=>'بۆلەكلەرنىڭ خاسلىقلىرى.','Unique registered name for the block.'=>'بۆلەكنىڭ بىردىنبىر تىزىملانغان ئىسمى.','Whether the theme supports responsive embedded content.'=>'ئۆرنەك سىڭدۈرمە ئىنكاسلىق مەزمۇننى قوللامدۇ يوق.','%s from now'=>'ھازىردىن ئ‍ۆتكەن ۋاقىت: %s','Limit result set to themes assigned one or more statuses.'=>'نەتىجىلەر توپىنى بىر ياكى بىرنەچچە ھالەتكە باغلانغان ئۆرنەكلەر بىلەن چەكلەش.','Post formats supported.'=>'يازما پىچىملىرىنى قوللايدۇ.','Features supported by this theme.'=>'بۇ ئۆرنەك قوللايدىغان ئالاھىدىلىكلەر.','The visibility settings for the taxonomy.'=>'تۈرلىنىشنىڭ كۆرۈنۈش تەڭشەكلىرى.','Invalid type parameter.'=>'ئىناۋەتسىز تىپ پارامىتىرى.','Limit results to items of one or more object subtypes.'=>'نەتىجىسى بىر ياكى بىر نەچچە ئوبيېكت تارماق تىپى بار تۈرلەرنى چەكلەيدۇ.','Limit results to items of an object type.'=>'نەتىجىسى بىر ئوبىكت تىپى بولغان تۈرلەرنى چەكلەيدۇ.','Object subtype.'=>'ئوبيېكت تارماق تىپى.','Object type.'=>'ئوبيېكت تىپى.','Internal search handler error.'=>'ئىچكى ئىزدەش بىر تەرەپ قىلغۇچ خاتالىقى.','REST search handlers must extend the %s class.'=>'REST ئىزدەش بىر تەرەپ قىلغۇچ %s تىپىنى كېڭەيتىش كېرەك.','The current user can post unfiltered HTML markup and JavaScript.'=>'نۆۋەتتىكى ئىشلەتكۈچى سۈزۈلمىگەن HTML ۋە JavaScript يازمىلىرىنى يوللىيالمايدۇ.','Version of the content block format used by the post.'=>'ئوبيېكت ئىشلەتكەن مەزمۇن بۆلەك پىچىمىنىڭ نەشرى.','Slug automatically generated from the post title.'=>'زەنجىر-سۆز يازما ماۋزۇسىدىن ئاپتوماتىك ھاسىل قىلىنغان.','Permalink template for the post.'=>'يازمىنىڭ مۇقىم ئۇلىنىش قېلىپى.','Preview link for the post.'=>'يازمىنىڭ ئالدىن كۆزىتىش ئۇلىنىشى.','There is no autosave revision for this post.'=>'بۇ يازمىنىڭ ئاپتوماتىك ساقلانغان تۈزىتىلگەن نۇسخىسى يوق.','Page updated.'=>'بەت يېڭىلاندى.','Post updated.'=>'يازما يېڭىلاندى.','Page scheduled.'=>'بەت كۈنتەرتىپلەندى.','Post scheduled.'=>'يازما كۈنتەرتىپلەندى.','Page reverted to draft.'=>'بەت دەسلەپكى نۇسخىغا قايتۇرۇلدى.','Post reverted to draft.'=>'يازما دەسلەپكى نۇسخىغا قايتۇرۇلدى.','Page published privately.'=>'بەت شەخسى ئېلان قىلىندى.','Post published privately.'=>'يازما شەخسى ئېلان قىلىندى.','Page published.'=>'بەت ئېلان قىلىندى.','Post published.'=>'يازما ئېلان قىلىندى.','Block type "%s" is not registered.'=>'«%s» بۆلەك تىپى تىزىملانمىغان.','Block type "%s" is already registered.'=>'«%s» بۆلەك تىپى تىزىملىنىپ بولغان.','Block type names must contain a namespace prefix. Example: my-plugin/my-custom-block-type'=>'بۆلەك تىپ ئ‍سمى چوقۇم ئىسم بوشلۇق ئالدى قوشۇلغۇچىنى ئ‍ۆز ئىچىگە ئېلىشى كېرەك. مەسىلەن، my-plugin/my-custom-block-type','Block type names must not contain uppercase characters.'=>'بۆلەك تىپ ئىسملىرى چوڭ ھەرىپلەرنى ئۆز ئ‍ىچىگە ئالماسلىقى كېرەك.','Block type names must be strings.'=>'بۆلەك تىپ ئىسمى چوقۇم ھەرپ تىزىقى بولۇشى كېرەك.','No comments to show.'=>'كۆرسەتكۈدەك ھېچقانداق ئىنكاس يوق.','%1$s on %2$s'=>'%1$s ھەققىدە %2$s','No archives to show.'=>'كۆرسەتكۈدەك ئارخىپ يوق.','The offset number requested is larger than or equal to the number of available revisions.'=>'ئىلتىماس قىلىنغان سان مەۋجۇت بولغان تۈزىتىلگەن نۇسخىنىڭ سانىدىن كۆپ ياكى تەڭ.','Unable to send personal data export confirmation email.'=>'شەخسى سانلىق مەلۇمات چىقىرىشنى جەزملەش ئېلخىتىنى ئەۋەتەلمىدى.','[%1$s] Action Confirmed: %2$s'=>'[%1$s] مەشغۇلات جەزملەشتى: %2$s','The current user can create terms in the %s taxonomy.'=>'نۆۋەتتىكى ئىشلەتكۈچى %s تۈرلىنىشنىڭ تۈرلىرىنى ھاسىل قىلالايدۇ.','The current user can assign terms in the %s taxonomy.'=>'نۆۋەتتىكى ئىشلەتكۈچى %s تۈرلىنىشنىڭ تۈرلىرىنى بەلگىلىيەلەيدۇ.','The current user can change the author on this post.'=>'نۆۋەتتىكى ئىشلەتكۈچى بۇ يازمىنىڭ يازغۇچىسىنى ئۆزگەرتەلەيدۇ.','The current user can sticky this post.'=>'نۆۋەتتىكى ئىشلەتكۈچى بۇ يازمىنى چوققىلىيالايدۇ.','The current user can publish this post.'=>'نۆۋەتتىكى ئىشلەتكۈچى بۇ يازمىنى ئېلان قىلالايدۇ.','You have used your space quota. Please delete files before uploading.'=>'سىز بوشلۇق ئورنىڭىزنى ئىشلىتىپ بولدىڭىز. يۈكلەشتىن بۇرۇن ھۆججەتلەرنى ئ‍ۆچۈرۈڭ.','Not enough space to upload. %s KB needed.'=>'يۈكلەشكە بوشلۇق يېتىشمەيدۇ. %s KB لازىم.','The site administrator has been notified. You will receive an email confirmation when they erase your data.'=>'بېكەت باشقۇرغۇچىسى خەۋەردار قىلىندى. سىزنىڭ سانلىق مەلۇماتىڭىز ئۆچۈرۈلگەندە ئېلخەت تاپشۇرۇۋالىسىز.','Thanks for confirming your erasure request.'=>'ئۆچۈرۈش ئىلتىماسىنى جەزملەشتۈرگىنىڭىزگە رەھمەت.','The site administrator has been notified. You will receive a link to download your export via email when they fulfill your request.'=>'بېكەت باشقۇرغۇچىسى خەۋەردار قىلىندى. سىزنىڭ ئىلتىماسىڭىز ئورۇندالغاندا، ئېلخەتتىن چىقىرىشنى چۈشۈرۈش ئۇلىنىشنى تاپشۇرۇۋالىسىز.','Thanks for confirming your export request.'=>'چىقىرىش ئىلتىماسىنى جەزملەشتۈرگىنىڭىزگە رەھمەت.','Howdy,

