$s is not a valid property of Object.'=>'%1$s ئوبيېكتنىڭ ئىناۋەتلىك خاسلىقى ئەمەس.','You will not be able to install new themes from here yet since your install requires SFTP credentials. For now, please <a href="%s">add themes in the admin</a>.'=>'ئورنىتىشتا SFTP كىنىشكىسى تەلەپ قىلىنغان بولغاچقا، بۇ يەردىن يېڭى ئۆرنەكلەرنى ئورنىتالمايسىز. ھازىرچە <a href="%s">باشقۇرغۇچىغا ئۆرنەك قوشۇڭ</a>.','categoriesMost Used'=>'ئەڭ كۆپ ئىشلىتىلگەن','tagsMost Used'=>'ئەڭ كۆپ ئىشلىتىلگەن','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'يېڭى تىزىملىكىڭىزگە ئۇلانما قوشۇش ئۈچۈن «كېيىنكى» نى بېسىڭ.','customizer changeset action/button labelSchedule'=>'كۈنتەرتىپ','+ Create New Menu'=>'+ يېڭى تىزىملىك قۇر','Create a menu for this location'=>'بۇ ئورۇنغا تىزىملىكتىن بىرنى قۇرىدۇ','Could not open handle for %1$s to %2$s.'=>'%1$s بىلەن %2$s ئارىسىدىكىنى ئاچالمايدۇ.','Add a navigation menu to your sidebar.'=>'يانبالداق ئۈچۈن يولباشچى تىزىملىك قوشىدۇ.','%s has taken over and is currently customizing.'=>'%s قولىغا ئالدى ۋە ھازىر ئۆزلەشتۈرۈۋاتىدۇ.','Looks like something&#8217;s gone wrong. Wait a couple seconds, and then try again.'=>'بىرەر كاشىلا كۆرۈلگەندەك قىلىدۇ. بىر نەچچە سېكۇنت ساقلاپ قايتا سىناڭ.','Take over'=>'ئېلىش','Go back'=>'قايت','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s بېكەتنى ئۆزلەشتۈرۈۋاتىدۇ. ئۆزلەشتۈرۈش ئۈچۈن ئۇ ئىش تۈگىگىچە ساقلاپ تۇرۇڭ. ئاخىرقى ئۆزگەرتىشلىرىڭىز ئاپتوماتىك ساقلاندى.','%s is already customizing this site. Do you want to take over?'=>'%s بېكەتنى ئۆزلەشتۈرۈۋاتىدۇ. بۇ ئىشنى سىز قولغا ئالامسىز؟','Sorry, you are not allowed to take over.'=>'كەچۈرۈڭ، سىزنىڭ ئېلىش ھوقۇقىڭىز يوق.','No changeset found to take over'=>'قولغا ئالغۇدەك ئۆزگەرتىش تېپىلمىدى','Security check failed.'=>'بىخەتەرلىك تەكشۈرۈش مەغلۇپ بولدى.','Changeset is being edited by other user.'=>'ئۆزگىرىشلەر باشقىلار تەرىپىدىن تەھرىرلەندى.','menu locationsHere&#8217;s where this menu appears. If you would like to change that, pick another location.'=>'بۇ جاي تىزىملىك كۆرۈنىدىغان ئورۇن. ئەگەر ئۇنى ئۆزگەرتمەكچى بولسىڭىز، باشقا ئورۇننى تاللاڭ.','menu locations(If you plan to use a menu <a href="%1$s" %2$s>widget%3$s</a>, skip this step.)'=>'(<a href="%1$s" %2$s>بىرىكمە%3$s</a> تىزىملىكىنى ئىشلەتمەكچى بولسىڭىز ‏‏بۇ باسقۇچنى ئۆتكۈزۈۋېتىڭ)','menu locationsWhere do you want this menu to appear?'=>'سىز بۇ تىزىملىكنىڭ قەيەردە كۆرۈنۈشىنى خالايسىز؟','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'تىزىملىك قۇرۇڭ، ئۇنىڭغا بىر ئورۇن بېكىتىڭ، بەت ۋە سەھىپە ئۇلىنىشىدەك تۈرلەرنى قوشۇڭ. ئۆرنەكنىڭ كۆپ تىزىملىك رايونى بولسا بىردىن كۆپنى قۇرۇشىڭىز مۇمكىن.','It does not look like your site has any menus yet. Want to build one? Click the button to start.'=>'تور بېكىتىڭىزدە تېخى تىزىملىك يوقتەك قىلىدۇ. بىرنى قۇرامسىز؟ توپچە چېكىپ باشلاڭ.','menu locationsView All Locations'=>'ھەممە ئورۇنلارنى كۆرسەت','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'يېڭى ئۆرنەكنى كۆرۈپ باققان ۋاقتىڭىزدا بىرىكمە، تىزىملىك ۋە ئۆرنەككە ئالاقىدار تاللانمىلارنى ئۆزلەشتۈرسىڭىز بولىدۇ.','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'ئۆرنەك ئىزدەمسىز؟ WordPress.org نىڭ theme مۇندەرىجىسىدىن ئىزدەپ بولۇپ، قاچىلاش ۋە كۆرۈپ بېقىشنى تاماملىغاندىن كېيىن بۇ يەرنى بېسىپلا ئاكتىپلىيالايسىز.','menu locationsView Location'=>'ئورۇننى كۆرسەت','No themes found. Try a different search.'=>'ئۆرنەك تېپىلمىدى. باشقىچە ئىزدەپ بېقىڭ.','Your theme can display menus in one location. Select which menu you would like to use.'=>'سىز ئىشلەتكەن ئۆرنەك تىزىملىكلەرنى بىر ئورۇندا كۆرسىتەلەيدۇ. ئىشلەتمەكچى بولغان تىزىملىكنى تاللاڭ.','Site Name: %s'=>'بېكەت نامى: %s','%1$s &lsaquo; %2$s &#8212; WordPress'=>'%1$s &lsaqu