###SITEURL###','Only UUID V4 is supported at this time.'=>'نۆۋەتتە UUID V4 نىلا قوللايدۇ.','The Press This plugin is required.'=>'بۇ قىستۇرمىنى بېسىش لازىم.','%s themes'=>'%s ئۆرنەك','Filter themes (%s)'=>'ئۆرنەك سۈزگۈچ (%s)','Go to theme sources'=>'ئۆرنەك مەنبەسىگە قايت','Search WordPress.org themes'=>'WordPress.org ئۇسلۇبى ئىزدە','Install &amp; Preview'=>'ئورنات ۋە ئالدىن كۆزەت','Invalid URL.'=>'ئىناۋەتسىز تور ئادرېس(URL).','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'بەزى ئۇلانمىلارنى قوشۇشنىڭ پەيتى كەلدى! «%s» نى چېكىپ، بەت، سەھىبە ۋە ئىختىيارى ئۇلانمىلىرىڭىزنى تىزىملىككە قوشالايسىز. ئەگەر خالىسىڭىز يەنە ئوخشاش بولمىغان نۇرغۇن نەرسىلەرنى قوشالايسىز.','Choose image'=>'سۈرەت تاللاش','Choose audio'=>'ئاۋاز تاللاش','Change audio'=>'ئاۋاز ئۆزگەرتىش','Select audio'=>'ئاۋاز تاللاش','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'«يېڭى سۈرەت قوش» نى چېكىپ، كومپۇتېرىڭىزدىن سۈرەت يۈكلىيالەيسىز. ئۆرنەكتە سۈرەتنىڭ بەت قاش ئېگىزلىكى %s بولسا ئەڭ مۇۋاپىق. سۈرەت يۈكلەنگەندىن كېبىن كېسىپ، ئۆزىڭىز مۇۋاپىق كۆرگەن شەكىلگە كەلتۈرەلەيسىز.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'كومپۇتېرىڭىزدىن سۈرەت يۈكلەشتە «يېڭى سۈرەت قوش» چېكىلىدۇ. ئۆرنىكىڭىزدىكى سۈرەتنىڭ بەت قاش ئىگىزلىگى %s بولسا ئەڭ ياخشى ئىشلەيدۇ. سۈرەت يۈكلەنگەندىن كېبىن كېسىپ، ئۆزىڭىز مۇۋاپىق كۆرگەن شەكىلگە كەلتۈرەلەيسىز.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'كومپۇتېرىڭىزدىن سۈرەت يۈكلەشتە «يېڭى سۈرەت قوش» چېكىلىدۇ. ئۆرنىكىڭىزدىكى سۈرەتنىڭ بەت قاش ئىگىزلىگى %s بولسا ئەڭ ياخشى ئىشلەيدۇ. سۈرەت يۈكلەنگەندىن كېبىن كېسىپ، ئۆزىڭىز مۇۋاپىق كۆرگەن شەكىلگە كەلتۈرەلەيسىز.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'كومپۇتېرىڭىزدىن سۈرەت يۈكلەشتە «يېڭى سۈرەت قوش» چېكىلىدۇ. سىننىڭ چوڭلۇقى بىلەن ماسلاشقان سۈرەت ئۆرنىكىڭىزدە ئەڭ ياخشى ئىشلەيدۇ. سۈرەت يۈكلەنگەندىن كېبىن كېسىپ، ئۆزىڭىز مۇۋاپىق كۆرگەن شەكىلگە كەلتۈرەلەيسىز.','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'مېردىيان','Minute'=>'مىنۇت','Hour'=>'سائەت','Time'=>'ۋاقىت','Day'=>'كۈن','Month'=>'ئاي','Date'=>'چېسلا','Usage of user levels is deprecated. Use capabilities instead.'=>'ئىشلەتكۈچىلەر دەرىجىسىنى ئىشلىتىش ئەمەلدىن قالدۇرۇلدى. ئۇنىڭ ئورنىغا ئىقتىدارلىرىنى ئىشلىتىڭ.','The theme defines itself as its parent theme. Please check the %s header.'=>'ئۆرنەك ئۆزىنى ئانا ئۆرنەك قىپتۇ. %s نىڭ بېشىنى تەكشۈرۈڭ.','Name for the Visual editor tabVisual'=>'كۆرۈنمە','Create New Menu'=>'يېڭى تىزىملىك قۇرۇش','New Menu'=>'يېڭى تىزىملىك','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'ئەگەر ئۆرنىكىڭىزنىڭ قوراللار رايونى بولسا، ئۇ يەرگە تىزىملىكلەرنىمۇ قوشالايسىز. <a href="%s">ئەپچە تاختىسى</a>نى زىيارەت قىلىڭ ۋە بىر «يولباشچى تىزىملىكى» نى يانبالداق ياكى بەت ئاستىدا كۆرسىتىلىدىغان تىزىملىككە قوشۇڭ.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'ئۆرنىكىڭىزنىڭ كۆپ تىزىملىكى بولسا ئۇلارغا ئېنىقراق ناملارنى بەرسىڭىز باشقۇرۇشقا ئاسان بولىدۇ.','Your theme can display menus in %s location.'=>'ئۆرنىكىڭىز %s ئورۇندا تىزىملىكلىرىڭىزنى كۆرسىتەلەيدۇ.' . "\0" . 'ئۆرنىكىڭىز %s ئورۇندا تىزىملىكلىرىڭىزنى كۆرسىتەلەيدۇ.','Your theme can display menus in one location.'=>'ئۆرنىكىڭىز بىرلا ئورۇندا تىزىملىكنى كۆرسىتەلەيدۇ.','CSS code'=>'CSS  كودى','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'تەھرىرلەش رايونى كود گىراماتىكىسىنى ئاپتۇماتىك يارقىنلاشتۇرىدۇ. بۇنى ئۆزىڭىزنىڭ <a href="%1$s" %2$s>ئىشلەتكۈچى ئارخىپى %3$s</a> نى ئېچىپ چەكلىۋېتىپ، ئاددىي تېكىست كۆرۈنىشىدە ئىشلىتەلەيسىز.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'ئېكران ئوقۇغۇچ ئىشلەتكۈچىلىرى: forms ھالىتىدە Esc كۇنۇپكىسىنى ئىككى قېتىم بېسىشقا توغرا كېلىشى مۇمكىن.','To move away from this area, press the Esc key followed by the Tab key.'=>'بۇ رايوندىن چىقىپ كېتىش ئۈچۈن Esc كۇنۇپكىسىنى، ئاندىن Tab نى بېسىڭ.','In the editing area, the Tab key enters a tab character.'=>'تەھرىرلەش رايونىدا Tab كۇنۇپكىسى tab ھەرپىنى كىرگۈزىدۇ.','When using a keyboard to navigate:'=>'كۇنۇپكا بىلەن يۆتكەلگەندە:','Add your own CSS code here to customize the appearance and layout of your site.'=>'ئۆزىڭىزنىڭ CSS كودىڭىزنى بۇ يەرگە قوشۇش ئارقىلىق تور بېتىڭزىنىڭ كۆرۈنىشى ۋە لاھىيەسىنى خاسلاشتۇرۇڭ.','Your homepage displays'=>'باش بېتىڭىزنىڭ كۆرۈنىشى','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'باش بېتىڭىزدە نىمىلەرنىڭ كۆرسىتىشنى تاللىيالايسىز. ئۇ تەتۈر ۋاقىت تەرتىپى بويىچە كۆرسىتىلگەن يازمىلار بولىشى مۈمكىن ۋە ياكى مۇقىم بىر تور بېتى بولىشىمۇ مۈمكىن. ئەگەر مۇقىم بىر بەتنى باش بەت قىلماقچى بولسىڭىز، ئاۋال ئىككى بەت ياسىشىڭىز كېرەك. بىرى باش بەت بولىدۇ، يەنە بىرىدە يازمىلىرىڭىز كۆرسىتىلىدۇ.','Homepage Settings'=>'باش بەت تەڭشەكلىرى','WordPress.org themes'=>'WordPress.org ئۆرنەكلىرى','Installed themes'=>'ئورنىتىلغان ئۆرنەكلەر','Publish Settings'=>'ئېلان قىلىش تەڭشەكلىرى','Copied'=>'كۆچۈرۈلدى','Preview Link'=>'ئالدىن كۆزەت ئۇلىنىشى','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'تور بېكىتىڭىزدە قانداق ئۆزگىرىشلەر بولىدىغىنى ئالدىن كۆرۈڭ ۋە بۇ ئالدىن كۆرۈشلەرنى خاسلاشتۇرغۇچنى ئىشلىتىشىگە بولمايدىغان كىشىلەرگە ھەمبەھىرلەڭ.','Share Preview Link'=>'ئالدىن كۆزەت ئۇلىنىش ھەمبەھىر','Changes trashed successfully.'=>'ئۆزگەرتىشلەر مۇۋەپپىقىيەتلىك تازىلاندى.','Changes have already been trashed.'=>'ئۆزگەرتىشلەر تازلىنىپ بولدى.','Unable to trash changes.'=>'ئۆزگەرتىشلەرنى تازلىغىلى بولمىدى.','No changes saved yet, so there is nothing to trash.'=>'ھېچقانداق ئۆزگەرتىش ساقلانمىغانلىقى ئۈچۈن تازىلايدىغان نەرسە يوق.','There was an authentication problem. Please reload and try again.'=>'دەلىللەش مەسىلىسى كۆرۈلدى. قايتا سىناڭ.','Unable to save due to %s invalid setting.'=>'ئۇشبۇ %s ئىناۋەتسىز تەڭشەك سەۋەبىدىن ساقلانمىدى.' . "\0" . 'ئۇشبۇ %s ئۈنۈمسىز تەڭشەكلەر سەۋەبىدىن ساقلانمىدى.','You must supply a future date to schedule.'=>'كۈنتەرتىپلەش ئۈچۈن كەلگۈسى چېسلا تاللىشىڭىز كېرەك.','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'ئالدىنقى ئۆزگەرتىشلەر ئاللىبۇرۇن ئېلان قىلىنىپ بولدى. نۆۋەتتىكى ئۆزگەرتىشلىرىڭىزنى قايتا ساقلاڭ.','Edit User'=>'ئىشلەتكۈچى تەھرىر','View User'=>'ئىشلەتكۈچىنى كۆرسەت','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'بۇ «ئىختىيارى HTML ئەپچە» ياخشىراق ئىشلەيدىغان كودلارنى ئۆز ئىچىگە ئالغان بولۇشى مۇمكىن. ئەگەر تېخى سىنىمىغان بولسىڭىز، ئۇ ئەپچەنى سىناپ بېقىڭ؟','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'كۆرۈنۈشلۈك تەھرىرلىگۈچكە چاپلىغانلىرىڭىزنىڭ ئارىسىدا HTML كودى باردەك قىلىدۇ. ئۇنىڭ ئورنىغا كودىڭىزنى تېكىست بەتچۈكنى ئېچىپ چاپلىيالايسىز. بۇنىڭدىن باشقا خاس HTML  قوراللىرىنىمۇ ئىشلەتسىڭىزمۇ بولىدۇ!','Did you just paste HTML?'=>'تېخى ھازىرلا HTML نى چاپلىغانمىتىڭىز؟','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'بۇ يەردە بىرئىختىيارىچە HTML ئەپچە بارلىقىنى بىلەمتىڭىز؟ بۇ ئېكراندىكى قوراللار تىزىملىكىدىن ئۇنى تاپالايسىز. قېنى تور بېكىتىڭىزگە خالىغان كود قوشۇش ئۈچۈن ئۇنى سىناپ كۆرۈڭ!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'بۇ يەردە بىر ئىختىيارىچە HTML ئەپچە بارلىقىنى بىلەمتىڭىز؟ <a class="add-widget" href="#">ئەپچە قوش</a>نى  بېسىپ «HTML» نى ئىزدەتسىڭىز ئۇنى تاپالايسىز. قېنى تور بېكىتىڭىزگە خالىغان كود قوشۇپ سىناپ كۆرۈڭ!','New Custom HTML Widget'=>'يېڭى ئىختىيارىچە HTML ئەپچە','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'بۇ «ئىختىيارىچە HTML ئەپچە» ياخشىراق ئىشلەيدىغان كودلارنى ئۆز ئىچىگە ئالغان بولۇشى مۇمكىن. ئۇ ئەپچەنى سىناپ باقسىڭىز قانداق؟','Arbitrary text.'=>'خالىغان تېكىست.','Some HTML tags are not permitted, including:'=>'بەزى HTML بەلگىلىرى چەكلەنگەن، ئۇلار:','Custom HTML'=>'ئىختىيارىچە HTML','Arbitrary HTML code.'=>'خالىغان HTML كودى.','Show tag counts'=>'بەلگە سانىنى كۆرسىتىدۇ','%s item'=>'%s تۈر' . "\0" . '%s تۈر','label for button in the media widgetAdd Media'=>'ۋاسىتە قوش','label for button in the video widgetAdd Video'=>'سىن قوش','label for button in the image widgetAdd Image'=>'سۈرەت قوش','label for button in the audio widgetAdd Audio'=>'ئۈن قوش','(no author)'=>'(يازغۇچى يوق)','To change or disable registration go to your <a href="%s">Options page</a>.'=>'تىزىملىتىشنى ئۆزگەرتىش ياكى ئىناۋەتسىز قىلىش ئۈچۈن <a href="%s">تاللاش بېتى</a> گە بېرىڭ.','The network currently allows both site and user registrations.'=>'تور ھازىر بېكەت ھەم ئىشلەتكۈچىلەرنىڭ تىزىملىتىشىنى قوللايدۇ.','The network currently allows user registrations.'=>'تور ھازىر ئىشلەتكۈچىلەرنىڭ تىزىملىتىشىنى قوللايدۇ.','The network currently allows site registrations.'=>'تور ھازىر بېكەت تىزىملىتىشىنى قوللايدۇ.','The network currently disallows registrations.'=>'تور ھازىر تىزىملىمىتىشنى قوللىمايدۇ.','Greetings Network Administrator!'=>'مەرھابا تور باشقۇرغۇچىسى!','Title for the widget'=>'ئەپچەنىڭ ماۋزۇسى','URL to the media file'=>'ۋاسىتە ھۆججىتىنىڭ URL سى','Attachment post ID'=>'قوشۇمچىنىڭ يازما كىملىكى','Looks like this is not the correct kind of file. Please link to an appropriate file instead.'=>'ھۆججەت شەكلى خاتادەك قىلىدۇ. مۇۋاپىق ھۆججەتكە ئۇلاڭ.','Media Widget'=>'ۋاسىتە ئەپچە','Media Widget (%d)'=>'ۋاسىتە ئەپچە (%d)' . "\0" . 'ۋاسىتە ئەپچە (%d)','Add to Widget'=>'ئەپچەگە قوش','label for button in the media widget; should preferably not be longer than ~13 characters longEdit Media'=>'ۋاسىتە تەھرىر','label for button in the media widget; should preferably not be longer than ~13 characters longReplace Media'=>'ۋاسىتە ئالماشتۇر','No media selected'=>'ھېچقانداق ۋاسىتە تاللانمىدى','A media item.'=>'بىر ۋاسىتە ھۆججىتى.','URL to the %s video source file'=>'%s ئەسلى سىن ھۆججىتىنىڭ URL ئادرېسى','Video Widget'=>'سىن ئەپچە','Video Widget (%d)'=>'سىن ئەپچە (%d)' . "\0" . 'سىن ئەپچە (%d)','label for button in the video widget; should preferably not be longer than ~13 characters longEdit Video'=>'سىن تەھرىر','label for button in the video widget; should preferably not be longer than ~13 characters longReplace Video'=>'سىننى ئەسلىگە قايتۇرۇش','label for button in the gallery widget; should not be longer than ~13 characters longAdd Images'=>'سۈرەت قوش','Displays a video from the media library or from YouTube, Vimeo, or another provider.'=>'ۋاسىتە ئامبىرى ياكى YouTube، Vimeo ۋە ياكى باشقا تەمىنلىگۈچىلەردىن سىننى كۆرسىتىدۇ.','Image Widget'=>'سۈرەت ئەپچە','Image Widget (%d)'=>'سۈرەت ئەپچە (%d)' . "\0" . 'سۈرەت ئەپچە (%d)','label for button in the image widget; should preferably not be longer than ~13 characters longEdit Image'=>'سۈرەت تەھرىر','label for button in the image widget; should preferably not be longer than ~13 characters longReplace Image'=>'سۈرەت ئالماشتۇر','label for button in the gallery widget; should not be longer than ~13 characters longEdit Gallery'=>'سۈرەتدان تەھرىر','Displays an image.'=>'سۈرەتلەرنى كۆرسىتىدۇ.','Unable to preview media due to an unknown error.'=>'يوچۇن خاتالىق تۈپەيلىدىن ۋاسىتەنى ئالدىن كۆزىتەلمەيدۇ.','URL to the %s audio source file'=>'%s ئاۋاز مەنبە ھۆججىتىنىڭ URL ئادرېسى','Looks like this is not the correct kind of file. Please link to an audio file instead.'=>'قارىغاندا بۇ توغرا ھۆججەت ئەمەستەك تۇرىدۇ. ئورنىغا ئۇن ھۆججىتى باغلاڭ.','Audio Widget'=>'ئۈن ئەپچە','Audio Widget (%d)'=>'ئۈن ئەپچە (%d)' . "\0" . 'ئۈن ئەپچە (%d)','label for button in the audio widget; should preferably not be longer than ~13 characters longEdit Audio'=>'ئۈن تەھرىر','label for button in the audio widget; should preferably not be longer than ~13 characters longReplace Audio'=>'ئۈن ئالماشتۇر','No audio selected'=>'ئۈن ھۆججىتى تاللانمىدى','Displays an audio player.'=>'ئۈن قويغۇنى كۆرسىتىدۇ.','%1$s must be less than or equal to %2$d'=>'%1$s چوقۇم %2$d دىن كىچىڭ ياكى تەڭ بولۇشى كېرەك','%1$s must be less than %2$d'=>'%1$s چوقۇم %2$d دىن كىچىڭ بولۇشى كېرەك','%1$s must be greater than or equal to %2$d'=>'%1$s بولسا %2$d دىن چوڭ ياكى تەڭ بولىشى كېرەك','%1$s must be greater than %2$d'=>'%1$s چوقۇم %2$d دىن چوڭ بولۇشى كېرەك','Limit result set to users with one or more specific slugs.'=>'نەتىجە توپلىمىنى بىر ياكى ئۇنىڭدىن كۆپ بەلگىلىك باشقا نامغا ئىگە ئىشلەتكۈچىلەرگە چەكلەيدۇ.','Limit result set to terms with one or more specific slugs.'=>'نەتىجە توپلىمىنى بىر ياكى ئۇنىڭدىن كۆپ باشقا نامى بار ئاتالغۇلارغا چەكلەيدۇ.','The page number requested is larger 