چۈرۈش ئۈچۈن «%s» نى تەڭشەڭ.','Revisions do not support trashing. Set \'%s\' to delete.'=>'تۈزىتىلگەن نۇسخىلار ئەخلەتخانىغا تاشلاشنى قوللىمايدۇ. ئۆچۈرمەكچى بولسىڭىز «%s» نى تەڭشەڭ.','The post does not support trashing. Set \'%s\' to delete.'=>'بۇ يازما ئۆچۈرۈشنى قوللىمايدۇ. ئۆچۈرمەكچى بولسىڭىز \'%s\' قىلىپ بەلگىلەڭ.','The comment does not support trashing. Set \'%s\' to delete.'=>'بۇ ئىنكاس ئەخلەتخانىغا تاشلاشنى قوللىمايدۇ. ئۆچۈرمەكچى بولسىڭىز «%s» قىلىپ بەلگىلەڭ.','Or, enter a YouTube URL:'=>'ياكى بىر YouTube ئۇلانمىسىنى كىرگۈزۈڭ','Invalid JSON body passed.'=>'ئەۋەتىلگەن JSON گەۋدىسى ئىناۋەتسىز.','Limit result set to posts assigned one or more statuses.'=>'نەتىجىلەر توپىنى بىر ياكى بىرنەچچە ھالەت بېكىتىلگەن يازمىلار بىلەن چەكلەش.','Comment field exceeds maximum length allowed.'=>'ئىنكاس بۆلىكى رۇخسەت قىلىنغان ئەڭ ئۇزۇن چەكتىن ئېشىپ كەتتى.','Taxonomies associated with post type.'=>'ئىنكاس تۈرلىنىشى يازما تىپىگە باغلىق.','Limit result set to posts with one or more specific slugs.'=>'نەتىجىلەر توپىنى بىر ياكى بىرنەچچە ئالاھىدە ئىسىم بېرىلگەن يازمىلار بىلەن چەكلەش.','Comment is required.'=>'ئىنكاس يېزىش كېرەك.','Empty title.'=>'بوش تېما.','Sorry, trackbacks are closed for this item.'=>'كەچۈرۈڭ، بۇ ئەزا ئۈچۈن يېنىپ كۆرۈش ئېتىۋېتىلگەن.','I really need an ID for this to work.'=>'بۇنىڭ ئىشقا كىرىشتۈرۈش ئۈچۈن بىر ID لازىم.','Homepage'=>'باش بەت','%1$s must be between %2$d (inclusive) and %3$d (inclusive)'=>'%1$s چوقۇم  %2$d بىلەن %3$d نىڭ ئارىسىدا ياكى بىرىگە تەڭ بولۇشى كېرەك.','%1$s must be between %2$d (exclusive) and %3$d (inclusive)'=>'%1$s چوقۇم %2$d دىن چوڭ ۋە %3$d تىن كىچىك ياكى ئۇنىڭغا تەڭ بولۇشى كېرەك.','%1$s must be between %2$d (inclusive) and %3$d (exclusive)'=>'%1$s چوقۇم %2$d دىن چوڭ ياكى تەڭ بولۇشى ۋە %3$d تىن كىچىك بولۇشى كېرەك.','%1$s must be between %2$d (exclusive) and %3$d (exclusive)'=>'%1$s چوقۇم %2$d دىن چوڭ ۋە %3$d تىن كىچىك بولۇشى كېرەك.','%s is not a valid IP address.'=>'%s ئىناۋەتلىك IP ئادرېس ئەمەس.','%1$s is not of type %2$s.'=>'%1$s ھەرگىز %2$s نىڭ تىپى ئەمەس.','%1$s is not one of %2$s.'=>'%1$s بولسا %2$s نىڭ بىر ئەزاسى ئەمەس.','Meta fields.'=>'مېتا بۆلەكلىرى.','Could not delete meta value from database.'=>'سانداندىكى مېتا قىممىتى ئۆچۈرۈلمىدى.','Limit result set to users matching at least one specific role provided. Accepts csv list or single role.'=>'نەتىجە توپىنى ئەڭ ئازبىربەلگىلەنگەن رولغا ماس كېلىدىغان ئىشلەتكۈچىلەر بىلەن چەكلەش. Csv تىزىمى ياكى يالغۇز روللارنى قوبۇل قىلىدۇ.','Any extra capabilities assigned to the user.'=>'ئابونتقا ئارتۇق ئىقتىدار قوشۇلدى.','All capabilities assigned to the user.'=>'ئىشلەتكۈچىگە تەقسىملەنگەن بارلىق ئىقتىدارلىرى.','Password for the user (never included).'=>'ئىشلەتكۈچى پارولى (ھەرگىز بۇ يەرگە يېزىلمايدۇ).','Registration date for the user.'=>'ئىشلەتكۈچى تىزىملاتقان كۈن.','The email address for the user.'=>'ئىشلەتكۈچىنىڭ تورخەت ئادرېسى.','The role %s does not exist.'=>'%s دەيدىغان رول يوق.','Invalid user ID for reassignment.'=>'قايتا تەقسىملەيدىغان ئىشلەتكۈچى كىملىكى ئىناۋەتسىز.','Sorry, you are not allowed to delete this user.'=>'كەچۈرۈڭ، بۇ ئىشلەتكۈچىنى ئۆچۈرۈش ھوقۇقىڭىز يوق.','Username is not editable.'=>'ئىشلەتكۈچى نامىنى تەھرىرلىگىلى بولمايدۇ.','Sorry, you are not allowed to edit roles of this user.'=>'كەچۈرۈڭ، بۇ ئىشلەتكۈچىنىڭ رولىنى تەھرىرلىشىڭىزگە رۇخسەت قىلىنمىغان.','Sorry, you are not allowed to delete this revision.'=>'كەچۈرۈڭ، بۇ تۈزەتمىنى ئۆچۈرۈشىڭىزگە رۇخسەت يوق.','Cannot create existing user.'=>'بار ئىشلەتكۈچىنى قۇرالمايمىز.','You are not currently logged in.'=>'سىز تېخى كىرمىدىڭىز.','Limit result set to terms assigned to a specific post.'=>'نەتىجە توپىنى بەلگىلەنگەن يازمىغا ئاتالغان ئاتالغۇلاربىلەن چەكلەش.','Limit result set to terms assigned to a specific parent.'=>'نەتىجە توپىنى بەلگىلىلىك ئانىغا تەقسىملەنگەن ئاتالغۇلاربىلەن چەكلەش.','Whether to hide terms not assigned to any posts.'=>'ھېچقانداق يازمىغا تەقسىملەنمىگەن ئاتالغۇلارنى يوشۇرۇپ قويامدۇ-يوق.','Sort collection by term attribute.'=>'ئاتالغۇ خۇسۇسىيىتىگە ئاساسەن توپلام رەتلەش.','The ID for the parent of the revision.'=>'تۈزىتىلگەن نۇسخىنىڭ ئانا كىملىكى.','Type attribution for the term.'=>'ئاتالغۇ تەقسىماتىنى كىرگۈزۈڭ.','An alphanumeric identifier for the term unique to its type.'=>'ئاتالغۇ تىپىغا بىردىن-بىر ماس كېلىدىغان ھەرپ-بەلگىلىك پەرقلەندۈرگۈچ.','HTML description of the term.'=>'ئاتالغۇلارنىڭ HTML ئىپادىسى.','Number of published posts for the term.'=>'ئاتالغۇغا ئائىت ئېلان قىلىنغان يازما سانى.','Unique identifier for the user.'=>'ئىشلەتكۈچىنىڭ بىردىنبىر پەرقلەندۈرگۈچى.','The template cannot be deleted.'=>'بۇ قېلىپنى ئۆچۈرگىلى بولمايدۇ.','Required to be true, as users do not support trashing.'=>'ئىشلەتكۈچىلەر ئەخلەتلەشنى قوللىمىغان بولغاچقا true بولۇشى تەلەپ قىلىنىدۇ.','Limit results to taxonomies associated with a specific post type.'=>'نەتىجىسىنى بەلگىلەنگەن يازما تىپىغا ماس كېلىدىغان تۈرلەرگە چەكلەش.','Whether or not the term cloud should be displayed.'=>'ئاتالغۇلار بۇلۇتى كۆرسىتىلسۇنمۇ - يوق.','The %s property has an invalid stored value, and cannot be updated to null.'=>'%s خۇسۇسىيىتىگە بىر ئىناۋەتسىز قىممەت ساقلانغان ۋە null قىلىپ يېڭىلىغىلى بولمايدۋاتىدۇ.','Invalid revision ID.'=>'ئناۋەتسىز يېڭىلانما كىملىگى (ID).','Status is forbidden.'=>'ھالەت چەكللەنگەن.','Limit result set to items that are sticky.'=>'نەتىجە توپلىمىنى چوققىلانغان تۈر بىلەن چەكلەش.','Limit result set to items except those with specific terms assigned in the %s taxonomy.'=>'نەتىجە توپلىمىنى %s تۈرلىنىشىدە ئېنىقلىما بېرىلگەن بەلگىلىك تۈرلەرنىڭ سىرتىدىكى تۈرلەرنى چەكلەيدۇ.','Limit result set to all items except those of a particular parent ID.'=>'نەتىجە توپلىمىنى مەلۇم ئانا كىملىكىگە ئىگە بولغانلاردىن باشقا بارلىق تۈرلەر بىلەن چەكلەش.','Limit result set to items with particular parent IDs.'=>'نەتىجى توپلىمىنى مەلۇم ئانا كىملىكىگە ئىگە بولغان تۈرلەر بىلەن چەكلەش.','Offset the result set by a specific number of items.'=>'نەتىجە توپلىمىنى بەلگىلىك ساندىكى تۈرلەرگىچە سۈرۈش.','Limit result set to posts with a specific menu_order value.'=>'نەتىجى توپىنى بەلگىلىك تىزىملىك تەرتىپ قىمىىتى بار يازمىلار بىلەن چەكلەش.','Ensure result set excludes posts assigned to specific authors.'=>'نەتىجە توپىنىڭ بەلگىلەنگەن ئاپتورلارنىڭ يازمىلىرىنى ئۆز ئىچىگە ئالماسلىقىغا كاپالەتلىك قىلىش.','Limit result set to posts assigned to specific authors.'=>'نەتىجى توپىنى بەلگىلىك ئاپتتورلارغا  تەقسىملەنگەن يازمىلار بىلەن چەكلەش.','The terms assigned to the post in the %s taxonomy.'=>'%s تۈرلىنىشىدە يازمىغا تەقسىملەنگەن ئاتالغۇلار.','The theme file to use to display the post.'=>'يازمىنى كۆرسىتىش ئۈچۈن ئىشلىتىلىدىغان ئۆرنەك ھۆججىتى.','A password to protect access to the content and excerpt.'=>'مەزمۇن ۋە قىسقارتىلمىنى قوغداش ئۈچۈن بىر پارول.','Whether or not the post should be treated as sticky.'=>'يازمىنى چوققىلاشقا بولامدۇ-يوق.','The format for the post.'=>'يازمىنىڭ پىچىمى.','Whether or not the post can be pinged.'=>'يازمىغا ping بۇيرۇقى بەرگىلى بولامدۇ يوق.','Whether or not comments are open on the post.'=>'يازمىغا ئىنكاس يېزىش ئوچۇقمۇ يوق.','The ID of the featured media for the post.'=>'يازمىنىڭ تەۋسىيەلىك ۋاسىتە كىملىكى.','Whether the excerpt is protected with a password.'=>'ئۈزۈندە پاروللۇق قوغدىلامدۇ-يوق.','HTML excerpt for the post, transformed for display.'=>'يازمىتىڭ كۆرسەتكەندە ئۆزگىرىدىغان HTML ئۈزۈندىسى.','Excerpt for the post, as it exists in the database.'=>'سانداندا مەۋجۇت يازمىنىڭ ئۈزۈندىسى.','The excerpt for the post.'=>'يازمىنىڭ ئۈزۈندىسى.','The ID for the author of the post.'=>'يازما يازغۇچىنىڭ كىملىكى.','Whether the content is protected with a password.'=>'مەزمۇنى پاروللۇق قوغدىلامدۇ-يوق.','HTML title for the post, transformed for display.'=>'ئوبيېكتنىڭ كۆرسەتكەندە ئۆزگىرىدىغان HTML ماۋزۇسى.','Title for the post, as it exists in the database.'=>'سانداندا مەۋجۇت يازمىنىڭ ماۋزۇسى.','The title for the object.'=>'ئوبيېكت ماۋزۇسى.','A named status for the post.'=>'يازمىنىڭ ئاتالغان ھالىتى.','An alphanumeric identifier for the revision unique to its type.'=>'تىپى بىردىنبىر بولغان تۈزىتىلگەن نۇسخىنىڭ ھەرپ-رەقەمدىن تۈزۈلگەن بىردىنبىر پەرقلەندۈرگۈچىسى.','The date the revision was last modified, as GMT.'=>'تۈزىتىلگەن نۇسخا گىرىنۋىچ ئۆلچەملىك ۋاقتىدا ئاخىرقى قېتىم ئۆزگەرتىلگەن چېسلاسى.','The date the revision was last modified, in the site\'s timezone.'=>'تۈزىتىلگەن نۇسخا بېكەت ۋاقىت رايونىنىڭ ۋاقتىدا ئاخىرقى قېتىم ئۆزگەرتىلگەن چېسلاسى.','GUID for the post, transformed for display.'=>'يازمىنىڭ GUID سى، كۆرسىتىش ئۈچۈن ئۆزگەرتىلگەن.','GUID for the revision, as it exists in the database.'=>'سانداندىكى تۈزىتىلگەن نۇسخىنىڭ GUID سى.','The globally unique identifier for the post.'=>'ئوبيېكتنىڭ ئومۇميۈزلۈك بىردىنبىر كىملىكى.','The date the revision was published, as GMT.'=>'تۈزىتىلگەن نۇسخا گىرىنۋىچ ئۆلچەملىك ۋاقتىدا ئېلان قىلىنغاندىكى چېسلاسى.','The date the revision was published, in the site\'s timezone.'=>'تۈزىتىلگەن نۇسخا بېكەت ۋاقىت رايونىنىڭ ۋاقتىدا ئېلان قىلىنغاندىكى چېسلاسى.','Invalid featured media ID.'=>'ئىقتىدارلىق مىدېئا كىملىكى ئىناۋەتسىز.','Invalid post parent ID.'=>'ئانا يازمىنىڭ ID سى ئىناۋەتسىز.','A password protected post can not be set to sticky.'=>'پارول بىلەن قوغدالغان يازمىنى چوققىلىغىلى بولمايدۇ.','A sticky post can not be password protected.'=>'چوققىلانغان يازمىنى پارول بىلەن قوغدىغىلى بولمايدۇ.','A post can not be sticky and have a password.'=>'چوققىلىغىلى بولمايدىغان ھەم پارولى بولغان يازما.','The post has already been deleted.'=>'بۇ يازما ئاللىقاچان ئۆچۈرۈلگەن.','Sorry, you are not allowed to edit comments.'=>'كەچۈرۈڭ، ئىنكاس تەھرىرلەش ئىجازىتىڭىز يوق.','Sorry, you are not allowed to manage this plugin.'=>'كەچۈرۈڭ، بۇ قىستۇرمىنى باشقۇرۇشىڭىزغا رۇخسەت قىلىنمىغان.','Cannot create existing post.'=>'مەۋجۇت بىر يازمىنى يېڭىدىن قۇرالمايسىز.','Sorry, you are not allowed to create new users.'=>'كەچۈرۈڭ، يېڭى ئىشلەتكۈچىلەر قۇرۇشىڭىزغا رۇخسەت يوق.','Incorrect post password.'=>'يازما پارولى خاتا.','You need to define a search term to order by relevance.'=>'ئوخشاشلىقىغا ئاساسەن رەتلىمەك ئۈچۈن بىر ئىزدەش كەلىمىسى بېكىتىشىڭىز كېرەك.','The password for the post if it is password protected.'=>'ئەگەر يازما پارول بىلەن قوغدالغان بولسا، پارول.','Human-readable labels for the taxonomy for various contexts.'=>'ھەر خىل تەركىبلەرگە ئائىت تەكسونومىيە ئۈچۈن ئىنسان ئوقۇپ چۈشەنگىدەك بەلگىلەر.','Whether or not the taxonomy should have children.'=>'تۈرلىنىشنىڭ تارماقلىرى بولۇشى كېرەكمۇ يوق.','A human-readable description of the taxonomy.'=>'تۈرلىنىشنىڭ ئىنسان ئوقۇپ چۈشەنگۈدەك تونۇشتۇرۇلۇشى.','All capabilities used by the taxonomy.'=>'تۈرلىنىشتە ئىشلىتىلگەن بارلىق ئىقتىدارلار.','Sorry, you are not allowed to manage post statuses.'=>'كەچۈرۈڭ، يازما ھالەتلىرىنى باشقۇرۇشىڭىزغا رۇخسەت يوق.','An alphanumeric identifier for the user.'=>'ئىشلەتكۈچى ئۈچۈن ھەرپ - رەقەمدىن تۈزۈلگەن بىر كىملىك.','Whether to include posts in the edit listing for their post type.'=>'يازما تىپلىرى تەھرىر تىزىملىكى يازمىلارنى ئۆز ئىچىگە ئالسۇنمۇ - يوق.','Whether posts with this status should be publicly-queryable.'=>'بۇ ھالەتتىكى يازمىلار ئاۋام تەرىپىدىن سۈرۈشتۈرۈلسۈنمۇ - يوق.','Whether posts of this status should be shown in the front end of the site.'=>'بۇ ھالەتتىكى يازمىلار تور بېكىتىنىڭ ئالدى يۈزىدە كۆرۈنسۈنمۇ - يوق.','Whether posts with this status should be protected.'=>'بۇ ھالەتتىكى يازمىلار قوغدالنسۈنمۇ - يوق.','Whether posts with this status should be private.'=>'بۇ ھالەتتىكى يازمىلار خۇسۇسىىيمۇ - يوق.','Scope under which the request is made; determines fields present in response.'=>'ئىلتىماس قىلىنغان دائىرە؛ جاۋاپنتىكى جايلارنى بەلگىلەيدۇ.','Limit results to those matching a string.'=>'نەتىجە توپىنى ھەرپ تىزمىلىرى بىلەن ماس كەلگىدەك چەكلە.','Maximum number of items to be returned in result set.'=>'قايتۇرغان نەتىخە توپلىمىدا كۆرۈنىدىغان ئەڭ كۆپ تۈر سانى.','Current page of the collection.'=>'يىغىلمىنىڭ نۆۋەتتىكى بېتى.','Method \'%s\' not implemented. Must be overridden in subclass.'=>'ئۇسۇل \'%s\'  ئەمەلگە ئاشۇرىلمىغان. ئاستىنقى كلاستا ئۈستىگە يېزىلىشى كېرەك.','Limit result set to comments assigned a specific type. Requires authorization.'=>'نەتىجە توپىنى بەلگىلىك تىپقا تەقسىملەنگەن ئىنكاسلار بىلەن چەكلەش. ھوقۇق بېرىش كېرەك.','Limit result set to comments assigned a specific status. Requires authorization.'=>'نەتىجە توپىنى بەلگىلەنگەن ھالەتكە ئاتالغان ئىنكاس بىلەن چەكلەش. ھوقۇق بېرىشىڭىز كېرەك.','Limit result set to comments assigned to specific post IDs.'=>'نەتىجە توپىنى بەلگەىلەنگەن يازما كىملىكلىرى بىلەن چەكلەش.','Ensure result set excludes specific parent IDs.'=>'نەتىجە توپىنىڭ بەلگىلەنگەن ئانا كىملىكلەرنى چىقىرىۋەتكىنىگە كاپالەتلىك قىلىڭ.','Limit result set to comments of specific parent IDs.'=>'نەتىجە توپىنى بەلگەىلەنگەن ئانا كىملىكلىرى بىلەن چەكلەش.','Sort collection by object attribute.'=>'يىغىلغانلارنى ئوبېكتىپنىڭ خاسلىقىغا ئاساسەن رەتلەش.','Order sort attribute ascending or descending.'=>'رەتلەش تەرتىبى ئاشقان بويىچىمۇ ياكى كېمەيگەن بويىچىمۇ.','Limit result set to specific IDs.'=>'نەتىجە توپىنى بەلگەىلەنگەن ئىشلەتكۈچى كىملىگى بىلەنلا چەكلەش.','Ensure result set excludes specific IDs.'=>'نەتىجە توپىنىڭ بەلگىلەنگەن كىملىكلەرنى چىقىرىۋەتكىنىگە كاپالەتلىك قىلىڭ.','Limit response to posts published before a given ISO8601 compliant date.'=>'جاۋاپنى بېرىلگەن ISO8601 فورماتىغا ماس كېلىدىغان چىسلادىن بۇرۇن ئېلان قىلىنغان يازمىلار بىلەن چەكلەش.','Limit result set to that from a specific author email. Requires authorization.'=>'نەتىجە توپىنى بەلگەىلەنگەن ئاپتورنىڭ ئېلخېتى بىلەنلا چەكلەش. ھوقۇق بېرىشىڭىز كېرەك.','Ensure result set excludes comments assigned to specific user IDs. Requires authorization.'=>'نەتىجە توپىنىڭ بەلگىلەنگەن ئىشلەتكۈچى كىملىكىگە ئاتالغان ئىنكاسلارنى ئۆز ئىچىگە ئالمىغىنىغا كاپالەتلىك قىلىڭ. ھوقۇق بېرىشىڭىز كېرەك.','Limit result set to comments assigned to specific user IDs. Requires authorization.'=>'نەتىجە توپىنى بەلگىلەنگەن ئىشلەتكۈچى كىملىكىگە ئاتالغان ئىنكاسلار بىلەنلا چەكلەش. ھوقۇق بېرىشىڭىز كېرەك.','Limit response to posts published after a given ISO8601 compliant date.'=>'جاۋاپنى بېرىلگەن ISO8601 فورماتىغا ماس كېلىدىغان چىسلادىن كېيىنكى يازمىلار بىلەن چەكلەش. ھوقۇق بېرىشىڭىز كېرەك.','Avatar URLs for the comment author.'=>'ئىنكاس يازغۇچىنىڭ سىماسىنىڭ تور ئادرېسى.','Avatar URL with image size of %d pixels.'=>'%d پىكىسلى باش سۈرەت ئۇلانمىسى.','State of the comment.'=>'ئىنكاسنىڭ ھالىتى.','The ID of the associated post object.'=>'مۇناسىۋەتلىك يازما ئوبيېكتىنىڭ كىملىكى.','The ID for the parent of the post.'=>'يازمىنىڭ ئاتا كىملىكى.','URL to the object.'=>'ئوبيېكت URL ئادرېسى.','The date the post was published, as GMT.'=>'گىرىنۋىچ ئۆلچەملىك ۋاقتىدا، يازما يوللانغان چېسلا.','HTML content for the post, transformed for display.'=>'توردا كۆرسىتىش ئۈچۈن ئۆزگەرتىلگەن يازمىنىڭ HTML مەزمۇنى.','Content for the post, as it exists in the database.'=>'سانداندىكى يازمىنىڭ مەزمۇنى.','The content for the post.'=>'يازمىنىڭ مەزمۇنى.','User agent for the comment author.'=>'ئىنكاس يازغۇچىنىڭ ئىشلەتكۈچى ۋاكالەتچىسى.','URL for the comment author.'=>'ئىنكاس يازغۇچىنىڭ تور ئادرېسى.','Display name for the comment author.'=>'ئىنكاس يازغۇچىنىڭ كۆرۈنىدىغان ئىسمى.','IP address for the comment author.'=>'ئىنكاس يازغۇچىنىڭ IP ئادرېسى.','Email address for the comment author.'=>'ئىنكاس يازغۇچىنىڭ ئېلخەت ئادرېسى.','The ID of the user object, if author was a user.'=>'ئەگەر ئاپتور ئىشلەتكۈچى بولسا، ئىشلەتكۈچى ئوبيېكتىپىنىڭ كىملىك(ID) نومۇرىنى كۆرسىتىدۇ.','Unique identifier for the object.'=>'ئوبيېكتىپنىڭ بىردىنبىر كىملىك بەلگىسى.','Invalid comment author ID.'=>'ئىناۋەتسىز ئىنكاس ئاپتورىنىڭ كىملىكى(ID).','The comment cannot be deleted.'=>'بۇ ئىنكاسنى ئۆچۈرۈشكە بولمايدۇ.','The comment has already been trashed.'=>'بۇ ئىنكاس ئاللىقاچان ئەخلەتكە تاشلانغان.','Updating comment failed.'=>'ئىنكاسنى يېڭىلىيالمىدى.','Updating comment status failed.'=>'ئىنكاس ھالىتىنى ئۆزگەرتەلمىدى.','Creating comment failed.'=>'يېڭى ئىنكاس يازالمىدى.','Creating a comment requires valid author name and email values.'=>'ئىنكاس يېزىش ئۈچۈن ئىناۋەتلىك ئاپتور ئىسمى ۋە ئېلخەت ئادرېسى بولۇشى كېرەك.','Cannot create existing comment.'=>'بار ئىنكاسنى يېڭىدىن قۇرالمايسىز.','Sorry, you must be logged in to comment.'=>'كەچۈرۈڭ، ئىنكاس يېزىش ئۈچۈن بېكەتكە كىرىشىڭىز كېرەك.','Query parameter not permitted: %s'=>'سوراش پارامېتىرىڭىزگە رۇخسەت قىلىنمىغان: %s','Whether to bypass Trash and force deletion.'=>'ئەخلەت ساندۇغىغا تاشلىماي مەجبۇرى ئۆچۈرۈپ ئۆچۈرمەيدىغىنىڭىز.','Limit result set to attachments of a particular MIME type.'=>'نەتىجە توپىنى مەلۇم MIME تىپىگە ئىگە قوشۇمچە ھۆججەتلەر بىلەن چەكلەش.','Limit result set to attachments of a particular media type.'=>'نەتىجە توپلامىنى بەلگىلىك مېدىئا تىپىدىكى قوشۇمچە ھۆججەتلەر بىلەن چەكلەڭ.','Could not open file handle.'=>'ھۆججەت ساپىقىنى ئاچالمىدۇق.','Content hash did not match expected.'=>'مەزمۇننىڭ ھاش قىممىتى ئۈمىت قىلغاندەك چىقمىدى.','Invalid Content-Disposition supplied. Content-Disposition needs to be formatted as `attachment; filename="image.png"` or similar.'=>'ئىناۋەتسىز مەزمۇن - بىر تەرەپ قىلىش تەمىنلەنگەن. مەزمۇن - بىر تەرەپ قىلىش `attachment; filename="image.png"` شەكلىدە ياكى يېقىن شەكىلدە بولىشى كېرەك.','No Content-Disposition supplied.'=>'مەزمۇن- بىر تەرەپ قىلىش (Content-Disposition) تەمىنلەنمىگەن.','No Content-Type supplied.'=>'مەزمۇن- تىپى (Content-Type) تەمىنلەنمىگەن.','No data supplied.'=>'مەلۇمات تەمىنلەنمىگەن.','The ID for the associated post of the attachment.'=>'قوشۇمچە ھۆججەتكە مۇناسىۋەتلىك يازمىنىڭ ID سى.','Details about the media file, specific to its type.'=>'كۆرسىتىلگەن تىپتىكى مېدىئا ھۆججىتىنىڭ تەپسىلاتى.','Alternative text to display when attachment is not displayed.'=>'قوشۇمچە ھۆججەت كۆرسىتەلمىگەندە ئورنىغا كۆرسىتىلىدىغان تېكىست.','Invalid parent type.'=>'ئانا تىپ ئىناۋەتسىز.','Sorry, you are not allowed to upload media to this post.'=>'كەچۈرۈڭ، بۇ يازمىغا مېدىئا ھۆججىتى يۈكلىشىڭىزگە رۇخسەت قىلىنمىغان.','Sorry, you are not allowed to upload media on this site.'=>'كەچۈرۈڭ، بۇ تور بېكىتىگە مېدىئا ھۆججىتى يۈكلىشىڭىزگە رۇخسەت قىلىنمىغان.','The REST API can no longer be completely disabled, the %s filter can be used to restrict access to the API, instead.'=>'بۇندىن كېيىن REST API\'نى  تولۇق توختاتقىلى بولمايدۇ، ئۇنىڭ ئورنىغا %s سۈزگۈچى بىلەن API غا كىرىشنى تەقىپ قىلالايسىز.','Page Attributes'=>'بەتنىڭ خۇسۇسىيەتلىرى','Post Attributes'=>'يازمىنىڭ خۇسۇسىيەتلىرى','View Pages'=>'بەت كۆرۈش','View Posts'=>'يازمىلارنى كۆرۈش','No changesets found in Trash.'=>'ئەخلەتتە ئۆزگەرتىش يوق.','No changesets found.'=>'ئۆزگىرىشلەر توپى تېپىلمىدى.','Search Changesets'=>'ئۆزگىرىشلەر توپلىمىنى ئىزدەش','All Changesets'=>'بارلىق ئۆزگىرىش توپلاملىرى','View Changeset'=>'ئۆزگىرىش توپلىمىنى كۆزدىن كەچۈرۈش','Edit Changeset'=>'ئۆزگىرىش توپلىمىنى تەھرىرلەش','New Changeset'=>'يېڭى ئۆزگىرىش توپلىمى','Add New Changeset'=>'يېڭى ئۆزگىرىش توپلىمى قوشۇش','post type singular nameChangeset'=>'ئۆزگىرىش توپلىمى','post type general nameChangesets'=>'ئۆشگىرىش توپلىمى','Custom CSS'=>'CSS نى خاسلاشتۇرۇش','Attachment Attributes'=>'قوشۇلما ھۆججەتنىڭ ئالاھىدىلىگى','%1$s %2$s, %3$s ago (%4$s)'=>'%1$s %2$s, %3$s ئالدىدا (%4$s)','The "%s" options group has been removed. Use another settings group.'=>'"%s" تاللاشلار گۇرۇپپىسى ئۆچۈرۈلگەن. پاشقا بىر سەپلىمە گۇرۇپپىسىنى ئىشلىتىڭ.','Allow link notifications from other blogs (pingbacks and trackbacks) on new articles.'=>'باشقا بلوگلارنىڭ يېڭى ماقالىلارغا ئۇلانما (قايتۇرما ئىنكاس ۋە قايتۇرما ئىزلەش) ئۇقتۇرۇشلىرىنى قۇرۇشىغا رۇخسەت قىلىش.','Blog pages show at most.'=>'ئەڭ كۆپ بولغاندا شۇنچە بەت كۆرسىتەلەيدۇ.','Default post format.'=>'كۆڭۈلدىكى يازما پىچىمى.','Convert emoticons like :-) and :-P to graphics on display.'=>':-) ۋە  :-P گە ئوخشاش چىراي ئىپادىلىرىنى رەسىملىك قىلىپ كۆرسىتىش.','WordPress locale code.'=>'WordPress يەرلىك كودى.','A day number of the week that the week should start on.'=>'ھەپتە باشلانغان كۈن ھەپتىنىڭ قانچىنچى كۈنى.','A time format for all time strings.'=>'ۋاقىت تىزىقىغا ئورتاق ۋاقىت پىچىمى.','A date format for all date strings.'=>'چېسلا تىزىقىغا ئورتاق چېسلا پىچىمى.','A city in the same timezone as you.'=>'سىز بىلەن ئورتاق ۋاقىت رايونىدىكى بىر شەھەر.','Site title.'=>'تور بېكەت تېمىسى.','Search media items...'=>'ۋاسىتە تۈرلىرىنى ئىزدە…','next set of postsNext'=>'كېيىنكى','previous set of postsPrevious'=>'ئالدىنقى','Username or Email Address'=