ge to use as a header video. Try a shorter video or optimize the compression settings and re-upload a file that is less than 8MB. Or, upload your video to YouTube and link it with the option below.'=>'بۇ سىن ھۆججىتىنى باش سىن ئۈچۈن ئىشلىتىشكە سىغىمى بەك چوڭ.8MB دىن كىچىك سىننى سىناڭ. ياكى بولمىسا پىرىسلاش سەپلىمىلىرىنى ياخشى تەڭشەپ كىچىكلەتكەندىن كېيىن قايتا يوللاڭ. ئۇنىڭدىن باشقا YouTube قا يوللاپ، ئاندىن تۆۋەندىكى تاللانما ئارقىلىق باغلىسىڭىز بولىدۇ.','Unrecognized background setting.'=>'تەگلىك تەڭشىكىنى پەرق ئېتەلمىدى.','Invalid value for background size.'=>'تەگلىك چوڭلۇقىنىڭ قىممىتى ئىناۋەتسىز.','Invalid value for background position Y.'=>'تەگلىكنىڭ Y ئۇرۇن  قىممىتى ئىناۋەتسىز.','Invalid value for background position X.'=>'تەگلىكنىڭ X ئۇرۇن قىممىتى ئىناۋەتسىز.','Invalid value for background attachment.'=>'تەگلىك يۈكلەنمىسىنىڭ قىممىتى ئىناۋەتسىز.','Invalid value for background repeat.'=>'تەگلىك تەكرارلانما قىممىتى ئىناۋەتسىز.','Learn more about CSS'=>'CSS توغرۇلۇق تېخىمۇ كۆپ بىلدۈرگۈ','Additional CSS'=>'قوشۇمچە CSS','Scroll with Page'=>'سىيرىلما بالداقلىق بەت','Repeat Background Image'=>'تەگلىك سۈرەتنى تەكرارلايدۇ','Image Size'=>'سۈرەت چوڭلۇقى','Image Position'=>'سۈرەت ئورنى','Custom PresetCustom'=>'ئىختىيارى','Repeat ImageRepeat'=>'تەكرارلا','Fit to Screen'=>'ئېكراننى تولدۇرۇش','Default PresetDefault'=>'كۆڭۈلدىكى','Background PresetPreset'=>'ئالدىن تەڭشەك','Header Video'=>'تېما سىنى','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends a height of %2$s pixels.'=>'سىننى %1$s پىچىمدا يۈكلەڭ ۋە ياخشى نەتىجىلىك بولۇشى ئۈچۈن ئۇنىڭ سىغىمىنى كىچىكلىتىڭ. تەۋسىيە قىلىنغان ئۆرنەكنىڭ ئېگىزلىكى %2$s پىكسېل.','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends a width of %2$s pixels.'=>'سىننى %1$s پىچىمدا يۈكلەڭ ۋە ياخشى نەتىجىلىك بولۇشى ئۈچۈن ئۇنىڭ سىغىمىنى كىچىكلىتىڭ. تەۋسىيە قىلىنغان ئۆرنەكنىڭ كەڭلىكى %2$s پىكسېل.','Upload your video in %1$s format and minimize its file si