rmation in your %1$s file is incorrect or that contact with the database server at %2$s could not be established. This could mean your host&#8217;s database server is down.'=>'سىز %1$s ھۆججەتتە بەلگىلىگەن ئىشلەتكۈچى ۋە ئىم ئۇچۇرى خاتا ياكى %2$s دە ساندان مۇلازىمېتىرىغا ئۇلىنامىغانلىقىنى بىلدۈرىدۇ. بەلكىم ساندان مۇلازىمېتىرىڭىز ئىشلىمىگەن بولۇشى مۈمكىن.','If you do not know how to set up a database you should <strong>contact your host</strong>. If all else fails you may find help at the <a href="%s">WordPress support forums</a>.'=>'ئەگەر سانداننى قانداق سەپلەشنى بىلەلمىسىڭىز، <strong>مۇلازىمەت تەمىنلىگۈچى بىلەن ئالاقىلىشىڭ</strong>. ياكى <a href="%s">WordPress قوللاش مۇنبەرلىرى</a>نى زىيارەت قىلسىڭىزمۇ ئالاقىدار ياردەمگە ئېرىشەلەيسىز.','On some systems the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?'=>'بەزى سېستىمىلاردا ساندان ئىسمى سىزنىڭ ئىشلەتكۈچى ئىسمىڭىز بىلەن باشلىنىدۇ، يەنى مۇنداق <code> username_%1$s</code>. خاتالىق بۇسەۋەپتىنمىدۇ ؟','Does the user %1$s have permission to use the %2$s database?'=>'ئىشلەتكۈچى %1$s نىڭ ساندان %2$s نى ئىشلىتىش ھوقۇقى بارمۇ ؟','Are you sure it exists?'=>'راستتىنلا چېكىنەمسىز؟','The tag cloud will not be displayed since there are no taxonomies that support the tag cloud widget.'=>'بەلگە بۇلۇتىنى كۆرسىتەلمىدى، چۈنكى  بۇ بەلگە بۇلۇتى ئەپچەنى قوللايدىغان تۈرلىنىشى يوق.','Nicename may not be longer than 50 characters.'=>'تور نامىڭىز 50 ھەرپتىن ئۇزۇن بولماسلىغى كېرەك.','<strong>Error:</strong> The password you entered for the username %s is incorrect.'=>'<strong>خاتالىق:</strong> ئىشلەتكۈچى ئاتى %s غا كىرگۈزگەن ئىم خاتا.','Categories list'=>'سەھىپە تىزىمى','Tags list'=>'بەلگە تىزىمى','Categories list navigation'=>'سەھىپە تىزىمى يولباشچىسى','Tags list navigation'=>'بەلگە تىزىمى يولباشچىسى','Invalid shortcode name: %1$s. Do not use spaces or reserved characters: %2$s'=>'ئىناۋەتسىز قىسقارتىلما كودنامى: %1$s. بوش ئورۇن ياكى قوللانسا بولمايدىغان ھەرپلەرنى ئ