ئاكتىپلاپ بولغاندىن كېيىن، تور بېكىتىڭىزنى زىيارەت قىلالايسىز:

%2$s','That site is currently reserved but may be available in a couple days.'=>'بۇ تور بېكەت نامى ھازىرچە بۇيرۇتۇلدى، لېكىن بىرقانچە كۈندىن كېيىن تىزىملاتقىلى بولۇشى مۇمكىن.','Sorry, that site is reserved!'=>'كەچۈرۈڭ، بۇ تور بېكەت بۇيرۇتۇلغان!','Sorry, that site already exists!'=>'كەچۈرۈڭ، بۇ تور بېكەت مەۋجۇت ئىكەن!','Sorry, site names must have letters too!'=>'كەچۈرۈڭ، تور بېكەت نامىدا ھەرپمۇ بولۇشى كېرەك!','Sorry, you may not use that site name.'=>'كەچۈرۈڭ، تور بېكەت نامىغا ئۇنى ئىشلىتەلمەيسىز.','This site has been archived or suspended.'=>'بۇ تور بېكەت ئارخىپلانغان ياكى توختىتىلغان.','The site you have requested is not installed properly. Please contact the system administrator.'=>'تەلەپ قىلغان تور بېتىڭىز تولۇق قاچىلانمىدى. سىستېما باشقۇرغۇچىسى بىلەن ئالاقىلىشىڭ.','The given object ID is not that of a menu item.'=>'بېرىلگەن ئوبيېكت كىملىكى (ID) تىزىملىك تۈرى ئەمەس.','The Site address you entered did not appear to be a valid URL. Please enter a valid URL.'=>'كىرگۈزگەن تور بېكەت ئادرېسىڭىز ئىناۋەتسىز. ئىناۋەتلىك ئادرېس كىرگۈزۈڭ.','The WordPress address you entered did not appear to be a valid URL. Please enter a valid URL.'=>'كىرگۈزگەن WordPress ئادرېسىڭىز ئىناۋەتسىز. ئىناۋەتلىك ئادرېس كىرگۈزۈڭ.','The email address entered did not appear to be a valid email address. Please enter a valid email address.'=>'كىرگۈزۈلگەن ئېلېكتىرونلۇق خەت ئادرېسىڭىز ئىناۋەتلىك ئەمەستەك قىلىدۇ. ئىناۋەتلىك ئېلېكتىرونلۇق خەت ئادرېسى كىرگۈزۈڭ.','A term with the name provided already exists with this parent.'=>'بۇ ئانا تۈردە ئوخشاش ئىسىمدىكى تۈر مەۋجۇت.','An error occurred adding you to this site. Go to the <a href="%s">homepage</a>.'=>'سىزنى بۇ تور بېكەتكە قوشقاندا خاتالىق كۆرۈلدى.<a href="%s">باش بەت</a>  كە يۆتكىلىڭ.','Your email address will not be published.'=>'ئېلېكتىرونلۇق خەت ئادرېسىڭىز ئاشكارىلانمايدۇ.','A valid URL was not provided.'=>'كىرگۈزۈلگىنى ئىناۋەتلىك تور ئادرېسى ئەمەس.','Could not calculate resized image dimensions'=>'ئۆزگەرتىلگەن سۈرەت چوڭلۇقىنى ھېسابلىغىلى بولمىدى','Completed <span class="count">(%s)</span>'=>'تاماملانغان <span class="count">(%s)</span>' . "\0" . 'تاماملانغان <span class="count">(%s)</span>','You are logged in already. No need to register again!'=>'سىز تىزىملىتىپ كىرىپ بولغان. تىزىملىتىشىڭىز ھاجەتسىز!','You must first <a href="%s">log in</a>, and then you can create a new site.'=>'سىز ئاۋۋال <a href="%s">كىرىڭ</a>، شۇندىلا يېڭىدىن تور بېكەت قۇرالايسىز.','Welcome back, %s. By filling out the form below, you can <strong>add another site to your account</strong>. There is no limit to the number of sites you can have, so create to your heart&#8217;s content, but write responsibly!'=>'قايتا قەدىمىڭىزگە مەرھابا، %s.  تۆۋەندىكى جەدۋەلنى تولدۇرىسىڭىز، <strong>يەنە بىر تورنى ھېساباتىڭىزغا قوشالايسىز</strong>. سىز قۇرالايدىغان تورنىڭ سانىغا چەكلىمە يوق، شۇڭا خالىغانچە قۇرسىڭىز بولىدۇ، لېكىن يازغانلىرىڭىز ئىشەنچلىك بولسۇن!','Must be at least 4 characters, letters and numbers only. It cannot be changed, so choose carefully!'=>'كامىدا 4 ھەرپ- بەلگە ياكى رەقەم بولۇشى كېرەك. ئۇنى كېيىن ئۆزگەرتكىلى بولمايدۇ. شۇڭا ئەستايىدىل تاللاڭ!','This action has been disabled by the administrator.'=>'بۇ مەشغۇلات باشقۇرغۇچى تەرىپىدىن چەكلىۋېتىلگەن.','Page %s'=>'%s-بەت','Briefly unavailable for scheduled maintenance. Check back in a minute.'=>'قەرەللىك ئاسراش سەۋەبىدىن ۋاقىتلىق تاقالغان. سەل تۇرۇپ قايتا تەكشۈرۈڭ.','Maintenance'=>'ئاسراش','Navigation Menus'=>'يولباشچى تىزىملىك','Navigation Menu Item'=>'يولباشچى تىزىملىك تۈرى','Navigation Menu Items'=>'يولباشچى تىزىملىك تۈرى','Links for %s'=>'%s نىڭ ئۇلانمىسى','No menus have been created yet. <a href="%s">Create some</a>.'=>'تىزىملىك تېخى قۇرۇلمىدى. <a href="%s">تىزىملىك قۇراي</a>.','This is the short link.'=>'بۇ بىر قىسقا ئۇلانما.','%d Theme Update'=>'%d ئۆرنەك يېڭىلاش' . "\0" . '%d ئۇسلۇب يېڭىلاشلار','%d Plugin Update'=>'%d قىستۇرما يېڭىلاش' . "\0" . '%d قىستۇرمىنىڭ يېڭىلانمىسى','%d WordPress Update'=>'%d WordPress يېڭىلاش','Site registration has been disabled.'=>'تور بېكەت تىزىملىتىش توختىتىلغان.','If you do not activate your site within two days, you will have to sign up again.'=>'تور بېتىڭىزنى ئىككى كۈن ئىچىدە ئاكتىپلىمىسىڭىز قايتىدىن تىزىملىتىشىڭىزغا توغرا كېلىدۇ.','But, before you can start using your site, <strong>you must activate it</strong>.'=>'لېكىن، تور بېتىڭىزنى ئىشلىتىشنى باشلاشتىن بۇرۇن <strong>ئۇنى ئاكتىپلىشىڭىز كېرەك.</strong>.','Congratulations! Your new site, %s, is almost ready.'=>'مۇبارەك بولسۇن! يېڭى تور بېتىڭىز %s تەييار بولدى.','Gimme a site!'=>'تور بېكەت قۇراي!','The site %s is yours.'=>'%s تور بېكىتى سىزگە تەۋە.','Create Site'=>'تور بېكەت قۇرۇش','If you are not going to use a great site domain, leave it for a new user. Now have at it!'=>'ئەگەر قالتىس تور بېكەت ئىسمىنى ئىشلەتمىسىڭىز يېڭى ئىشلەتكۈچىلەرگە قالدۇرىسىز. باشقىلار ئىشلىتىۋالمىسۇن!','Sites you are already a member of:'=>'سىز تىزىملاتقان تور بېكەتلەر تۆۋەندىكىچە:','Get <em>another</em> %s site in seconds'=>'<em>باشقا بىر</em> %s تور بېتىنى دەرھال ئالالايسىز','Site Title:'=>'تور بېكەت ماۋزۇسى:','sitename'=>'تور بېكەت ئىسمى','File canceled.'=>'ھۆججەت بىكار قىلىندى.','A new comment on the post "%s" is waiting for your approval'=>'يازما «%s» دا بىر يېڭى ئىنكاس تەستىقىڭىزنى كۈتۈۋاتىدۇ','A new pingback on the post "%s" is waiting for your approval'=>'يازما «%s» دا يېڭى بىر جاۋاب تەستىقىڭىزنى كۈتۈۋاتىدۇ','A new trackback on the post "%s" is waiting for your approval'=>'يازما  «%s» دا يېڭى جاۋاب تەستىقىڭىزنى كۈتۈۋاتىدۇ','New pingback on your post "%s"'=>'يازمىڭىز «%s» دىكى  يېڭى جاۋاب','New trackback on your post "%s"'=>'يازمىڭىز «%s» دىكى يېڭى ئىزچى','New comment on your post "%s"'=>'يازمىڭىز «%s» دىكى يېڭى ئىنكاس','If your site does not display, please contact the owner of this network.'=>'تور بېتىڭىز ئېچىلمىسا، ئۇنداقتا تور تەمىنلىگۈچىڭىز بىلەن ئالاقىلىشىڭ.','Select Menu:'=>'تىزىملىكنى تاللاش:','Navigation Menu'=>'يولباشچى تىزىملىك','Taxonomy:'=>'تۈرلىنىشى:','Search results for: "%s"'=>'ئىزدەش نەتىجىسى: «%s»','One response to %s'=>'%s ئۈچۈن بىر ئىنكاس','Menus'=>'تىزىملىكلەر','Your PHP installation appears to be missing the MySQL extension which is required by WordPress.'=>'مۇلازىمىتېرىڭىزدىكى PHP دا WordPress كە لازىملىق MySQL كېڭەيتىلمە نامىنى ئىشلەتكىلى بولمايدىكەن.','The specified target URL does not exist.'=>'بەلگىلەنگەن نىشان ئادرېسى مەۋجۇت ئەمەس.','Pingback from %1$s to %2$s registered. Keep the web talking! :-)'=>'%2$s دىن %1$s غا بولغان قايتما تىزىملىتىلدى. توردا پاراڭلىشىۋېرىڭ! :-)','The source URL does not contain a link to the target URL, and so cannot be used as a source.'=>'مەنبە ئادرېس نىشان ئادرېسىنىڭ ئۇلانمىسىنى ئۆز ئىچىگە ئالمىغان، شۇڭلاشقا مەنبە قىلىشقا بولمايدۇ.','The source URL does not exist.'=>'مەنبە ئادرېسى مەۋجۇت ئەمەس.','The pingback has already been registered.'=>'قايتما تىزىملىتىپ بولۇنغان.','The source URL and the target URL cannot both point to the same resource.'=>'مەنبە ۋە نىشان ئادرېسىنىڭ ھەر ئىككىسىنى ئوخشاش بايلىققا توغرىلاشقا بولمايدۇ.','The specified target URL cannot be used as a target. It either does not exist, or it is not a pingback-enabled resource.'=>'كۆرسىتىلگەن نىشان تور ئادرېسى (URL) نى نىشان قىلىپ ئىشلىتىشكە بولمايدۇ. ئۇ يا مەۋجۇت ئەمەس يا ئۇ قايتۇرغىلى بولىدىغان مەنبە ئەمەس.','Is there no link to us?'=>'بىزگە ئۇلانما يوقمۇ؟','Could not write file %1$s (%2$s).'=>'ھۆججەت %1$s (%2$s) نى يازغىلى بولمىدى.','Sorry, you are not allowed to change the page author as this user.'=>'كەچۈرۈڭ، بۇ ئىشلەتكۈچى سۈپىتىدە بەت ئاپتورىنى ئۆزگەرتىشىڭىزگە رۇخسەت يوق.','Sorry, you are not allowed to change the post author as this user.'=>'كەچۈرۈڭ، بۇ ئىشلەتكۈچى سۈپىتىدە يازما ئاپتورىنى ئۆزگەرتىشىڭىزگە رۇخسەت يوق.','Sorry, you are not allowed to update posts as this user.'=>'بۇ ئىشلەتكۈچى ھالىتىدە بەت قۇرۇشىڭىزغا رۇخسەت بېرىلمىگەن.','Invalid post type.'=>'يازما تىپى ئىناۋەتسىز.','Sorry, you are not allowed to publish posts in this post type.'=>'كەچۈرۈڭ. سىزنىڭ بۇ بلوگدا يازما ئېلان قىلىشىڭىزغا ئىجازەت بېرىلمىگەن.','Sorry, no such post.'=>'كەچۈرۈڭ، بۇنداق يازما يوق.','Sorry, you are not allowed to publish this post.'=>'كەچۈرۈڭ. سىزنىڭ بۇ بلوگدا يازما ئېلان قىلىشىڭىزغا رۇخسەت يوق.','Either there are no posts, or something went wrong.'=>'بۇ يەردە يازما يوق، ياكى باشقا خاتالىق كۆرۈلدى.','Sorry, you are not allowed to update options.'=>'كەچۈرۈڭ، تاللانمىلارنى يېڭىلىشىڭىزغا رۇخسەت يوق.','Sorry, you are not allowed to access details of this post.'=>'كەچۈرۈڭ، بۇ يوللانمىنىڭ تەپسىلاتىنى كۆرۈشىڭىزگە رۇخسەت يوق.','A valid email address is required.'=>'ئىناۋەتلىك ئېلېكتىرونلۇق خەت ئادرېسى كىرگۈزۈڭ.','Comment author name and email are required.'=>'ئىنكاس يازغۇچىنىڭ ئىسمى ۋە ئېلېكتىرونلۇق خەت ئادرېسى تولدۇرۇلۇشى كېرەك.','Invalid post ID.'=>'يازما كىملىكى ئىناۋەتسىز.','Invalid comment status.'=>'ئىنكاس ھالىتى ئىناۋەتسىز.','Invalid comment ID.'=>'ئىنكاس كىملىكى (ID) ئىناۋەتسىز.','Failed to delete the page.'=>'بەتنى ئۆچۈرۈرەلمىدى.','Sorry, no such page.'=>'كەچۈرۈڭ، بۇنداق بەت يوق.','Allow new users to sign up'=>'يېڭى ئىشلەتكۈچىلەرنىڭ تىزىملىتىشىغا رۇخسەت','Time Zone'=>'ۋاقىت رايونى','Software Version'=>'يۇمشاق دېتال نەشرى','Software Name'=>'يۇمشاق دېتال نامى','User registration has been disabled.'=>'ئىشلەتكۈچى تىزىملىتىش توختىتىلغان.','Registration has been disabled.'=>'تىزىملىتىش چەكلىۋېتىلگەن.','If you have not received your email yet, there are a number of things you can do:'=>'ئېلخەتنى تېخى تاپشۇرۇۋالمىغان بولسىڭىز، قىلالايدىغان بىر قانچە ئىش بار:','Still waiting for your email?'=>'ئېلېكتىرونلۇق خەتنى تېخىچە ساقلاۋاتامسىز؟','Sign up'=>'تىزىملىتىش','If you do not activate your username within two days, you will have to sign up again.'=>'ئىشلەتكۈچى نامىڭىزنى ئىككى كۈن ئىچىدە ئاكتىپلىمىسىڭىز قايتىدىن تىزىملىتىشىڭىزغا توغرا كېلىدۇ.','But, before you can start using your new username, <strong>you must activate it</strong>.'=>'شۇغىنىسى، يېڭى ئىشلەتكۈچى نامىڭىزنى ئىشلىتىشتىن بۇرۇن <strong>چوقۇم ئۇنى ئاكتىپلىشىڭىز كېرەك</strong>.','%s is your new username'=>'يېڭى ئىشلەتكۈچى نامىڭىز %s بولدى','Next'=>'كېيىنكى','Just a username, please.'=>'ئىشلەتكۈچى نامىنىلا ئالاي.','Get your own %s account in seconds'=>'%s ھېساباتىدىن بىرنى ئېلىۋېلىڭ','There was a problem, please correct the form below and try again.'=>'بۇ يەردە خاتالىق كۆرۈلدى، تۆۋەندىكى ئورۇننى تۈزەتكەندىن كېيىن سىناپ كۆرۈڭ.','Email&nbsp;Address:'=>'ئېلخەت ئادرېسى:','(Must be at least 4 characters, lowercase letters and numbers only.)'=>'(چوقۇم كىچىك ھەرپ ۋە سانلا بار ئەڭ ئاز دېگەندە 4 ھەرپ بولۇشى كېرەك.)','Privacy:'=>'شەخسىيەت:','Oops: %s'=>'ئاپلا: %s','There does not seem to be any new mail.'=>'بۇ يەردە ھېچقانداق يېڭى ئېلخەت يوقتەك قىلىدۇ.','Slow down cowboy, no need to check for new mails so often!'=>'ئۇنچىۋالا ئالدىراپ كەتمەڭ، يېڭى ئېلخەتنى بۇنچە كۆپ تەكشۈرۈشىڭىز ھاجەتسىز!','You are now logged out.'=>'ھازىر چىقىپ كەتتىڭىز.','You have logged in successfully.'=>'مۇۋەپپەقىيەتلىك كىردىڭىز.','Lost your password?'=>'پارولنى ئۇنتۇپسىزمۇ؟','Register For This Site'=>'بۇ تور بېكەتكە تىزىملىتىش','Registration Form'=>'تىزىملىتىش جەدۋىلى','Get New Password'=>'يېڭى ئىم ئېلىش','Lost Password'=>'ئىم ئۇنتۇپتىمەن','<strong>Error:</strong> The email address is not correct.'=>'<strong>خاتالىق:</strong> ئېلخەت ئادرېسى توغرا ئەمەس.','<strong>Error:</strong> Please type your email address.'=>'<strong>خاتالىق:</strong> ئېلخەت ئادرېسىڭىزنى كىرگۈزۈڭ.','Invalid key.'=>'ئىناۋەتسىز ئاچقۇچ.','[%s] Password Reset'=>'[%s] ئىمنى ئەسلىگە قايتۇرۇش','Password reset is not allowed for this user'=>'بۇ ئىشلەتكۈچىنىڭ ئىمنى قايتا بېكىتىشىگە رۇخسەت قىلىنمىغان','<strong>Error:</strong> Please enter a username or email address.'=>'<strong>خاتالىق:</strong> ئىشلەتكۈچى ئاتى ياكى ئېلخەت ئادرېسىنى كىرگۈزۈڭ.','Powered by WordPress'=>'WordPress تە قۇرۇلدى','<strong>Error:</strong> WordPress %1$s requires MySQL %2$s or higher'=>'<strong>خاتالىق:</strong>WordPress %1$s كە MySQL %2$s ياكى ئۇنىڭدىن يۇقىرى نەشرىنى تەلەپ قىلىدۇ','Sidebar %d'=>'يانبالداق %d','Please log in again.'=>'قايتا كىرىڭ.','<strong>Error:</strong> Your account has been marked as a spammer.'=>'<strong> خاتالىق:</strong> ھېساباتىڭىزغا ئەخلەت خەت دەپ بەلگە قويۇلدى.','<strong>Error:</strong> The password field is empty.'=>'<strong> خاتالىق:</strong> ئىم سۆز بۆلىكى بوش.','<strong>Error:</strong> The username field is empty.'=>'<strong> خاتالىق:</strong> ئىشلەتكۈچى ئاتى سۆز بۆلىكى بوش.','Stylesheet is missing.'=>'ئۇسلۇب ھۆججىتى كەم.','The parent theme is missing. Please install the "%s" parent theme.'=>'ئانا ئۆرنەك تېپىلمىدى. "%s" ئانا ئۆرنەكنى ئورنىتىڭ.','Invalid object ID.'=>'ئوبيېكت كىملىكى(ID) ئىناۋەتسىز.','The slug &#8220;%s&#8221; is already in use by another term.'=>'باشقا نام &#8220;%s&#8221; باشقا بىر ئاتالغۇغا ئىشلىتىلىپ بولۇنغان.','Could not insert term into the database.'=>'ئاتالغۇنى ساندانغا قىستۇرغىلى بولمىدى.','Invalid item ID.'=>'تۈر كىملىكى(ID) ئىناۋەتسىز.','Empty Term.'=>'ئاتالغۇ بوش.','password strengthMedium'=>'ئوتتۇرا','Separate pattern categories with commas'=>'ئەندىزە سەھىپەسى پەش بىلەن ئايرىلىدۇ.','moved to the Trash.'=>'ئەخلەت ساندۇقىغا يۆتكىۋېتىلدى','Crunching&hellip;'=>'بىر تەرەپ قىلىنىۋاتىدۇ &hellip;','Upload stopped.'=>'يۈكلەش توختاپ قالدى.','Security error.'=>'بىخەتەرلىك خاتالىقى كۆرۈلدى.','IO error.'=>'IO خاتالىقى يۈز بەردى.','Upload failed.'=>'يۈكلىگىلى بولمىدى.','You may only upload 1 file.'=>'سىز پەقەت بىرلا ھۆججەت يۈكلىيەلەيسىز.','There was a configuration error. Please contact the server administrator.'=>'سەپلىمىدە خاتالىق كۆرۈلدى. مۇلازىمىتېر باشقۇرغۇچىسى بىلەن ئالاقىلىشىڭ.','An error occurred in the upload. Please try again later.'=>'يۈكلەشتە خاتالىق كۆرۈلدى. سەل تۇرۇپ سىناپ بېقىڭ.','This file is empty. Please try another.'=>'بۇ ھۆججەت قۇرۇق ئىكەن. باشقا بىرىنى سىناپ بېقىڭ.','You have attempted to queue too many files.'=>'بەك كۆپ ھۆججەتنى يۈكلەشكە ئۇرۇنۇۋاتىسىز.','This feature requires inline frames. You have iframes disabled or your browser does not support them.'=>'بۇ خاسلىق iframes نى تەلەپ قىلىدۇ. نۆۋەتتە iframes چەكلىۋېتىلگەن، ياكى تور كۆرگۈچىڭىز ئۇنى قوللىمايدۇ.','of'=>'جەمئىي','Image'=>'سۈرەت','&lt; Prev'=>'&lt; ئالدىنقى','Next &gt;'=>'كېيىنكى &gt;','Enter a description of the image'=>'سۈرەتكە چۈشەندۈرۈش يې